(84, 'Full', '{ name: \'document\',    items : [ \'Source\',\'-\',\'Save\',\'NewPage\',\'DocProps\',\'Preview\',\'Print\',\'-\',\'Templates\' ] },\r\n    { name: \'clipboard\',   items : [ \'Cut\',\'Copy\',\'Paste\',\'PasteText\',\'PasteFromWord\',\'-\',\'Undo\',\'Redo\' ] },\r\n    { name: \'editing\',     items : [ \'Find\',\'Replace\',\'-\',\'SelectAll\',\'-\',\'SpellChecker\', \'Scayt\' ] },\r\n    { name: \'forms\',       items : [ \'Form\', \'Checkbox\', \'Radio\', \'TextField\', \'Textarea\', \'Select\', \'Button\', \'ImageButton\', \'HiddenField\' ] },\r\n    \'/\',\r\n    { name: \'basicstyles\', items : [ \'Bold\',\'Italic\',\'Underline\',\'Strike\',\'Subscript\',\'Superscript\',\'-\',\'RemoveFormat\' ] },\r\n    { name: \'paragraph\',   items : [ \'NumberedList\',\'BulletedList\',\'-\',\'Outdent\',\'Indent\',\'-\',\'Blockquote\',\'CreateDiv\',\'-\',\'JustifyLeft\',\'JustifyCenter\',\'JustifyRight\',\'JustifyBlock\',\'-\',\'BidiLtr\',\'BidiRtl\' ] },\r\n    { name: \'links\',       items : [ \'Link\',\'Unlink\',\'Anchor\' ] },\r\n    { name: \'insert\',      items : [ \'Image\',\'Flash\',\'Table\',\'HorizontalRule\',\'Smiley\',\'SpecialChar\',\'PageBreak\' ] },\r\n    \'/\',\r\n    { name: \'styles\',      items : [ \'Styles\',\'Format\',\'Font\',\'FontSize\' ] },\r\n    { name: \'colors\',      items : [ \'TextColor\',\'BGColor\' ] },\r\n    { name: \'tools\',       items : [ \'Maximize\', \'ShowBlocks\',\'-\',\'About\' ] }', NULL, 1, 1);
INSERT INTO `sym_documentation` (`id`, `title`, `pages`, `content`, `content_formatted`) VALUES
(1, 'How to Create a Poll', '/publish/pages/,/publish/polls/,/publish/polls/new/,/publish/polls/edit/', '1. Create a new section (under Poll Entries) for poll backend data collection. <br /><br />\r\n\r\n2. Create a datasource and event with slug/handle that match that of the section you just created. Attach these as global resources.<br /><br />\r\n\r\n3. Create a new poll in the Content > Polls section --\r\n<br /><br />\r\n<ul>\r\n<li>Set the poll id as the slug/handle for the section, datasource & event</li>\r\n<li>Make sure your poll option handles match up with those in the data collection section</li>\r\n</ul>\r\n\r\n\r\n4. Place poll on a page using the content blocks. <br /><br />', '1. Create a new section (under Poll Entries) for poll backend data collection. <br /><br />\r\n\r\n2. Create a datasource and event with slug/handle that match that of the section you just created. Attach these as global resources.<br /><br />\r\n\r\n3. Create a new poll in the Content > Polls section --\r\n<br /><br />\r\n<ul>\r\n<li>Set the poll id as the slug/handle for the section, datasource &amp; event</li>\r\n<li>Make sure your poll option handles match up with those in the data collection section</li>\r\n</ul>\r\n\r\n\r\n4. Place poll on a page using the content blocks. <br /><br />'),
(2, 'Messages', '/publish/messages/,/publish/messages/new/,/publish/messages/edit/', 'The grey text between \'Rhydycar\' and \'West\' on the home page is selected randomly from the messages in this section. <br /><br />\r\nUse plain text, however line breaks can be inserted using the HTML <code>< br / ></code> tag (without spaces!)', 'The grey text between \'Rhydycar\' and \'West\' on the home page is selected randomly from the messages in this section. <br /><br />\r\nUse plain text, however line breaks can be inserted using the HTML <code>< br / ></code> tag (without spaces!)');
