(55, 492, 'the-impressive-and-all-inclusive-indoor-snow-centre-will-become-the-centre-of-excellence-for-snowsport-in-partnership-with-snowsport-wales-and-accessible-to-locals-day-tourists-adventurers-professionals-and-the-curious-this-500-metre-indoor-ski-slope-wil', '<p>The impressive and all-inclusive indoor snow centre will become the Centre of Excellence for Snowsport. In partnership with Snowsport Wales and accessible to locals, day tourists, adventurers, professionals and the curious, this 500-metre indoor ski slope will be one of the longest in Europe and the longest in the UK firmly putting Merthyr on the map.</p>\r\n\r\n<p>The facility will cater for all standards of skiing and snowboarding from complete beginner to Olympic level, with a terrain park, snow tubing, snow play area and ice climbing.&#160;</p>\r\n', '<p>The impressive and all-inclusive indoor snow centre will become the Centre of Excellence for Snowsport. In partnership with Snowsport Wales and accessible to locals, day tourists, adventurers, professionals and the curious, this 500-metre indoor ski slope will be one of the longest in Europe and the longest in the UK firmly putting Merthyr on the map.</p>\r\n\r\n<p>The facility will cater for all standards of skiing and snowboarding from complete beginner to Olympic level, with a terrain park, snow tubing, snow play area and ice climbing.&#160;</p>\r\n', 85),
(56, 759, 'the-first-of-its-kind-in-wales-this-exhilarating-facility-will-complement-the-neighbouring-bike-park-wales-and-is-designed-to-help-bikers-and-skaters-improve-their-skills-in-a-year-round-training-facility-including-foam-pits-dirt-jumps-learning-area-and-c', '<p>The first of its kind in Wales, this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', '<p>The first of its kind in Wales, this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', 63),
(98, 614, 'rhydycar-west-is-rich-in-heritage-and-the-site-is-home-to-scheduled-monuments-and-other-historic-assets-of-importance-which-illustrate-the-history-of-the-area-from-the-17th-to-20th-centuries-unfortunately-some-of-these-are-degrading-and-disappearing-w', '<p>Rhydycar West is rich in heritage, and the site is home to scheduled monuments and other historic assets of importance which illustrate the history of the area from the 17th to 20th centuries.</p>\r\n\r\n<p>Unfortunately some of these are degrading and disappearing which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n', '<p>Rhydycar West is rich in heritage, and the site is home to scheduled monuments and other historic assets of importance which illustrate the history of the area from the 17th to 20th centuries.</p>\r\n\r\n<p>Unfortunately some of these are degrading and disappearing which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n', 70),
