(92, 692, 'above-our-valley-between-cardiff-and-the-brecon-beacons-lies-575-acres-of-precious-land-known-as-rhydycar-west-it-has-remained-untouched-since-the-mid-20th-century-the-plan-is-for-our-land-to-become-the-focus-for-a-combination-of-experiences-that-will-c', '<p>Above our valley, between Cardiff and the Brecon Beacons, lies 575 acres of precious land. Known as Rhydycar West it has remained untouched since the mid-20th century. The plan is for our land to become the focus for a combination of experiences that will create an exciting tourism, leisure and international sporting destination, right here in one of our south Wales valleys. The developments will embrace and be created around the natural beauty and heritage of our area &#8211; to revitalise our history and to create new heritage for our future.</p>\r\n', '<p>Above our valley, between Cardiff and the Brecon Beacons, lies 575 acres of precious land. Known as Rhydycar West it has remained untouched since the mid-20th century. The plan is for our land to become the focus for a combination of experiences that will create an exciting tourism, leisure and international sporting destination, right here in one of our south Wales valleys. The developments will embrace and be created around the natural beauty and heritage of our area &#8211; to revitalise our history and to create new heritage for our future.</p>\r\n', 90),
(50, 700, 'rhydycar-west-wouldn-and-8217-t-be-possible-without-the-support-from-the-local-community-and-its-surroundings-and-heritage-is-very-much-a-part-of-who-we-are-and-what-we-do-the-development-will-boost-the-regional-economy-bringing-vital-tourism-into-the-a', '<p>Rhydycar West wouldn&#8217;t be possible without the support from the local community, and its surroundings and heritage is very much a part of who we are and what we do. The development will boost the regional economy, bringing vital tourism into the area and creating hundreds of jobs for our community.</p>\r\n\r\n<p>Alongside the job opportunities, Rhydycar West will create up to 650 much needed homes for locals and workers alike creating a brand new neighbourhood and adding to the diverse community. With it, children&#8217;s playgrounds, community facilities, shops, restaurants, and fishing ponds will be created to be enjoyed by everyone.</p>\r\n', '<p>Rhydycar West wouldn&#8217;t be possible without the support from the local community, and its surroundings and heritage is very much a part of who we are and what we do. The development will boost the regional economy, bringing vital tourism into the area and creating hundreds of jobs for our community.</p>\r\n\r\n<p>Alongside the job opportunities, Rhydycar West will create up to 650 much needed homes for locals and workers alike creating a brand new neighbourhood and adding to the diverse community. With it, children&#8217;s playgrounds, community facilities, shops, restaurants, and fishing ponds will be created to be enjoyed by everyone.</p>\r\n', 99),
(57, 760, 'any-holiday-hot-spot-and-thriving-community-hub-wouldn-and-8217-t-be-complete-without-a-swimming-pool-and-rhydycar-west-has-really-splashed-out-with-the-largest-indoor-water-park-in-the-uk-planned-complete-with-an-indoor-surf-simulator-ride-the-waves-fl', '<p>Any holiday hot spot and thriving community hub wouldn&#8217;t be complete without a swimming pool, and Rhydycar West has really splashed out with the largest indoor water park in the UK planned, complete with an indoor surf simulator. Ride the waves, fly down flumes, or paddle in the pool, the choice is yours.</p>\r\n', '<p>Any holiday hot spot and thriving community hub wouldn&#8217;t be complete without a swimming pool, and Rhydycar West has really splashed out with the largest indoor water park in the UK planned, complete with an indoor surf simulator. Ride the waves, fly down flumes, or paddle in the pool, the choice is yours.</p>\r\n', 53),
(21, 701, 'there-is-accommodation-to-suit-all-holidays-all-budgets-and-all-visitors-at-rhydycar-west-the-luxury-hotel-and-spa-with-conference-facilities-provides-a-year-round-attraction-offering-facials-massages-jacuzzi-and-xxx-whether-a-pamper-package-is-what-you', '<p>There is accommodation to suit all holidays, all budgets and all visitors at Rhydycar West. The luxury hotel and spa with conference facilities, provides a year-round attraction offering <em>facials, massages, Jacuzzi, and xxx</em>. Whether a pamper package is what you desire, or a sports massage following a days&#8217; cycling, you can call this hotel home for the day or for your stay. For trekkers on a budget, the family-friendly accommodation offers an economical and comfy solution all within walking distance to the local amenities.</p>\r\n', '<p>There is accommodation to suit all holidays, all budgets and all visitors at Rhydycar West. The luxury hotel and spa with conference facilities, provides a year-round attraction offering <em>facials, massages, Jacuzzi, and xxx</em>. Whether a pamper package is what you desire, or a sports massage following a days&#8217; cycling, you can call this hotel home for the day or for your stay. For trekkers on a budget, the family-friendly accommodation offers an economical and comfy solution all within walking distance to the local amenities.</p>\r\n', 84),
(145, 706, 'we-will-maintain-each-and-every-one-specifically-creating-the-design-of-our-scheme-to-embrace-appreciate-and-value-them-however-even-though-hundreds-of-years-of-neglect-have-taken-their-toll-which-means-many-structures-have-deteriorated-we-are-determined', '<p>We will maintain each and every one, specifically creating the design of our scheme to embrace, appreciate and value them. However, even though hundreds of years of neglect have taken their toll, which means many structures have deteriorated, we are determined to reclaim our historic legacies and restore them.</p>\r\n', '<p>We will maintain each and every one, specifically creating the design of our scheme to embrace, appreciate and value them. However, even though hundreds of years of neglect have taken their toll, which means many structures have deteriorated, we are determined to reclaim our historic legacies and restore them.</p>\r\n', 49),
(24, 716, 'a-range-of-themed-tents-yurts-and-cabins-set-within-the-forest-environment-of-the-wider-site-will-offer-alternative-accommodation-options-to-visitors-in-a-managed-high-quality-ecological-setting-leave-the-home-comforts-firmly-at-home-and-take-this-unique', '<p>A range of themed tents, yurts and cabins set within the forest environment of the wider site, will offer alternative accommodation options to visitors in a managed, high quality ecological setting. Leave the home comforts firmly at home and take this unique opportunity to become one with nature in a traditional tent. Or, for those wanting a little luxury, a cabin would suit you and your organic break. Or for those intrepid trekkers who want somewhere in the middle, our glamping style yurts will provide the perfect place for you.</p>\r\n', '<p>A range of themed tents, yurts and cabins set within the forest environment of the wider site, will offer alternative accommodation options to visitors in a managed, high quality ecological setting. Leave the home comforts firmly at home and take this unique opportunity to become one with nature in a traditional tent. Or, for those wanting a little luxury, a cabin would suit you and your organic break. Or for those intrepid trekkers who want somewhere in the middle, our glamping style yurts will provide the perfect place for you.</p>\r\n', 90),
(25, 717, 'walk-hike-trek-run-jog-meander-stroll-or-cycle-your-way-around-xxxmiles-acres-of-beautiful-woodlands-the-added-bonus-of-a-zipline-for-all-ages-will-provide-additional-family-friendly-fun-alongside-team-building-activities', '<p>Walk, hike, trek, run, jog, meander, stroll or cycle your way around <em>xxxmiles/acres</em> of beautiful woodlands.</p>\r\n\r\n<p>The added bonus of a zipline for all ages will provide additional family-friendly fun alongside team-building activities.</p>\r\n', '<p>Walk, hike, trek, run, jog, meander, stroll or cycle your way around <em>xxxmiles/acres</em> of beautiful woodlands.</p>\r\n\r\n<p>The added bonus of a zipline for all ages will provide additional family-friendly fun alongside team-building activities.</p>\r\n', 33),
(99, 718, 'much-of-rhydycar-west-is-ecologically-rich-with-parts-being-designated-as-sssi-site-of-special-scientific-interest-or-sinc-site-of-importance-for-nature-conservation-the-first-step-in-designing-the-aspiring-regeneration-scheme-was-to-fully-understand', '<p>Much of Rhydycar West is ecologically rich, with parts being designated as SSSI (Site of Special Scientific Interest) or SINC (Site of Importance for Nature Conservation). The first step in designing the aspiring regeneration scheme was to fully understand the environment across the site and to use that knowledge to design in harmony with the landscape.</p>\r\n\r\n<p>Surveys have been carried out on habitats and plant species, birds (winter and spring/summer), amphibians and reptiles, dormice, bats, badgers and invertebrates including butterflies. The known importance of various parts of the site for grassland fungi (such as waxcaps) has also been assessed by specialist surveys.</p>\r\n\r\n<p>We know that these designations, and the species and habitats that underpin them, present a challenge to achieving the project, but we are determined to work with these constraints as far as possible. Over 70% of the site will remain undeveloped and careful planning will ensure development components are sited sensitively and that unavoidable damage is mitigated or compensated.</p>\r\n', '<p>Much of Rhydycar West is ecologically rich, with parts being designated as SSSI (Site of Special Scientific Interest) or SINC (Site of Importance for Nature Conservation). The first step in designing the aspiring regeneration scheme was to fully understand the environment across the site and to use that knowledge to design in harmony with the landscape.</p>\r\n\r\n<p>Surveys have been carried out on habitats and plant species, birds (winter and spring/summer), amphibians and reptiles, dormice, bats, badgers and invertebrates including butterflies. The known importance of various parts of the site for grassland fungi (such as waxcaps) has also been assessed by specialist surveys.</p>\r\n\r\n<p>We know that these designations, and the species and habitats that underpin them, present a challenge to achieving the project, but we are determined to work with these constraints as far as possible. Over 70% of the site will remain undeveloped and careful planning will ensure development components are sited sensitively and that unavoidable damage is mitigated or compensated.</p>\r\n', 160),
(164, 724, 'whether-you-want-to-find-out-more-about-the-proposals-or-you-have-any-suggestions-on-our-emerging-plans-please-get-in-touch-your-opinion-means-a-lot-to-us-and-we-take-all-feedback-on-board-so-that-we-can-create-a-destination-with-something-for-everyone', '<p>Whether you want to find out more about the proposals, or you have any suggestions on our emerging plans, please get in touch. Your opinion means a lot to us and we take all feedback on board so that we can create a destination with something for everyone.</p>\r\n', '<p>Whether you want to find out more about the proposals, or you have any suggestions on our emerging plans, please get in touch. Your opinion means a lot to us and we take all feedback on board so that we can create a destination with something for everyone.</p>\r\n', 48),
(165, 742, 'whether-you-want-to-find-out-more-about-the-proposals-or-you-have-any-suggestions-on-our-emerging-plans-please-get-in-touch-your-opinion-means-a-lot-to-us-and-we-take-all-feedback-on-board-so-that-we-can-create-a-destination-with-something-for-everyone-2', '<p>Whether you want to find out more about the proposals, or you have any suggestions on our emerging plans, please get in touch. Your opinion means a lot to us and we take all feedback on board so that we can create a destination with something for everyone.</p>\r\n', '<p>Whether you want to find out more about the proposals, or you have any suggestions on our emerging plans, please get in touch. Your opinion means a lot to us and we take all feedback on board so that we can create a destination with something for everyone.</p>\r\n', 48),
(91, 725, 'rhydycar-west-provides-an-ideal-setting-to-help-our-region-re-define-itself-as-a-destination-for-activity-tourism-this-will-generate-new-economic-opportunities-for-our-community-and-will-create-an-important-role-for-merthyr-tydfil-as-a-contributor-to-the', '<p>Rhydycar West provides an ideal setting to help our region re-define itself as a destination for activity tourism. This will generate new economic opportunities for our community, and will create an important role for Merthyr Tydfil as a contributor to the evolving City Region.</p>\r\n\r\n<p>Many long-term local jobs will be created, as well as related opportunities for businesses throughout our region.</p>\r\n\r\n<p>To meet our needs as local people, and those of new workers who will be attracted to our area by this scheme, new housing is incorporated into the scheme. To complement the leisure facilities, our brand new neighbourhood will include a playground for our children, facilities for our community, fishing ponds, restaurants and other specialist shops.</p>\r\n', '<p>Rhydycar West provides an ideal setting to help our region re-define itself as a destination for activity tourism. This will generate new economic opportunities for our community, and will create an important role for Merthyr Tydfil as a contributor to the evolving City Region.</p>\r\n\r\n<p>Many long-term local jobs will be created, as well as related opportunities for businesses throughout our region.</p>\r\n\r\n<p>To meet our needs as local people, and those of new workers who will be attracted to our area by this scheme, new housing is incorporated into the scheme. To complement the leisure facilities, our brand new neighbourhood will include a playground for our children, facilities for our community, fishing ponds, restaurants and other specialist shops.</p>\r\n', 117),
(60, 763, 'evidence-to-show-the-history-of-the-site-and-its-surroundings-is-sparse-and-8211-in-part-because-of-the-lack-of-systematic-archaeological-investigation-and-also-because-of-and-8216-poor-visibility-and-8217-due-to-the-intense-industrial-activity-aro', '<p>Evidence to show the history of the site and its surroundings is sparse &#8211; in part because of the lack of systematic archaeological investigation and also because of &#8216;poor visibility&#8217; due to the intense industrial activity around Merthyr in the 18th &#38; 19th centuries.</p>\r\n\r\n<p>The likelihood is that the area was settled - to some degree - from at least the Bronze Age, with memorial monuments such as round gravestones spread across the elevated ground around Merthyr Tydfil.</p>\r\n\r\n<p>The area most likely comprised a mixture of agricultural fields, woodland in the delves and stream valleys and moorland or heath on the high ground between the principal river valleys.</p>\r\n\r\n<p>This would only have changed slightly moving into the Iron Age, where the nearest recorded evidence for a human presence is more than a kilometre away, where the remains of a hut settlement have previously been identified on the western slopes of Mynydd, Aberdare.</p>\r\n\r\n<p>The site and its surroundings are rich in minerals, with iron ore especially appearing close to the surface in the stream valleys. It is possible that these accessible natural resources could have proved attractive to settlement in the Iron Age, but any evidence will have been concealed or destroyed by subsequent exploitation of the same deposits in more recent times.</p>\r\n', '<p>Evidence to show the history of the site and its surroundings is sparse &#8211; in part because of the lack of systematic archaeological investigation and also because of &#8216;poor visibility&#8217; due to the intense industrial activity around Merthyr in the 18th &#38; 19th centuries.</p>\r\n\r\n<p>The likelihood is that the area was settled - to some degree - from at least the Bronze Age, with memorial monuments such as round gravestones spread across the elevated ground around Merthyr Tydfil.</p>\r\n\r\n<p>The area most likely comprised a mixture of agricultural fields, woodland in the delves and stream valleys and moorland or heath on the high ground between the principal river valleys.</p>\r\n\r\n<p>This would only have changed slightly moving into the Iron Age, where the nearest recorded evidence for a human presence is more than a kilometre away, where the remains of a hut settlement have previously been identified on the western slopes of Mynydd, Aberdare.</p>\r\n\r\n<p>The site and its surroundings are rich in minerals, with iron ore especially appearing close to the surface in the stream valleys. It is possible that these accessible natural resources could have proved attractive to settlement in the Iron Age, but any evidence will have been concealed or destroyed by subsequent exploitation of the same deposits in more recent times.</p>\r\n', 208),
(61, 764, 'the-romans-did-not-leave-their-mark-on-the-site-but-this-may-in-part-reflect-the-intensity-of-later-activity-between-the-17th-and-20th-centuries-which-was-focused-on-the-exploitation-and-transportation-of-the-area-and-8217-s-significant-mineral-wealth', '<p>The Romans did not leave their mark on the site, but this may in part reflect the intensity of later activity between the 17th and 20th centuries which was focused on the exploitation and transportation of the area&#8217;s significant mineral wealth.</p>\r\n\r\n<p>There was certainly a Roman military presence in the area, and the mineral resources located close to the surface would no doubt have been attractive in the same way that they were elsewhere in Wales.</p>\r\n\r\n<p>Roman activity was probably focused on the fort at Pen-y-Darren (on the SE side of Merthyr), which was connected to the wider arrangement of similar forts in south and mid Wales by the network of roads engineered and built by the army.&#160;</p>\r\n', '<p>The Romans did not leave their mark on the site, but this may in part reflect the intensity of later activity between the 17th and 20th centuries which was focused on the exploitation and transportation of the area&#8217;s significant mineral wealth.</p>\r\n\r\n<p>There was certainly a Roman military presence in the area, and the mineral resources located close to the surface would no doubt have been attractive in the same way that they were elsewhere in Wales.</p>\r\n\r\n<p>Roman activity was probably focused on the fort at Pen-y-Darren (on the SE side of Merthyr), which was connected to the wider arrangement of similar forts in south and mid Wales by the network of roads engineered and built by the army.&#160;</p>\r\n', 118),
(62, 765, 'a-settlement-is-recorded-in-methyr-in-the-middle-ages-but-little-is-known-about-its-form-and-function-it-had-most-probably-declined-and-been-abandoned-by-the-17th-century-when-the-area-is-recorded-as-only-containing-shepherds-the-likelihood-is-that-m', '<p>A settlement is recorded in Methyr in the Middle Ages, but little is known about its form and function. It had most probably declined and been abandoned by the 17th century, when the area is recorded as only containing shepherds.</p>\r\n\r\n<p>The likelihood is that medieval Merthyr grew up around a crossing point on the River Taff, but there is no evidence it was anything more substantial than a village. Its economy was probably based around agricultural and some passing commerce.</p>\r\n\r\n<p>The only recorded evidence for the appearance of the site in the Middle Ages refers to a large meadow alongside the Nant Cwm Glo, which suggests at least some animal grazing on the slopes of the Taff Valley.</p>\r\n\r\n<p>Some of the farmsteads recorded at and around the site on 19th century maps may have medieval origins, but more certain evidence for medieval agricultural can be drawn from the patchwork of irregularly shaped enclosures which still survive.</p>\r\n', '<p>A settlement is recorded in Methyr in the Middle Ages, but little is known about its form and function. It had most probably declined and been abandoned by the 17th century, when the area is recorded as only containing shepherds.</p>\r\n\r\n<p>The likelihood is that medieval Merthyr grew up around a crossing point on the River Taff, but there is no evidence it was anything more substantial than a village. Its economy was probably based around agricultural and some passing commerce.</p>\r\n\r\n<p>The only recorded evidence for the appearance of the site in the Middle Ages refers to a large meadow alongside the Nant Cwm Glo, which suggests at least some animal grazing on the slopes of the Taff Valley.</p>\r\n\r\n<p>Some of the farmsteads recorded at and around the site on 19th century maps may have medieval origins, but more certain evidence for medieval agricultural can be drawn from the patchwork of irregularly shaped enclosures which still survive.</p>\r\n', 156),
(102, 766, 'a-feature-of-the-pre-industrial-landscape-in-the-area-is-an-historical-association-with-early-non-conformist-christianity-best-exemplified-by-the-remains-of-cwm-glo-chapel-found-on-the-site-the-landscape-of-densely-wooded-delves-and-secluded-stream-va', '<p>A feature of the pre-industrial landscape in the area is an historical association with early non-conformist Christianity, best exemplified by the remains of Cwm Glo Chapel found on the site.</p>\r\n\r\n<p>The landscape of densely wooded delves and secluded stream valleys, which still makes movement challenging today, would have been attractive for non-conformists looking to hold meetings out of the way of prying eyes and the reach of the authorities.</p>\r\n\r\n<p>This association with non-conformity is best exemplified by the remains of Cwm Glo Chapel; now designated as a scheduled monument because of the national importance of its standing fabric and archaeological remains.</p>\r\n\r\n<p>However, other historic farmsteads, such as Cwm Glo and Blaen Canaid also have important historical associations with these groups because they provided meeting places in the early days.</p>\r\n\r\n<p>This was a period of rapid change around Methyr &#8211; as well as across the country; with the agricultural landscape being increasingly opened up and exploited for small scale mineral extraction from the 17th century onwards.</p>\r\n\r\n<p>This growing industrialisation transformed the landscape within the site; the farmstead at Pen-y-Coedcae became mine workers&#8217; accommodation, while the farm at Cwm Du eventually disappeared altogether beneath a spoil heap.</p>\r\n', '<p>A feature of the pre-industrial landscape in the area is an historical association with early non-conformist Christianity, best exemplified by the remains of Cwm Glo Chapel found on the site.</p>\r\n\r\n<p>The landscape of densely wooded delves and secluded stream valleys, which still makes movement challenging today, would have been attractive for non-conformists looking to hold meetings out of the way of prying eyes and the reach of the authorities.</p>\r\n\r\n<p>This association with non-conformity is best exemplified by the remains of Cwm Glo Chapel; now designated as a scheduled monument because of the national importance of its standing fabric and archaeological remains.</p>\r\n\r\n<p>However, other historic farmsteads, such as Cwm Glo and Blaen Canaid also have important historical associations with these groups because they provided meeting places in the early days.</p>\r\n\r\n<p>This was a period of rapid change around Methyr &#8211; as well as across the country; with the agricultural landscape being increasingly opened up and exploited for small scale mineral extraction from the 17th century onwards.</p>\r\n\r\n<p>This growing industrialisation transformed the landscape within the site; the farmstead at Pen-y-Coedcae became mine workers&#8217; accommodation, while the farm at Cwm Du eventually disappeared altogether beneath a spoil heap.</p>\r\n', 194),
(169, 789, 'come-and-meets-us-find-out-more-wed-love-to-hear-what-you-think', '<p>Come and meets us. Find out more. We\'d love to hear what you think.</p>\r\n', '<p>Come and meets us. Find out more. We\'d love to hear what you think.</p>\r\n', 14),
(174, 881, 'major-indoor-snow-centres-are-of-course-nothing-new-across-continental-europe-our-snow-centre-would-be-based-on-similar-successful-facilities-there-are-currently-several-of-these-on-the-table-for-spain-france-and-norway-it-is-only-a-matter-of-time-befo', '<p>Major indoor snow centres are, of course, nothing new across continental Europe. Our snow centre would be based on similar successful facilities. There are currently several of these on the table for Spain, France and Norway. It is only a matter of time before the UK has one. And we want it to be in Wales! Indoor snow centres have been run for many years as viable, sustainable and profitable businesses, bringing tourists and snowsport enthusiasts to their region, along with providing a facility of great value and benefit to the local residents. Proof of their popularity is that visitors are often required to book tickets weeks in advance at certain times throughout the year.</p>\r\n\r\n<p>Our goal for Rhydycar West is to achieve all this and more, utilizing the modern technology we have on hand today, combined with greener energy to further drive our sustainability.<br />\r\nThe UK is home to a number of smaller indoor ski centres, such as Hemel Hempstead, Milton Keynes and Tamworth. Manchester currently has the longest slope in the UK at 180m.<br />\r\nAs to the long indoor slopes on the continent, there are currently four with others on the way.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h2>Lithuania</h2>\r\n\r\n<p>Snow Arena in Lithuania has two indoor slopes, outdoor skiing tracks, snow park and a recreation complex that includes restaurants.</p>\r\n\r\n<h2>Netherlands</h2>\r\n\r\n<p>Netherlands-based SnowWorld at Landgraaf includes a 520m slope, fun park and integrated hotel and restaurants.</p>\r\n\r\n<h2>Germany</h2>\r\n\r\n<p>Alpincentre at Bottrop in Germany has an indoor slope of 640 metres in length which boasts a real corner along its course.</p>\r\n\r\n<h2>France</h2>\r\n\r\n<p>At 620m in length, Snowhall in Amn&#233;ville (France) offers several spaces and is suitable for all skill levels: a beginner slope, a toboggan run for the little ones, a tubing zone, a big track and a snowpark for freestylers.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<p>Interestingly, both Bottrop and Landgraaf were built on former coal mining land. Much like Rhydycar West, the natural form of the former mining terrain at these locations provided the perfect setting and supporting slope for the immense project.</p>\r\n', '<p>Major indoor snow centres are, of course, nothing new across continental Europe. Our snow centre would be based on similar successful facilities. There are currently several of these on the table for Spain, France and Norway. It is only a matter of time before the UK has one. And we want it to be in Wales! Indoor snow centres have been run for many years as viable, sustainable and profitable businesses, bringing tourists and snowsport enthusiasts to their region, along with providing a facility of great value and benefit to the local residents. Proof of their popularity is that visitors are often required to book tickets weeks in advance at certain times throughout the year.</p>\r\n\r\n<p>Our goal for Rhydycar West is to achieve all this and more, utilizing the modern technology we have on hand today, combined with greener energy to further drive our sustainability.<br />\r\nThe UK is home to a number of smaller indoor ski centres, such as Hemel Hempstead, Milton Keynes and Tamworth. Manchester currently has the longest slope in the UK at 180m.<br />\r\nAs to the long indoor slopes on the continent, there are currently four with others on the way.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h2>Lithuania</h2>\r\n\r\n<p>Snow Arena in Lithuania has two indoor slopes, outdoor skiing tracks, snow park and a recreation complex that includes restaurants.</p>\r\n\r\n<h2>Netherlands</h2>\r\n\r\n<p>Netherlands-based SnowWorld at Landgraaf includes a 520m slope, fun park and integrated hotel and restaurants.</p>\r\n\r\n<h2>Germany</h2>\r\n\r\n<p>Alpincentre at Bottrop in Germany has an indoor slope of 640 metres in length which boasts a real corner along its course.</p>\r\n\r\n<h2>France</h2>\r\n\r\n<p>At 620m in length, Snowhall in Amn&#233;ville (France) offers several spaces and is suitable for all skill levels: a beginner slope, a toboggan run for the little ones, a tubing zone, a big track and a snowpark for freestylers.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<p>Interestingly, both Bottrop and Landgraaf were built on former coal mining land. Much like Rhydycar West, the natural form of the former mining terrain at these locations provided the perfect setting and supporting slope for the immense project.</p>\r\n', 331),
(109, 858, 'rhydycar-west-provides-an-ideal-setting-to-help-our-region-re-define-itself-as-a-destination-for-activity-tourism-this-will-generate-new-economic-opportunities-for-our-community-and-will-create-an-important-role-for-merthyr-tydfil-as-a-contributor-to-the-', '<p>Rhydycar West provides an ideal setting to help our region re-define itself as a destination for activity tourism. This will generate new economic opportunities for our community, and will create an important role for Merthyr Tydfil as a contributor to the evolving City Region.</p>\r\n\r\n<p>Many long-term local jobs will be created, as well as related opportunities for businesses throughout our region.</p>\r\n\r\n<p>To meet our needs as local people, and those of new workers who will be attracted to our area by this scheme, new housing is incorporated into the scheme. To complement the leisure facilities, our brand new neighbourhood will include a playground for our children, facilities for our community, fishing ponds, restaurants and other specialist shops.</p>\r\n', '<p>Rhydycar West provides an ideal setting to help our region re-define itself as a destination for activity tourism. This will generate new economic opportunities for our community, and will create an important role for Merthyr Tydfil as a contributor to the evolving City Region.</p>\r\n\r\n<p>Many long-term local jobs will be created, as well as related opportunities for businesses throughout our region.</p>\r\n\r\n<p>To meet our needs as local people, and those of new workers who will be attracted to our area by this scheme, new housing is incorporated into the scheme. To complement the leisure facilities, our brand new neighbourhood will include a playground for our children, facilities for our community, fishing ponds, restaurants and other specialist shops.</p>\r\n', 117);
INSERT INTO `sym_entries_data_256` (`id`, `entry_id`, `handle`, `value`, `value_formatted`, `word_count`) VALUES
(87, 810, 'gwlad-gwlad-and-8230-pleidiol-wyf-i-and-8217-m-gwlad-our-country-our-land-and-8230-faithful-am-i-to-my-land-our-land-has-sustained-us-for-countless-generations-we-are-its-original-inhabitants-the-cymry-and-8211-communities-together-each-with', '<h2>Gwlad, gwlad&#8230; pleidiol wyf i&#8217;m gwlad<br />\r\nOur country, our land&#8230; faithful am I to my land</h2>\r\n\r\n<p>Our land has sustained us for countless generations. We are its original inhabitants, the Cymry &#8211; communities together, each with our own identity. Our roots are embedded deep into our heritages of invasion, conversion and innovation &#8211; which brought occupation, religion and industrial revolution to our hills and valleys.</p>\r\n\r\n<p>Our land has created our lifeblood. Like ancient seams of mineral richness, our identity has been founded, settled in layers &#8211; we belong here.</p>\r\n\r\n<p>When revolution came to our valley, our sweat, like streams of flowing water, scoured the ironstone and coal from our land with forceful energies. Our human mettle, which sapped our strength in muscular effort, succumbed to serve the white-hot furnaces of industry. Amongst clouds of smoke and steam, iron and coal flowed solid from our valley, away from our shores &#8211; exporting our power across seas into lands not our own.</p>\r\n\r\n<p>We gave our lives then, as though martyrs to an industrial cause.</p>\r\n\r\n<p>Until &#8211; when our land had become exhausted, when we had exerted all that the revolution demanded &#8211; then, like the spoil laid waste from our iron and coal, we too were discarded. We remain amongst remains. Like industrial scars scoured in the erosion of wind and rain, our communities, our togetherness, lay abandoned in silence and tears.</p>\r\n\r\n<p>But we are faithful to our land. We belong&#8230; here.</p>\r\n\r\n<p>And now, towards our shores, as in our myths and legends, a new story comes to our valley &#8211; Marvel, a wonderful opportunity. Now we can re-empower our lives, and restore energy in our land.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<p>Together, re-enabled in our communities, we will be able to re-ignite our fiery spirits &#8211; and, by re-energising our own mettle, with determination, stamina and strength of character, we will craft new kinds of heritages, revitalise many lives here and out into the wider world. By reclaiming our land for good, anyone who strives can achieve their hopes and dreams.</p>\r\n\r\n<p>Marvel&#8230; hmmm, now here&#8217;s a new story we can tell. How astonishing &#8211; here you are, coming to our valley with an invitation for us to share our own thoughts and ideas for our land. Well, we have wanted to find someone who will listen to us, and will work together with us &#8211; to help us bring jobs, opportunities, new life into our communities.</p>\r\n\r\n<p>You say you&#8217;d like to help us regain our capabilities &#8211; our own determination, energy, strength, our depth of character, our personal &#8216;vigour&#8217;.</p>\r\n\r\n<p>As you have discovered, our land is precious to us &#8211; very precious. It&#8217;s the reason we live here &#8211; even though the industry has gone, and so many of our jobs and livelihoods with it. But we&#8217;re hearing you say that this same land has so much more to give us &#8211; more than any of the old industries could ever have achieved.</p>\r\n\r\n<p>OK, together with your help, we could bring our hopes and dreams into actual everyday reality. Yes, we could even create new kinds of lasting heritage for generations to come&#8230;</p>\r\n\r\n<p>Unlike the attitudes that brought that old type of industry, this time, just like us, you really respect our land. And, you value our human dignity. We&#8217;ve heard you say that, by working together, our land&#8217;s ecology will flourish, our past heritage will be celebrated &#8211; our future heritage, which we can create together, will be empowering for anyone who has enthusiasm, courage, get-up-and-go, grit, strength of character &#8211; in fact, whoever is energised and motivated enough to achieve their heartfelt ambitions&#8230;</p>\r\n\r\n<p>It&#8217;s true&#8230; we are more than our past, and much more than our present circumstances. When we dig into our own abilities, and mine into our spirited human energy, then with help, by planning and working together we can create new life for our valley, our land.</p>\r\n\r\n<p>In fact, come to think of it, we can set an example for post-industrial communities like ours world-wide &#8211; hmmm&#8230; what an amazing thought.</p>\r\n\r\n<p>With fresh, inspired, life-changing thinking, the possibilities that we could bring into being, actually begin in our wildest dreams. Just imagine what that could achieve&#8230;</p>\r\n\r\n<p>Marvel, we&#8217;ve heard that you have brought ideas to share with us. Ideas which will create wonderful opportunities for us all to benefit now and into the future. It seems that you really do want to make it possible for us to bring our own ambitions into reality. And to begin, you are setting an example, because you&#8217;d like to share your amazing ambitions with us.</p>\r\n\r\n<p>Together, we&#8217;d like our plans to respect our land and build upon its natural features. But unlike the past, this time we&#8217;d like to create a permanent, healthy future heritage that gives value to our history, sustains our ecology, generates livelihoods, strengthens and empowers people &#8211; right here in our land.</p>\r\n\r\n<p>We&#8217;re aware that there is a hill above Rhydycar, where adventure have already begun. Yet, we reckon that together with you we can add more&#8230; much more to the richness of that land. The question is, how wide, how high, how deep are our ambitions?</p>\r\n\r\n<p>So, let&#8217;s imagine together. Let&#8217;s be brave enough to bring our dreams into real, down-to-earth reality&#8230;</p>\r\n\r\n<p>To begin, because it&#8217;s so precious, what if we set-aside most of our land to respect our natural biodiversity, give value to our ecology, and yet also open-up possibilities for people to enjoy our land, to enhance their own health-and wellbeing?</p>\r\n\r\n<p>Because we&#8217;d also like to create new opportunities, what if we embraced only a smaller portion of our land to create homes, jobs, leisure and amazing experiences?</p>\r\n\r\n<p>So, for example, what if together we created spaces and places for people to be together, to enjoy, to relax, to learn, to share stories, to be energised, to feel alive, to embrace challenges, to achieve their ambitions and to be at home &#8211; right here on our land?</p>\r\n\r\n<p>Oh, and come to think of it, wouldn&#8217;t it be wonderful if we created indoor surf and water, bike and skate parks, treetop challenges &#8211; and camping, glamping and hotels for visitors to stay?</p>\r\n\r\n<p>Let&#8217;s imagine even more spectacular ambitions&#8230; what if we raised the standards to the highest world-class level?</p>\r\n\r\n<p>What if we built Europe&#8217;s longest indoor snow, ski and snowboard centre, so that, alongside visitors from anywhere in the world, Olympic athletes could train hard and develop their talents?</p>\r\n\r\n<p>While we&#8217;re at it, what if we created ground-breaking, life-changing opportunities to explore new forms of energy, cultivation, education, design, technologies, research and development..?</p>\r\n\r\n<p>Yes, what if, what if&#8230;</p>\r\n\r\n<p>Why not? Maybe together with your help we actually can, at last, create a new kind of heritage, to enjoy now and to set an example for generations to follow&#8230;</p>\r\n\r\n<p>Awesome. What an amazing thought.</p>\r\n\r\n<p>Marvellous&#8230;</p>\r\n\r\n<p>Together, re-enabled in our communities, we will be able to re-ignite our fiery spirits &#8211; and, by re-energising our own mettle, with determination, stamina and strength of character, we will craft new kinds of heritages, revitalise many lives here and out into the wider world. By reclaiming our land for good, anyone who strives can achieve their hopes and dreams.</p>\r\n\r\n<p>Marvel&#8230; hmmm, now here&#8217;s a new story we can tell. How astonishing &#8211; here you are, coming to our valley with an invitation for us to share our own thoughts and ideas for our land. Well, we have wanted to find someone who will listen to us, and will work together with us &#8211; to help us bring jobs, opportunities, new life into our communities.</p>\r\n\r\n<p>You say you&#8217;d like to help us regain our capabilities &#8211; our own determination, energy, strength, our depth of character, our personal &#8216;vigour&#8217;.</p>\r\n\r\n<p>As you have discovered, our land is precious to us &#8211; very precious. It&#8217;s the reason we live here &#8211; even though the industry has gone, and so many of our jobs and livelihoods with it. But we&#8217;re hearing you say that this same land has so much more to give us &#8211; more than any of the old industries could ever have achieved.</p>\r\n\r\n<p>OK, together with your help, we could bring our hopes and dreams into actual everyday reality. Yes, we could even create new kinds of lasting heritage for generations to come&#8230;</p>\r\n\r\n<p>Unlike the attitudes that brought that old type of industry, this time, just like us, you really respect our land. And, you value our human dignity. We&#8217;ve heard you say that, by working together, our land&#8217;s ecology will flourish, our past heritage will be celebrated &#8211; our future heritage, which we can create together, will be empowering for anyone who has enthusiasm, courage, get-up-and-go, grit, strength of character &#8211; in fact, whoever is energised and motivated enough to achieve their heartfelt ambitions&#8230;</p>\r\n\r\n<p>It&#8217;s true&#8230; we are more than our past, and much more than our present circumstances. When we dig into our own abilities, and mine into our spirited human energy, then with help, by planning and working together we can create new life for our valley, our land.</p>\r\n\r\n<p>In fact, come to think of it, we can set an example for post-industrial communities like ours world-wide &#8211; hmmm&#8230; what an amazing thought.</p>\r\n\r\n<p>With fresh, inspired, life-changing thinking, the possibilities that we could bring into being, actually begin in our wildest dreams. Just imagine what that could achieve&#8230;</p>\r\n\r\n<p>Marvel, we&#8217;ve heard that you have brought ideas to share with us. Ideas which will create wonderful opportunities for us all to benefit now and into the future. It seems that you really do want to make it possible for us to bring our own ambitions into reality. And to begin, you are setting an example, because you&#8217;d like to share your amazing ambitions with us.</p>\r\n\r\n<p>Together, we&#8217;d like our plans to respect our land and build upon its natural features. But unlike the past, this time we&#8217;d like to create a permanent, healthy future heritage that gives value to our history, sustains our ecology, generates livelihoods, strengthens and empowers people &#8211; right here in our land.</p>\r\n\r\n<p>We&#8217;re aware that there is a hill above Rhydycar, where adventure have already begun. Yet, we reckon that together with you we can add more&#8230; much more to the richness of that land. The question is, how wide, how high, how deep are our ambitions?</p>\r\n\r\n<p>So, let&#8217;s imagine together. Let&#8217;s be brave enough to bring our dreams into real, down-to-earth reality&#8230;</p>\r\n\r\n<p>To begin, because it&#8217;s so precious, what if we set-aside most of our land to respect our natural biodiversity, give value to our ecology, and yet also open-up possibilities for people to enjoy our land, to enhance their own health-and wellbeing?</p>\r\n\r\n<p>Because we&#8217;d also like to create new opportunities, what if we embraced only a smaller portion of our land to create homes, jobs, leisure and amazing experiences?</p>\r\n\r\n<p>So, for example, what if together we created spaces and places for people to be together, to enjoy, to relax, to learn, to share stories, to be energised, to feel alive, to embrace challenges, to achieve their ambitions and to be at home &#8211; right here on our land?</p>\r\n\r\n<p>Oh, and come to think of it, wouldn&#8217;t it be wonderful if we created indoor surf and water, bike and skate parks, treetop challenges &#8211; and camping, glamping and hotels for visitors to stay?</p>\r\n\r\n<p>Let&#8217;s imagine even more spectacular ambitions&#8230; what if we raised the standards to the highest world-class level?</p>\r\n\r\n<p>What if we built Europe&#8217;s longest indoor snow, ski and snowboard centre, so that, alongside visitors from anywhere in the world, Olympic athletes could train hard and develop their talents?</p>\r\n\r\n<p>While we&#8217;re at it, what if we created ground-breaking, life-changing opportunities to explore new forms of energy, cultivation, education, design, technologies, research and development..?</p>\r\n\r\n<p>Yes, what if, what if&#8230;</p>\r\n\r\n<p>Why not? Maybe together with your help we actually can, at last, create a new kind of heritage, to enjoy now and to set an example for generations to follow&#8230;</p>\r\n\r\n<p>Awesome. What an amazing thought.</p>\r\n\r\n<p>Marvellous&#8230;</p>\r\n', '<h2>Gwlad, gwlad&#8230; pleidiol wyf i&#8217;m gwlad<br />\r\nOur country, our land&#8230; faithful am I to my land</h2>\r\n\r\n<p>Our land has sustained us for countless generations. We are its original inhabitants, the Cymry &#8211; communities together, each with our own identity. Our roots are embedded deep into our heritages of invasion, conversion and innovation &#8211; which brought occupation, religion and industrial revolution to our hills and valleys.</p>\r\n\r\n<p>Our land has created our lifeblood. Like ancient seams of mineral richness, our identity has been founded, settled in layers &#8211; we belong here.</p>\r\n\r\n<p>When revolution came to our valley, our sweat, like streams of flowing water, scoured the ironstone and coal from our land with forceful energies. Our human mettle, which sapped our strength in muscular effort, succumbed to serve the white-hot furnaces of industry. Amongst clouds of smoke and steam, iron and coal flowed solid from our valley, away from our shores &#8211; exporting our power across seas into lands not our own.</p>\r\n\r\n<p>We gave our lives then, as though martyrs to an industrial cause.</p>\r\n\r\n<p>Until &#8211; when our land had become exhausted, when we had exerted all that the revolution demanded &#8211; then, like the spoil laid waste from our iron and coal, we too were discarded. We remain amongst remains. Like industrial scars scoured in the erosion of wind and rain, our communities, our togetherness, lay abandoned in silence and tears.</p>\r\n\r\n<p>But we are faithful to our land. We belong&#8230; here.</p>\r\n\r\n<p>And now, towards our shores, as in our myths and legends, a new story comes to our valley &#8211; Marvel, a wonderful opportunity. Now we can re-empower our lives, and restore energy in our land.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<p>Together, re-enabled in our communities, we will be able to re-ignite our fiery spirits &#8211; and, by re-energising our own mettle, with determination, stamina and strength of character, we will craft new kinds of heritages, revitalise many lives here and out into the wider world. By reclaiming our land for good, anyone who strives can achieve their hopes and dreams.</p>\r\n\r\n<p>Marvel&#8230; hmmm, now here&#8217;s a new story we can tell. How astonishing &#8211; here you are, coming to our valley with an invitation for us to share our own thoughts and ideas for our land. Well, we have wanted to find someone who will listen to us, and will work together with us &#8211; to help us bring jobs, opportunities, new life into our communities.</p>\r\n\r\n<p>You say you&#8217;d like to help us regain our capabilities &#8211; our own determination, energy, strength, our depth of character, our personal &#8216;vigour&#8217;.</p>\r\n\r\n<p>As you have discovered, our land is precious to us &#8211; very precious. It&#8217;s the reason we live here &#8211; even though the industry has gone, and so many of our jobs and livelihoods with it. But we&#8217;re hearing you say that this same land has so much more to give us &#8211; more than any of the old industries could ever have achieved.</p>\r\n\r\n<p>OK, together with your help, we could bring our hopes and dreams into actual everyday reality. Yes, we could even create new kinds of lasting heritage for generations to come&#8230;</p>\r\n\r\n<p>Unlike the attitudes that brought that old type of industry, this time, just like us, you really respect our land. And, you value our human dignity. We&#8217;ve heard you say that, by working together, our land&#8217;s ecology will flourish, our past heritage will be celebrated &#8211; our future heritage, which we can create together, will be empowering for anyone who has enthusiasm, courage, get-up-and-go, grit, strength of character &#8211; in fact, whoever is energised and motivated enough to achieve their heartfelt ambitions&#8230;</p>\r\n\r\n<p>It&#8217;s true&#8230; we are more than our past, and much more than our present circumstances. When we dig into our own abilities, and mine into our spirited human energy, then with help, by planning and working together we can create new life for our valley, our land.</p>\r\n\r\n<p>In fact, come to think of it, we can set an example for post-industrial communities like ours world-wide &#8211; hmmm&#8230; what an amazing thought.</p>\r\n\r\n<p>With fresh, inspired, life-changing thinking, the possibilities that we could bring into being, actually begin in our wildest dreams. Just imagine what that could achieve&#8230;</p>\r\n\r\n<p>Marvel, we&#8217;ve heard that you have brought ideas to share with us. Ideas which will create wonderful opportunities for us all to benefit now and into the future. It seems that you really do want to make it possible for us to bring our own ambitions into reality. And to begin, you are setting an example, because you&#8217;d like to share your amazing ambitions with us.</p>\r\n\r\n<p>Together, we&#8217;d like our plans to respect our land and build upon its natural features. But unlike the past, this time we&#8217;d like to create a permanent, healthy future heritage that gives value to our history, sustains our ecology, generates livelihoods, strengthens and empowers people &#8211; right here in our land.</p>\r\n\r\n<p>We&#8217;re aware that there is a hill above Rhydycar, where adventure have already begun. Yet, we reckon that together with you we can add more&#8230; much more to the richness of that land. The question is, how wide, how high, how deep are our ambitions?</p>\r\n\r\n<p>So, let&#8217;s imagine together. Let&#8217;s be brave enough to bring our dreams into real, down-to-earth reality&#8230;</p>\r\n\r\n<p>To begin, because it&#8217;s so precious, what if we set-aside most of our land to respect our natural biodiversity, give value to our ecology, and yet also open-up possibilities for people to enjoy our land, to enhance their own health-and wellbeing?</p>\r\n\r\n<p>Because we&#8217;d also like to create new opportunities, what if we embraced only a smaller portion of our land to create homes, jobs, leisure and amazing experiences?</p>\r\n\r\n<p>So, for example, what if together we created spaces and places for people to be together, to enjoy, to relax, to learn, to share stories, to be energised, to feel alive, to embrace challenges, to achieve their ambitions and to be at home &#8211; right here on our land?</p>\r\n\r\n<p>Oh, and come to think of it, wouldn&#8217;t it be wonderful if we created indoor surf and water, bike and skate parks, treetop challenges &#8211; and camping, glamping and hotels for visitors to stay?</p>\r\n\r\n<p>Let&#8217;s imagine even more spectacular ambitions&#8230; what if we raised the standards to the highest world-class level?</p>\r\n\r\n<p>What if we built Europe&#8217;s longest indoor snow, ski and snowboard centre, so that, alongside visitors from anywhere in the world, Olympic athletes could train hard and develop their talents?</p>\r\n\r\n<p>While we&#8217;re at it, what if we created ground-breaking, life-changing opportunities to explore new forms of energy, cultivation, education, design, technologies, research and development..?</p>\r\n\r\n<p>Yes, what if, what if&#8230;</p>\r\n\r\n<p>Why not? Maybe together with your help we actually can, at last, create a new kind of heritage, to enjoy now and to set an example for generations to follow&#8230;</p>\r\n\r\n<p>Awesome. What an amazing thought.</p>\r\n\r\n<p>Marvellous&#8230;</p>\r\n\r\n<p>Together, re-enabled in our communities, we will be able to re-ignite our fiery spirits &#8211; and, by re-energising our own mettle, with determination, stamina and strength of character, we will craft new kinds of heritages, revitalise many lives here and out into the wider world. By reclaiming our land for good, anyone who strives can achieve their hopes and dreams.</p>\r\n\r\n<p>Marvel&#8230; hmmm, now here&#8217;s a new story we can tell. How astonishing &#8211; here you are, coming to our valley with an invitation for us to share our own thoughts and ideas for our land. Well, we have wanted to find someone who will listen to us, and will work together with us &#8211; to help us bring jobs, opportunities, new life into our communities.</p>\r\n\r\n<p>You say you&#8217;d like to help us regain our capabilities &#8211; our own determination, energy, strength, our depth of character, our personal &#8216;vigour&#8217;.</p>\r\n\r\n<p>As you have discovered, our land is precious to us &#8211; very precious. It&#8217;s the reason we live here &#8211; even though the industry has gone, and so many of our jobs and livelihoods with it. But we&#8217;re hearing you say that this same land has so much more to give us &#8211; more than any of the old industries could ever have achieved.</p>\r\n\r\n<p>OK, together with your help, we could bring our hopes and dreams into actual everyday reality. Yes, we could even create new kinds of lasting heritage for generations to come&#8230;</p>\r\n\r\n<p>Unlike the attitudes that brought that old type of industry, this time, just like us, you really respect our land. And, you value our human dignity. We&#8217;ve heard you say that, by working together, our land&#8217;s ecology will flourish, our past heritage will be celebrated &#8211; our future heritage, which we can create together, will be empowering for anyone who has enthusiasm, courage, get-up-and-go, grit, strength of character &#8211; in fact, whoever is energised and motivated enough to achieve their heartfelt ambitions&#8230;</p>\r\n\r\n<p>It&#8217;s true&#8230; we are more than our past, and much more than our present circumstances. When we dig into our own abilities, and mine into our spirited human energy, then with help, by planning and working together we can create new life for our valley, our land.</p>\r\n\r\n<p>In fact, come to think of it, we can set an example for post-industrial communities like ours world-wide &#8211; hmmm&#8230; what an amazing thought.</p>\r\n\r\n<p>With fresh, inspired, life-changing thinking, the possibilities that we could bring into being, actually begin in our wildest dreams. Just imagine what that could achieve&#8230;</p>\r\n\r\n<p>Marvel, we&#8217;ve heard that you have brought ideas to share with us. Ideas which will create wonderful opportunities for us all to benefit now and into the future. It seems that you really do want to make it possible for us to bring our own ambitions into reality. And to begin, you are setting an example, because you&#8217;d like to share your amazing ambitions with us.</p>\r\n\r\n<p>Together, we&#8217;d like our plans to respect our land and build upon its natural features. But unlike the past, this time we&#8217;d like to create a permanent, healthy future heritage that gives value to our history, sustains our ecology, generates livelihoods, strengthens and empowers people &#8211; right here in our land.</p>\r\n\r\n<p>We&#8217;re aware that there is a hill above Rhydycar, where adventure have already begun. Yet, we reckon that together with you we can add more&#8230; much more to the richness of that land. The question is, how wide, how high, how deep are our ambitions?</p>\r\n\r\n<p>So, let&#8217;s imagine together. Let&#8217;s be brave enough to bring our dreams into real, down-to-earth reality&#8230;</p>\r\n\r\n<p>To begin, because it&#8217;s so precious, what if we set-aside most of our land to respect our natural biodiversity, give value to our ecology, and yet also open-up possibilities for people to enjoy our land, to enhance their own health-and wellbeing?</p>\r\n\r\n<p>Because we&#8217;d also like to create new opportunities, what if we embraced only a smaller portion of our land to create homes, jobs, leisure and amazing experiences?</p>\r\n\r\n<p>So, for example, what if together we created spaces and places for people to be together, to enjoy, to relax, to learn, to share stories, to be energised, to feel alive, to embrace challenges, to achieve their ambitions and to be at home &#8211; right here on our land?</p>\r\n\r\n<p>Oh, and come to think of it, wouldn&#8217;t it be wonderful if we created indoor surf and water, bike and skate parks, treetop challenges &#8211; and camping, glamping and hotels for visitors to stay?</p>\r\n\r\n<p>Let&#8217;s imagine even more spectacular ambitions&#8230; what if we raised the standards to the highest world-class level?</p>\r\n\r\n<p>What if we built Europe&#8217;s longest indoor snow, ski and snowboard centre, so that, alongside visitors from anywhere in the world, Olympic athletes could train hard and develop their talents?</p>\r\n\r\n<p>While we&#8217;re at it, what if we created ground-breaking, life-changing opportunities to explore new forms of energy, cultivation, education, design, technologies, research and development..?</p>\r\n\r\n<p>Yes, what if, what if&#8230;</p>\r\n\r\n<p>Why not? Maybe together with your help we actually can, at last, create a new kind of heritage, to enjoy now and to set an example for generations to follow&#8230;</p>\r\n\r\n<p>Awesome. What an amazing thought.</p>\r\n\r\n<p>Marvellous&#8230;</p>\r\n', 1964),
(155, 855, 'we-all-know-it-rains-in-wales- -a lot-so-we-designed-rhydycar-west-to-shelter-you-from-the-rain-and-still-give-you-all-the-fun-and-relaxation-of-some-of-the-most-popular-outdoor-sports-and-leisure-activities-our-three-primary-sports-and-leisure', '<h2>We all know it rains in Wales.&#160; A&#160;lot.</h2>\r\n\r\n<p>So we designed Rhydycar West to shelter you from the rain and still give you all the fun and relaxation of some of the most popular outdoor sports and leisure activities.</p>\r\n\r\n<p>Our three primary sports and leisure facilities are all indoor. So you can play in the snow, ride in the dirt and splash in the water every day of the year &#8211; regardless of the weather.</p>\r\n\r\n<p>Complementing other local sports offerings like Bike Park Wales and Rock UK, Rhydycar West will provide&#160;the largest indoor sports and leisure facilities in the area and we will undoubtedly become one of the premiere tourist destinations for&#160;the South Wales Valleys. For all year round.&#160;That&#39;s Rhydycar West.</p>\r\n', '<h2>We all know it rains in Wales.&#160; A&#160;lot.</h2>\r\n\r\n<p>So we designed Rhydycar West to shelter you from the rain and still give you all the fun and relaxation of some of the most popular outdoor sports and leisure activities.</p>\r\n\r\n<p>Our three primary sports and leisure facilities are all indoor. So you can play in the snow, ride in the dirt and splash in the water every day of the year &#8211; regardless of the weather.</p>\r\n\r\n<p>Complementing other local sports offerings like Bike Park Wales and Rock UK, Rhydycar West will provide&#160;the largest indoor sports and leisure facilities in the area and we will undoubtedly become one of the premiere tourist destinations for&#160;the South Wales Valleys. For all year round.&#160;That&#39;s Rhydycar West.</p>\r\n', 121),
(101, 691, 'rhydycar-west-is-rich-in-heritage-and-preserving-and-celebrating-the-site-s-precious-history-is-central-to-our-development-the-site-s-plentiful-supplies-of-iron-and-coal-contributed-significantly-to-the-industrial-revolution-and-beyond-up-until-th', '<p>Rhydycar West is rich in heritage, and preserving and celebrating the site&#8217;s precious history is central to our development.</p>\r\n\r\n<p>The site&#8217;s plentiful supplies of iron and coal contributed significantly to the industrial revolution and beyond, up until the mid-20th Century. &#160;Prior to that the land was an important site for the period of religious dissent in Wales.</p>\r\n\r\n<p>Important remains of this history are scattered across the site.&#160; Unfortunately some of these are degrading and disappearing, which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n\r\n<p>We have worked with CADW to schedule six further historical monuments on the site, and our ambition is to enable people to experience and understand the historic importance of the land and its contribution to the greater Merthyr story.</p>\r\n\r\n<p>&#160;</p>\r\n', '<p>Rhydycar West is rich in heritage, and preserving and celebrating the site&#8217;s precious history is central to our development.</p>\r\n\r\n<p>The site&#8217;s plentiful supplies of iron and coal contributed significantly to the industrial revolution and beyond, up until the mid-20th Century. &#160;Prior to that the land was an important site for the period of religious dissent in Wales.</p>\r\n\r\n<p>Important remains of this history are scattered across the site.&#160; Unfortunately some of these are degrading and disappearing, which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n\r\n<p>We have worked with CADW to schedule six further historical monuments on the site, and our ambition is to enable people to experience and understand the historic importance of the land and its contribution to the greater Merthyr story.</p>\r\n\r\n<p>&#160;</p>\r\n', 144),
(176, 767, 'the-18th-and-19th-centuries-represent-a-period-of-intense-industrial-activity-in-and-around-merthyr-the-manufacture-of-iron-products-from-the-rich-resources-of-timber-coal-and-iron-ore-transformed-this-small-village-into-the-largest-town-in-wales-a-sign', '<p>The 18th and 19th centuries represent a period of intense industrial activity in and around Merthyr. The manufacture of iron products from the rich resources of timber, coal and iron ore transformed this small village into the largest town in Wales. A significant amount of that coal came from the site at Rhydycar West.</p>\r\n\r\n<p>The Cyfarthfa Ironworks (opened in 1766) is perhaps the most famous of the early iron producers of Merthyr, but it was not the only one; Dowlais, Plymouth and Penydarren were also significant players in this early industry.</p>\r\n\r\n<p>William Crawshay&#8217;s ironworks drew mineral resources from a wide area, requiring the construction of a canal from the Nant Canaid valley up the west side of the Taff Valley to feed the blast furnaces with coal and iron ore from the Cyfarthfa Estate at and around the site.</p>\r\n\r\n<p>Even today, the site illustrates the development of mining technology which would make Merthyr one of the most important towns of the industrial revolution.</p>\r\n\r\n<p>Early mining was based on surface scouring and patching for shallow deposits; but as those were worked out a system of horizontally driven shafts (or &#8216;levels&#8217;) were excavated into the hillsides to exploit more deeply buried mineral ores and coal seams.</p>\r\n\r\n<p>The increasing need to access deeper and deeper coal seams in the 19th century saw a transition to vertically dug shafts, with water power used to lower miners down to the workings and to lift coal to the surface.</p>\r\n\r\n<p>This period also witnessed the development of an extensive network of inclines and tramways to transport mineral resources and connect into the railway system. By 1841, this linked Merthyr with Cardiff and the rest of the world via the increasingly large complex of docks and basins being developed by the Marquis of Bute.</p>\r\n\r\n<p>The area&#8217;s industrial exploitation reached its peak in the late 19th century, when seven deep pits were in operation at the site; Black Pins, Cwm Du, Cwm Glo, Coed Cae, Glyn-Dyrys, Cwm and Lower Colliers Row.</p>\r\n\r\n<p>Cyfarthfa Ironworks closed in 1910 (although it re-opened briefly during World War One), and coal mining at and around the site declined rapidly from the 1920s onwards.</p>\r\n', '<p>The 18th and 19th centuries represent a period of intense industrial activity in and around Merthyr. The manufacture of iron products from the rich resources of timber, coal and iron ore transformed this small village into the largest town in Wales. A significant amount of that coal came from the site at Rhydycar West.</p>\r\n\r\n<p>The Cyfarthfa Ironworks (opened in 1766) is perhaps the most famous of the early iron producers of Merthyr, but it was not the only one; Dowlais, Plymouth and Penydarren were also significant players in this early industry.</p>\r\n\r\n<p>William Crawshay&#8217;s ironworks drew mineral resources from a wide area, requiring the construction of a canal from the Nant Canaid valley up the west side of the Taff Valley to feed the blast furnaces with coal and iron ore from the Cyfarthfa Estate at and around the site.</p>\r\n\r\n<p>Even today, the site illustrates the development of mining technology which would make Merthyr one of the most important towns of the industrial revolution.</p>\r\n\r\n<p>Early mining was based on surface scouring and patching for shallow deposits; but as those were worked out a system of horizontally driven shafts (or &#8216;levels&#8217;) were excavated into the hillsides to exploit more deeply buried mineral ores and coal seams.</p>\r\n\r\n<p>The increasing need to access deeper and deeper coal seams in the 19th century saw a transition to vertically dug shafts, with water power used to lower miners down to the workings and to lift coal to the surface.</p>\r\n\r\n<p>This period also witnessed the development of an extensive network of inclines and tramways to transport mineral resources and connect into the railway system. By 1841, this linked Merthyr with Cardiff and the rest of the world via the increasingly large complex of docks and basins being developed by the Marquis of Bute.</p>\r\n\r\n<p>The area&#8217;s industrial exploitation reached its peak in the late 19th century, when seven deep pits were in operation at the site; Black Pins, Cwm Du, Cwm Glo, Coed Cae, Glyn-Dyrys, Cwm and Lower Colliers Row.</p>\r\n\r\n<p>Cyfarthfa Ironworks closed in 1910 (although it re-opened briefly during World War One), and coal mining at and around the site declined rapidly from the 1920s onwards.</p>\r\n', 356),
(181, 861, 'there-is-no-one-way-to-describe-rhydycar-west-having-acquired-the-site-in-2013-we-approached-this-scheme-as-a-blank-canvas-and-we-have-spent-extensive-time-and-resources-understanding-in-detail-the-unique-ecological-and-heritage-features-of-the-site-a', '<h2>There is no one way to describe Rhydycar West.</h2>\r\n\r\n<p>Having acquired the site in 2013, we approached this scheme as a blank canvas, and we have spent extensive time and resources understanding in detail the unique ecological and heritage features of the site, and how we can design a scheme to work sensitively.</p>\r\n\r\n<p>The regeneration successes in recent years in the region such as Redhouse Cymru, Merthyr College and retail offerings such as Cyfarthfa Retail Park and Trago Mills demonstrate that the region is focussed on economic development.</p>\r\n\r\n<p>There is also clearly a focus on&#160;developing the area for adventure sport. With the success of Bike Park Wales and Rock UK, a sports &#38; leisure destination is well-positioned to build on that momentum.</p>\r\n\r\n<p>In terms of housing, a new residential neighbourhood supports the local need to develop more long-term supply. Connecting an existing neighbourhood&#160;with an iconic sports &#38; leisure destination right on the doorstep, Rhydycar West is a perfect location for new homes.</p>\r\n', '<h2>There is no one way to describe Rhydycar West.</h2>\r\n\r\n<p>Having acquired the site in 2013, we approached this scheme as a blank canvas, and we have spent extensive time and resources understanding in detail the unique ecological and heritage features of the site, and how we can design a scheme to work sensitively.</p>\r\n\r\n<p>The regeneration successes in recent years in the region such as Redhouse Cymru, Merthyr College and retail offerings such as Cyfarthfa Retail Park and Trago Mills demonstrate that the region is focussed on economic development.</p>\r\n\r\n<p>There is also clearly a focus on&#160;developing the area for adventure sport. With the success of Bike Park Wales and Rock UK, a sports &#38; leisure destination is well-positioned to build on that momentum.</p>\r\n\r\n<p>In terms of housing, a new residential neighbourhood supports the local need to develop more long-term supply. Connecting an existing neighbourhood&#160;with an iconic sports &#38; leisure destination right on the doorstep, Rhydycar West is a perfect location for new homes.</p>\r\n', 159),
(152, 868, 'as-an-iconic-sports-and-leisure-destination-complete-with-a-new-neighbourhood-right-next-door-but-only-developing-30-of-the-site-we-ve-tried-to-address-a-wide-range-of-interests-and-we-are-always-open-to-suggestions-as-to-other-things-we-might-includ', '<p>As an iconic sports &#38; leisure destination, complete with a new neighbourhood right next door, but only developing 30% of the site, we&#8217;ve tried to address a wide range of interests, and we are always open to suggestions as to other things we might include in the scheme.</p>\r\n', '<p>As an iconic sports &#38; leisure destination, complete with a new neighbourhood right next door, but only developing 30% of the site, we&#8217;ve tried to address a wide range of interests, and we are always open to suggestions as to other things we might include in the scheme.</p>\r\n', 46),
(118, 869, ' - -  ', '<p>&#160; &#160; &#160;&#160;</p>\r\n', '<p>&#160; &#160; &#160;&#160;</p>\r\n', 0),
(168, 723, 'rhydycar-west-is-a-huge-inward-investment-project-being-co-ordinated-by-marvel-limited-a-guernsey-company-that-was-set-up-in-order-to-deliver-this-regeneration-project-to-the-area- marvel-owns-the-entire-site-of-approximately-575-acres-having-acquired-i', '<p>Rhydycar West is a huge inward-investment project being co-ordinated by Marvel Limited, a Guernsey company that was set up in order to deliver this regeneration project to the area. &#160;Marvel owns the entire site of approximately 575 acres, having acquired it in 2013. We&#8217;ve been told we are not a traditional developer. We had no preconceived concepts for the site and our current proposals have been influenced, devised and refined with the help of local, regional and national stakeholders.&#160;</p>\r\n\r\n<p>We understand the economic future that the region is forging for itself is anchored on destination and activity tourism. We also appreciate the requirement for new housing to be developed.&#160;</p>\r\n\r\n<p>The project team is led by Marvel&#8217;s investment director Leigh Large who has brought together an experienced team of professionals to turn the these plans into reality.</p>\r\n', '<p>Rhydycar West is a huge inward-investment project being co-ordinated by Marvel Limited, a Guernsey company that was set up in order to deliver this regeneration project to the area. &#160;Marvel owns the entire site of approximately 575 acres, having acquired it in 2013. We&#8217;ve been told we are not a traditional developer. We had no preconceived concepts for the site and our current proposals have been influenced, devised and refined with the help of local, regional and national stakeholders.&#160;</p>\r\n\r\n<p>We understand the economic future that the region is forging for itself is anchored on destination and activity tourism. We also appreciate the requirement for new housing to be developed.&#160;</p>\r\n\r\n<p>The project team is led by Marvel&#8217;s investment director Leigh Large who has brought together an experienced team of professionals to turn the these plans into reality.</p>\r\n', 134);
INSERT INTO `sym_entries_data_256` (`id`, `entry_id`, `handle`, `value`, `value_formatted`, `word_count`) VALUES
(121, 870, 'our-privacy-policy-your-privacy-is-very-important-to-us- we-respect-the-eu-s-general-data-protection-regulations-gdpr-and-this-policy-explains-how-we-collect-and-treat-any-information-you-give-us-you-won-t-find-any-complicated-legal-terms-or-lo', '<h1>Our Privacy Policy</h1>\r\n\r\n<p>Your privacy is very important to us.&#160;We respect the EU&#8217;s General Data Protection Regulations (GDPR) and this policy explains how we collect and treat any information you give us. You won&#8217;t find any complicated legal terms or long passages of unreadable text. We&#8217;ve no desire to trick you into agreeing to something you might later regret.</p>\r\n\r\n<p>We may change this Policy from time to time so please check this page occasionally to ensure that you&#8217;re happy with any changes.<br />\r\n<br />\r\nBy using our website&#160;you are agreeing to our Privacy Policy.</p>\r\n\r\n<h3>Your Data, Your Rights</h3>\r\n\r\n<p>Under the new General Data Protection Regulation (GDPR), you now have more rights than ever before - you have the legitimate right to request any data we may hold on you; to withdraw consent; to be erased from our database under certain circumstances (with no effect on the lawfulness of any processing prior to your request to withdraw); the conditional right to object processing; the restriction to no further processing without prior consent, and to portability of your data.</p>\r\n\r\n<h2>How do we collect your data?</h2>\r\n\r\n<p>We may collect data from you in the instance of when you contact us about our products and services by email or through our website, sign up to our newsletter, or when you apply for any vacancies we may have available.</p>\r\n\r\n<p>The information we collect</p>\r\n\r\n<p>Information that we may collect for yourself may include, but isn&#8217;t limited to: Name, Address, Email Address, phone number, company you work for, IP Address as well as information of traffic to certain pages.<br />\r\n<br />\r\nIf you sign up for a newsletter, we only collect your email address.</p>\r\n\r\n<h2>How do we use your information?</h2>\r\n\r\n<p>To reformat our website and make it as user friendly as possible<br />\r\nTailor the correct services to you<br />\r\nFor any contractual services between you and us<br />\r\nFor newsletters and updates<br />\r\nFor new vacancies and the process of applications</p>\r\n\r\n<p>We hold your information on our system for as long as necessary under contractual obligations until contract end. We aim to review our retention period for data on a regular basis with the aim to not hold the data longer than necessary. We are legally obliged to retain certain information to fulfil our statutory rights.</p>\r\n\r\n<p>You have the option to unsubscribe at any time.</p>\r\n\r\n<h2>Your information &#8211; who can access it?</h2>\r\n\r\n<p>We process any data lawfully and with transparency, and promise to never hand over your data to any third parties. We only pass on your information to any third party under contractual services under your request and only pass over any relevant information.&#160;We will never disclose your information to any third party, unless we are required to do so by law or authorised by you.</p>\r\n\r\n<h2>Legal Disclaimer</h2>\r\n\r\n<p>We have endeavoured to ensure that the information on this web site is accurate and as current as possible. However, no representations or warranties are given about the accuracy, completeness or suitability for any purpose of the information contained in this site and in no circumstances will Marvel Ltd&#160;be liable to you for any loss of any kind arising out of the use of this site, or any other site referred to or linked through the web site.<br />\r\n<br />\r\nThe content and design of this web site are subject to copyright owned by Marvel Ltd (&#169; Marvel Ltd 2018) or used under licence from third party copyright owners. All rights in any marks or logos are proprietary and are owned by or licensed to us. You are permitted to make copies of any material on this web site for your personal use only. You must not otherwise reproduce, distribute, download, post, store, transfer, broadcast, modify or transmit all or any part of the pages on this web site for any purpose or permit or assist in any way any other person to do the same.<br />\r\n<br />\r\nOur web site may contain links to other web sites. We have no control over and shall have no responsibility or liability for the contents of other web sites linked to our web site and you enter them at your own risk.<br />\r\n<br />\r\nElectronic links to this web site are prohibited without the prior written consent.</p>\r\n\r\n<h2>How we use cookies</h2>\r\n\r\n<p>As you are visiting our website, we may have transferred a cookie to your computer. A cookie is a small piece of information sent from this website to your browser for storage on your computer. If you want to know more about them then there is a useful and slightly complicated explanation on Wikipedia, HTTP Cookies.</p>\r\n\r\n<h3>Where do the cookies come from?</h3>\r\n\r\n<p>The software that runs this site (Symphony CMS) may transfer a temporary cookie so it can keep track of what it&#8217;s doing. As it is temporary it may be deleted when you leave here or after a duration of time, usually 30 minutes.<br />\r\nSo that we can measure the popularity of posts and site visits, where people come from and other general statistics, we use Google Analytics. It may store cookies to track new and repeat visitors. It does not have any detail on who you are.<br />\r\nAdvertising links can use cookies to track from which site you came from. Some of those will be for affiliate links where cookies are used in tracking and payment systems. We do not use such links or advertising mechanisms to drive traffic to this website.</p>\r\n\r\n<h3>Cookie Removal</h3>\r\n\r\n<p>If you wish to know how to remove cookies then&#160;<a href=\"http://AboutCookies.org\">AboutCookies.org</a>&#160;should be of help.</p>\r\n\r\n<h3>Cookie usage</h3>\r\n\r\n<p>As this site uses analytics software and software that was created by another person or company, the usage of cookies is beyond our control and we may not be able to ask your permission in some cases.</p>\r\n\r\n<h3>How to complain</h3>\r\n\r\n<p>If you think we haven&#8217;t complied with GDPR in regards to your personal data, please contact <a href=\"mailto:info@rhydycarwest.com\">info@rhydycarwest.com</a>, or you have the right to complain to the Information Commissioners Office.</p>\r\n\r\n<p>If you have any queries on any of the above, or the information we may hold on you, please contact our Data Protection Officer, Rich, on<a href=\"mailto:info@rhydycarwest.com\">&#160;info@rhydycarwest.com</a></p>\r\n', '<h1>Our Privacy Policy</h1>\r\n\r\n<p>Your privacy is very important to us.&#160;We respect the EU&#8217;s General Data Protection Regulations (GDPR) and this policy explains how we collect and treat any information you give us. You won&#8217;t find any complicated legal terms or long passages of unreadable text. We&#8217;ve no desire to trick you into agreeing to something you might later regret.</p>\r\n\r\n<p>We may change this Policy from time to time so please check this page occasionally to ensure that you&#8217;re happy with any changes.<br />\r\n<br />\r\nBy using our website&#160;you are agreeing to our Privacy Policy.</p>\r\n\r\n<h3>Your Data, Your Rights</h3>\r\n\r\n<p>Under the new General Data Protection Regulation (GDPR), you now have more rights than ever before - you have the legitimate right to request any data we may hold on you; to withdraw consent; to be erased from our database under certain circumstances (with no effect on the lawfulness of any processing prior to your request to withdraw); the conditional right to object processing; the restriction to no further processing without prior consent, and to portability of your data.</p>\r\n\r\n<h2>How do we collect your data?</h2>\r\n\r\n<p>We may collect data from you in the instance of when you contact us about our products and services by email or through our website, sign up to our newsletter, or when you apply for any vacancies we may have available.</p>\r\n\r\n<p>The information we collect</p>\r\n\r\n<p>Information that we may collect for yourself may include, but isn&#8217;t limited to: Name, Address, Email Address, phone number, company you work for, IP Address as well as information of traffic to certain pages.<br />\r\n<br />\r\nIf you sign up for a newsletter, we only collect your email address.</p>\r\n\r\n<h2>How do we use your information?</h2>\r\n\r\n<p>To reformat our website and make it as user friendly as possible<br />\r\nTailor the correct services to you<br />\r\nFor any contractual services between you and us<br />\r\nFor newsletters and updates<br />\r\nFor new vacancies and the process of applications</p>\r\n\r\n<p>We hold your information on our system for as long as necessary under contractual obligations until contract end. We aim to review our retention period for data on a regular basis with the aim to not hold the data longer than necessary. We are legally obliged to retain certain information to fulfil our statutory rights.</p>\r\n\r\n<p>You have the option to unsubscribe at any time.</p>\r\n\r\n<h2>Your information &#8211; who can access it?</h2>\r\n\r\n<p>We process any data lawfully and with transparency, and promise to never hand over your data to any third parties. We only pass on your information to any third party under contractual services under your request and only pass over any relevant information.&#160;We will never disclose your information to any third party, unless we are required to do so by law or authorised by you.</p>\r\n\r\n<h2>Legal Disclaimer</h2>\r\n\r\n<p>We have endeavoured to ensure that the information on this web site is accurate and as current as possible. However, no representations or warranties are given about the accuracy, completeness or suitability for any purpose of the information contained in this site and in no circumstances will Marvel Ltd&#160;be liable to you for any loss of any kind arising out of the use of this site, or any other site referred to or linked through the web site.<br />\r\n<br />\r\nThe content and design of this web site are subject to copyright owned by Marvel Ltd (&#169; Marvel Ltd 2018) or used under licence from third party copyright owners. All rights in any marks or logos are proprietary and are owned by or licensed to us. You are permitted to make copies of any material on this web site for your personal use only. You must not otherwise reproduce, distribute, download, post, store, transfer, broadcast, modify or transmit all or any part of the pages on this web site for any purpose or permit or assist in any way any other person to do the same.<br />\r\n<br />\r\nOur web site may contain links to other web sites. We have no control over and shall have no responsibility or liability for the contents of other web sites linked to our web site and you enter them at your own risk.<br />\r\n<br />\r\nElectronic links to this web site are prohibited without the prior written consent.</p>\r\n\r\n<h2>How we use cookies</h2>\r\n\r\n<p>As you are visiting our website, we may have transferred a cookie to your computer. A cookie is a small piece of information sent from this website to your browser for storage on your computer. If you want to know more about them then there is a useful and slightly complicated explanation on Wikipedia, HTTP Cookies.</p>\r\n\r\n<h3>Where do the cookies come from?</h3>\r\n\r\n<p>The software that runs this site (Symphony CMS) may transfer a temporary cookie so it can keep track of what it&#8217;s doing. As it is temporary it may be deleted when you leave here or after a duration of time, usually 30 minutes.<br />\r\nSo that we can measure the popularity of posts and site visits, where people come from and other general statistics, we use Google Analytics. It may store cookies to track new and repeat visitors. It does not have any detail on who you are.<br />\r\nAdvertising links can use cookies to track from which site you came from. Some of those will be for affiliate links where cookies are used in tracking and payment systems. We do not use such links or advertising mechanisms to drive traffic to this website.</p>\r\n\r\n<h3>Cookie Removal</h3>\r\n\r\n<p>If you wish to know how to remove cookies then&#160;<a href=\"http://AboutCookies.org\">AboutCookies.org</a>&#160;should be of help.</p>\r\n\r\n<h3>Cookie usage</h3>\r\n\r\n<p>As this site uses analytics software and software that was created by another person or company, the usage of cookies is beyond our control and we may not be able to ask your permission in some cases.</p>\r\n\r\n<h3>How to complain</h3>\r\n\r\n<p>If you think we haven&#8217;t complied with GDPR in regards to your personal data, please contact <a href=\"mailto:info@rhydycarwest.com\">info@rhydycarwest.com</a>, or you have the right to complain to the Information Commissioners Office.</p>\r\n\r\n<p>If you have any queries on any of the above, or the information we may hold on you, please contact our Data Protection Officer, Rich, on<a href=\"mailto:info@rhydycarwest.com\">&#160;info@rhydycarwest.com</a></p>\r\n', 999),
(184, 1060, '-2', '<p><script type=\"text/javascript\" src=\"https://orchard.formstack.com/forms/js.php/rhydycarwest\"></script></p>\r\n', '<p><script type=\"text/javascript\" src=\"https://orchard.formstack.com/forms/js.php/rhydycarwest\"></script></p>\r\n', 0),
(123, 871, 'we-are-working-with-snowsport-wales-to-create-a-national-centre-of-excellence-for-snowsport-rhydycar-west-would-be-the-longest-such-facility-in-europe-with-challenging-runs-forfprofessionals-right-down-to-beginner-slopes-for-first-timer-producing-real', '<p>We are working with Snowsport Wales to create a national Centre of Excellence for Snowsport, Rhydycar West would be the longest such facility in Europe, with challenging runs forfprofessionals, right down to beginner slopes for first timer.</p>\r\n\r\n<p>Producing real snow in a controled atmosphere means there are perfect conditions 365 days of the year.&#160; And with the inclusion of snow play, tubing, ice climbing and other winter activities there is fun for absolutely everyone,anytime.&#160;&#160;</p>\r\n\r\n<p>This snow centre would be based on similar successful 500-metre snow centres in Europe such as SnowWorld Landraaf.&#160; [LINK here to Landgraaf PAGE]</p>\r\n\r\n<p>Because there are several of these already in Europe and more in development for Spain, France and Norway, it is only a matter of time before the UK has one.&#160;&#160; And we want it to be in South Wales!</p>\r\n\r\n<p>Olympic connection?</p>\r\n\r\n<p>Because Team GB currently train off-season indoors in Europe, it is our goal to help them to meet their ambitious targets for the Olympics in 2030 while remaining at home.&#160;</p>\r\n\r\n<p>We also have plans in place to work with area schools and clubs to encourage and aspire our youngsters to experience winter sports, a chance they may never have got otherwise. We want the next generation of winter Olympic athletes to hail from Wales.</p>\r\n', '<p>We are working with Snowsport Wales to create a national Centre of Excellence for Snowsport, Rhydycar West would be the longest such facility in Europe, with challenging runs forfprofessionals, right down to beginner slopes for first timer.</p>\r\n\r\n<p>Producing real snow in a controled atmosphere means there are perfect conditions 365 days of the year.&#160; And with the inclusion of snow play, tubing, ice climbing and other winter activities there is fun for absolutely everyone,anytime.&#160;&#160;</p>\r\n\r\n<p>This snow centre would be based on similar successful 500-metre snow centres in Europe such as SnowWorld Landraaf.&#160; [LINK here to Landgraaf PAGE]</p>\r\n\r\n<p>Because there are several of these already in Europe and more in development for Spain, France and Norway, it is only a matter of time before the UK has one.&#160;&#160; And we want it to be in South Wales!</p>\r\n\r\n<p>Olympic connection?</p>\r\n\r\n<p>Because Team GB currently train off-season indoors in Europe, it is our goal to help them to meet their ambitious targets for the Olympics in 2030 while remaining at home.&#160;</p>\r\n\r\n<p>We also have plans in place to work with area schools and clubs to encourage and aspire our youngsters to experience winter sports, a chance they may never have got otherwise. We want the next generation of winter Olympic athletes to hail from Wales.</p>\r\n', 210),
(175, 867, 'as-to-detail-we-have-been-engaged-in-dialogue-with-stakeholders-and-interested-community-members-we-will-be-continuing-to-discuss-and-refine-our-plans-over-the-coming-months-culminating-in-the-submission-of-a-planning-application', '<p>As to detail, we have been engaged in dialogue with stakeholders and interested community members. We will be continuing to discuss and refine our plans over the coming months, culminating in the submission of a planning application.</p>\r\n', '<p>As to detail, we have been engaged in dialogue with stakeholders and interested community members. We will be continuing to discuss and refine our plans over the coming months, culminating in the submission of a planning application.</p>\r\n', 37),
(162, 761, 'rhydycar-west-would-bring-direct-investment-and-jobs-to-the-local-area-as-well-as-provide-a-range-of-new-and-exciting-sports-and-leisure-facilities-to-the-region-benefits-would-include-delivering-an-elite-sport-facility-of-national-importance', '<h2>Rhydycar West would bring direct investment and jobs to the local area, as well as provide a range of new and exciting sports &#38; leisure facilities to the region.</h2>\r\n\r\n<p>Benefits would include:</p>\r\n\r\n<ul>\r\n<li>Delivering an elite sport facility of national importance</li>\r\n<li>Celebrating the local heritage, history and natural surroundings</li>\r\n<li>Bringing back into use and making safe a former mining area (no coal extraction involved)</li>\r\n<li>Attracting more national and international visitors to the area</li>\r\n<li>Hundreds of long-term jobs</li>\r\n<li>A range of skills and training opportunities</li>\r\n<li>Sporting and educational opportunities for local children and residents</li>\r\n</ul>\r\n', '<h2>Rhydycar West would bring direct investment and jobs to the local area, as well as provide a range of new and exciting sports &#38; leisure facilities to the region.</h2>\r\n\r\n<p>Benefits would include:</p>\r\n\r\n<ul>\r\n<li>Delivering an elite sport facility of national importance</li>\r\n<li>Celebrating the local heritage, history and natural surroundings</li>\r\n<li>Bringing back into use and making safe a former mining area (no coal extraction involved)</li>\r\n<li>Attracting more national and international visitors to the area</li>\r\n<li>Hundreds of long-term jobs</li>\r\n<li>A range of skills and training opportunities</li>\r\n<li>Sporting and educational opportunities for local children and residents</li>\r\n</ul>\r\n', 91),
(179, 989, ' ', '<div class=\"issuuembed\" data-configid=\"26483382/63073939\" style=\"width:900px; height:500px;\">&#160;</div>\r\n<script type=\"text/javascript\" src=\"//e.issuu.com/embed.js\" async=\"true\"></script>', '<div class=\"issuuembed\" data-configid=\"26483382/63073939\" style=\"width:900px; height:500px;\">&#160;</div>\r\n<script type=\"text/javascript\" src=\"//e.issuu.com/embed.js\" async=\"true\"></script>', 0),
(172, 884, 'this-year-s-winter-olympics-and-paralympics-marked-a-significant-milestone-in-a-very-exciting-journey-for-great-britain-pyeongchang-2018-saw-team-gb-win-a-combined-twelve-medals-four-of-which-were-from-welsh-athlete-menna-fitzpatrick-this-achieve', '<p>This year&#8217;s Winter Olympics and Paralympics marked a significant milestone in a very exciting journey for Great Britain. PyeongChang 2018 saw Team GB win a combined twelve medals &#8211; four of which were from Welsh athlete Menna Fitzpatrick.</p>\r\n\r\n<p>This achievement, and a newfound enthusiasm, is not least down to the appointment of Dan Hunt as Performance Director for British Ski and Snowboard in 2016. Hunt made his mark in our country&#8217;s sporting history for his role with British Cycling, elevating Team GB into one of the best cycling teams in the world. Starting out in 2005, he used his knowledge and background to advance the women&#8217;s endurance squad who secured two medals in Beijing 2008, followed by the men&#8217;s team who achieved notable success in London 2012.</p>\r\n\r\n<p>Hunt has now turned his attention to wintersports and wants to replicate the success and momentum of the summer games. He is on a mission to train up the best athletes ahead of the Winter Olympics 2030 and has set a long-term goal for Team GB to be in the top five medal-winning nations by this time.</p>\r\n\r\n<p style=\"font-size:30px;\"><em>Now is a pivotal moment for winter sports in Great Britain, and our new all-season centre will be part of developing a lot more future skiers and snowboarders.</em></p>\r\n\r\n<p>This ambitious medal goal will require significant investment in terms of time, money and training. Rhydycar West would be a major step forward in this transformation, creating a National Centre of Excellence for the current and next generation of GB Olympians.</p>\r\n\r\n<p>This snow centre could make Rhydycar West the future home of the Olympic team and become a stepping stone for Welsh youth in particular to stand on the medal platform in 2030. All of this, combined with a new way of educating and training our youngsters, and instilling a passion and belief in them that they can make it big, could very well propel us to Winter Olympics glory.</p>\r\n', '<p>This year&#8217;s Winter Olympics and Paralympics marked a significant milestone in a very exciting journey for Great Britain. PyeongChang 2018 saw Team GB win a combined twelve medals &#8211; four of which were from Welsh athlete Menna Fitzpatrick.</p>\r\n\r\n<p>This achievement, and a newfound enthusiasm, is not least down to the appointment of Dan Hunt as Performance Director for British Ski and Snowboard in 2016. Hunt made his mark in our country&#8217;s sporting history for his role with British Cycling, elevating Team GB into one of the best cycling teams in the world. Starting out in 2005, he used his knowledge and background to advance the women&#8217;s endurance squad who secured two medals in Beijing 2008, followed by the men&#8217;s team who achieved notable success in London 2012.</p>\r\n\r\n<p>Hunt has now turned his attention to wintersports and wants to replicate the success and momentum of the summer games. He is on a mission to train up the best athletes ahead of the Winter Olympics 2030 and has set a long-term goal for Team GB to be in the top five medal-winning nations by this time.</p>\r\n\r\n<p style=\"font-size:30px;\"><em>Now is a pivotal moment for winter sports in Great Britain, and our new all-season centre will be part of developing a lot more future skiers and snowboarders.</em></p>\r\n\r\n<p>This ambitious medal goal will require significant investment in terms of time, money and training. Rhydycar West would be a major step forward in this transformation, creating a National Centre of Excellence for the current and next generation of GB Olympians.</p>\r\n\r\n<p>This snow centre could make Rhydycar West the future home of the Olympic team and become a stepping stone for Welsh youth in particular to stand on the medal platform in 2030. All of this, combined with a new way of educating and training our youngsters, and instilling a passion and belief in them that they can make it big, could very well propel us to Winter Olympics glory.</p>\r\n', 314),
(182, 697, 'our-three-signature-sports-and-leisure-facilities-are-all-indoor-so-you-can-play-in-the-snow-ride-in-the-dirt-and-splash-in-the-water-every-day-of-the-year-regardless-of-the-weather-complementing-other-local-sports-offerings-like-bike-park-wales', '<h2>Our three signature sports and leisure facilities are all indoor.</h2>\r\n\r\n<p>So you can play in the snow, ride in the dirt and splash in the water every day of the year &#8211; regardless of the weather.</p>\r\n\r\n<p>Complementing other local sports offerings like Bike Park Wales and Rock UK, Rhydycar West will provide&#160;the largest indoor sports and leisure facilities in the area and we will undoubtedly become one of the premiere tourist destinations for&#160;the South Wales Valleys. For all year round.&#160;That&#39;s Rhydycar West.</p>\r\n', '<h2>Our three signature sports and leisure facilities are all indoor.</h2>\r\n\r\n<p>So you can play in the snow, ride in the dirt and splash in the water every day of the year &#8211; regardless of the weather.</p>\r\n\r\n<p>Complementing other local sports offerings like Bike Park Wales and Rock UK, Rhydycar West will provide&#160;the largest indoor sports and leisure facilities in the area and we will undoubtedly become one of the premiere tourist destinations for&#160;the South Wales Valleys. For all year round.&#160;That&#39;s Rhydycar West.</p>\r\n', 82);
