(21, 676, 'dvsdfvsdbvbxvzxcv-dfvadvadvadfdfvdvdvfdvfd-xcbsdfbsvacfa-sfk-jdvkja-flk-ckjfd-afkja-kvja-dl-j-and-39-fak-vc-s-fvjdfvjds-gk-kcv-cjb-co-and-39-efkdf-ljf-laksjfd-and-39-efpcokvcm-sp-aojkfckvjlkxjv-dfdf', '<p>dvsdfvsdbvbxvzxcv dfvadvadvadfdfvdvdvfdvfd xcbsdfbsva,cfa .sfk jdvkja;flk ckjfd ;afkja.,kvja;dl j &#39;fak/ vc s/fvjdfvjds;gk.kcv\\cjb\\.co&#39;efkdf ljf;laksjfd&#39;efpcokvc,m/\\ sp;\\aojkfckvjlkxjv ;dfdf</p>\r\n', '<p>dvsdfvsdbvbxvzxcv dfvadvadvadfdfvdvdvfdvfd xcbsdfbsva,cfa .sfk jdvkja;flk ckjfd ;afkja.,kvja;dl j &#39;fak/ vc s/fvjdfvjds;gk.kcv\\cjb\\.co&#39;efkdf ljf;laksjfd&#39;efpcokvc,m/\\ sp;\\aojkfckvjlkxjv ;dfdf</p>\r\n', 16),
(281, 699, 'our-ground-breaking-destination-will-become-a-focus-for-like-minded-people-for-whom-relaxation-can-combine-with-exhiliration-leisure-with-pleasure-people-can-learn-new-skills-practice-old-talents-unwind-write-stories-make-memories-with-loved-ones-tim', '<p>Our ground-breaking destination will become a focus for like-minded people for whom relaxation can combine with exhiliration, leisure with pleasure. People can learn new skills, practice old talents, unwind, write stories, make memories with loved ones.</p>\r\n\r\n<p>Time away from work, and moments together with family, are precious. Rhydycar West will be a place where precious hours, or days, can be filled with happiness. Gain a new kind of work-life balance every week, from surf lessons to facials. Plan to come for that long-awaited, much-anticipated summer holiday or winter getaway. Stay in a 4-star hotel or budget accommodation. Go camping or glamping. Play and stay for an hour, a day, a week or longer. There will be plenty of parking for those who will travel to be with us.</p>\r\n', '<p>Our ground-breaking destination will become a focus for like-minded people for whom relaxation can combine with exhiliration, leisure with pleasure. People can learn new skills, practice old talents, unwind, write stories, make memories with loved ones.</p>\r\n\r\n<p>Time away from work, and moments together with family, are precious. Rhydycar West will be a place where precious hours, or days, can be filled with happiness. Gain a new kind of work-life balance every week, from surf lessons to facials. Plan to come for that long-awaited, much-anticipated summer holiday or winter getaway. Stay in a 4-star hotel or budget accommodation. Go camping or glamping. Play and stay for an hour, a day, a week or longer. There will be plenty of parking for those who will travel to be with us.</p>\r\n', 128),
(466, 744, 'we-have-conducted-extensive-specialist-ecological-surveys-in-order-to-understand-in-detail-its-flora-and-fauna-understanding-the-ecology-of-the-site-is-a-critical-first-step-to-designing-a-development-which-is-sensitive-where-built-components-are-sited-c', '<p>We have conducted extensive specialist ecological surveys in order to understand in detail its flora and fauna. Understanding the ecology of the site is a critical first step to designing a development which is sensitive, where built components are sited carefully, and where vast areas of high ecological value are identified to remain untouched.</p>\r\n', '<p>We have conducted extensive specialist ecological surveys in order to understand in detail its flora and fauna. Understanding the ecology of the site is a critical first step to designing a development which is sensitive, where built components are sited carefully, and where vast areas of high ecological value are identified to remain untouched.</p>\r\n', 54),
(278, 694, 'interactive-map-explore-the-site-and-39-s-planned-features-on-our-interactive-map', '<h3><a href=\"http://rhydycarwest.com/the-scheme/interactive-map\">Interactive Map</a></h3>\r\n\r\n<p>Explore the site&#39;s planned features on our interactive map.</p>\r\n', '<h3><a href=\"http://rhydycarwest.com/the-scheme/interactive-map\">Interactive Map</a></h3>\r\n\r\n<p>Explore the site&#39;s planned features on our interactive map.</p>\r\n', 12),
(102, 702, NULL, '<p>&#160; &#160;&#160;</p>\r\n', '<p>&#160; &#160;&#160;</p>\r\n', 0),
(317, 703, 'the-impressive-and-all-inclusive-indoor-snow-centre-will-become-the-centre-of-excellence-for-snowsport-in-partnership-with-snowsport-wales-and-accessible-to-locals-day-tourists-adventurers-professionals-and-the-curious-this-500-metre-indoor-ski-slope-wil', '<p>The impressive and all-inclusive indoor snow centre will become the Centre of Excellence for Snowsport. In partnership with Snowsport Wales and accessible to locals, day tourists, adventurers, professionals and the curious, this 500-metre indoor ski slope will be one of the longest in Europe and the longest in the UK firmly putting Merthyr on the map.</p>\r\n\r\n<p>The facility will cater for all standards of skiing and snowboarding from complete beginner to Olympic level, with a terrain park, snow tubing, snow play area and ice climbing.&#160;</p>\r\n', '<p>The impressive and all-inclusive indoor snow centre will become the Centre of Excellence for Snowsport. In partnership with Snowsport Wales and accessible to locals, day tourists, adventurers, professionals and the curious, this 500-metre indoor ski slope will be one of the longest in Europe and the longest in the UK firmly putting Merthyr on the map.</p>\r\n\r\n<p>The facility will cater for all standards of skiing and snowboarding from complete beginner to Olympic level, with a terrain park, snow tubing, snow play area and ice climbing.&#160;</p>\r\n', 85),
(463, 705, 'rhydycar-west-has-really-splashed-out-with-the-largest-indoor-water-park-in-the-uk-planned-complete-with-an-indoor-surf-simulator-ride-the-waves-fly-down-flumes-or-paddle-in-the-pool-the-choice-is-yours', '<p>Rhydycar West has really splashed out with the largest indoor water park in the UK planned, complete with an indoor surf simulator. Ride the waves, fly down flumes, or paddle in the pool, the choice is yours.</p>\r\n', '<p>Rhydycar West has really splashed out with the largest indoor water park in the UK planned, complete with an indoor surf simulator. Ride the waves, fly down flumes, or paddle in the pool, the choice is yours.</p>\r\n', 37),
(468, 707, 'cyfarthfa-balance-pond-and-leat-it-is-believed-that-the-pond-dates-from-the-1830s-when-it-was-constructed-as-part-of-a-hydrological-system-used-to-feed-water-into-water-balance-mechanisms-used-at-mining-pits-in-the-locality-running-alongside-the-cy', '<h3>Cyfarthfa Balance Pond and Leat</h3>\r\n\r\n<p>It is believed that the pond dates from the 1830s when it was constructed as part of a hydrological system used to feed water into water balance mechanisms used at mining pits in the locality.</p>\r\n\r\n<p>Running alongside the Cyfarthfa Canal, the physical remains of the feature consist of an earth and stone dam built on three sides on an east facing slope. The inner face of the dam is stone-revetted and there are several features such as a stone lined sluice and brick lined spillway. The pond and leat are set within dense woodland crossed by a footpath that follows the edge of the watercourse. The mine is historically closely-associated with various elements of the surrounding, former industrial landscape. The pond fed water to several mines situated along its length including Cwm Pit and Lower Colliers Row. The pond requires extensive clearing to restore it.</p>\r\n', '<h3>Cyfarthfa Balance Pond and Leat</h3>\r\n\r\n<p>It is believed that the pond dates from the 1830s when it was constructed as part of a hydrological system used to feed water into water balance mechanisms used at mining pits in the locality.</p>\r\n\r\n<p>Running alongside the Cyfarthfa Canal, the physical remains of the feature consist of an earth and stone dam built on three sides on an east facing slope. The inner face of the dam is stone-revetted and there are several features such as a stone lined sluice and brick lined spillway. The pond and leat are set within dense woodland crossed by a footpath that follows the edge of the watercourse. The mine is historically closely-associated with various elements of the surrounding, former industrial landscape. The pond fed water to several mines situated along its length including Cwm Pit and Lower Colliers Row. The pond requires extensive clearing to restore it.</p>\r\n', 150),
(436, 708, 'cyfarthfa-canal-level-the-canal-was-one-of-the-first-generation-of-canals-in-wales-and-dates-from-1777-8-it-carried-small-tub-boats-and-was-used-to-transport-coal-from-levels-dug-into-the-slopes-along-the-east-side-of-the-site-to-the-cyfarthfa-i', '<h3>Cyfarthfa Canal Level</h3>\r\n\r\n<p>The canal was one of the first generation of canals in Wales and dates from 1777-8. It carried small &#8216;tub boats&#8217; and was used to transport coal from levels dug into the slopes along the east side of the site, to the Cyfarthfa Ironworks. The canal ran from roughly north-south along a sinuous route through the east side of the site, from Cwm Pit and the Canaid brook in the south north to Cyfarthfa, a route of approximately two miles. The canal fell out of use by around 1835-1840 and most of the course was subsequently covered by spoil tips and railways which superseded its role. Few parts remain extant, although part of a former lock wall survives to the north of the scheduled monument. The scheduled parts consist of a length of the canal which survives a large ditch with embanked walls, and a similar section with a channel off-shooting to the west to access a level mouth and stone-lined tunnel. The stonelined tunnel includes parts of a ruined building located at its entrance, ventilation gate fittings, a ventilation flue and a stone-lined access hole from the surface. Both parts of the former canal are dry and are heavily overgrown with vegetation. In the late 19th century, following the introduction of the long-wall technique of mining the Canal Level was reopened. By 1900 - 1919 it was connected via tramways to a loading area at Lower Collier&#8217;s Row to the south. A tramway, passing under the Cwm Pit Railway, carried spoil from the mine to tips to the east. It is likely that at least part of the structure of the level entrance dates from this period of re-use.</p>\r\n', '<h3>Cyfarthfa Canal Level</h3>\r\n\r\n<p>The canal was one of the first generation of canals in Wales and dates from 1777-8. It carried small &#8216;tub boats&#8217; and was used to transport coal from levels dug into the slopes along the east side of the site, to the Cyfarthfa Ironworks. The canal ran from roughly north-south along a sinuous route through the east side of the site, from Cwm Pit and the Canaid brook in the south north to Cyfarthfa, a route of approximately two miles. The canal fell out of use by around 1835-1840 and most of the course was subsequently covered by spoil tips and railways which superseded its role. Few parts remain extant, although part of a former lock wall survives to the north of the scheduled monument. The scheduled parts consist of a length of the canal which survives a large ditch with embanked walls, and a similar section with a channel off-shooting to the west to access a level mouth and stone-lined tunnel. The stonelined tunnel includes parts of a ruined building located at its entrance, ventilation gate fittings, a ventilation flue and a stone-lined access hole from the surface. Both parts of the former canal are dry and are heavily overgrown with vegetation. In the late 19th century, following the introduction of the long-wall technique of mining the Canal Level was reopened. By 1900 - 1919 it was connected via tramways to a loading area at Lower Collier&#8217;s Row to the south. A tramway, passing under the Cwm Pit Railway, carried spoil from the mine to tips to the east. It is likely that at least part of the structure of the level entrance dates from this period of re-use.</p>\r\n', 278),
(437, 709, 'grade-ii-listed-base-of-chimney-at-cwm-pit-the-building-dates-from-the-1820-1840s-and-originally-supported-a-very-tall-square-stack-situated-to-the-south-of-the-engine-house-at-the-cwm-pit-colliery-the-chimney-base-is-constructed-in-large-rockfaced-st', '<h3>Grade II listed Base of Chimney at Cwm Pit</h3>\r\n\r\n<p>The building dates from the 1820-1840s and originally supported a very tall square stack situated to the south of the engine house at the Cwm Pit Colliery. The chimney base is constructed in large rockfaced stone squared blocks with a stepped upper part below the demolished chimney stack. Each side of the building has a large arched stoking hole. Three of these are lined with yellow brick and one with masonry. It is theorised in the listing description that the yellow brick may have replaced masonry. The building is set within dense woodland adjacent to a footpath. It has a close association with the surrounding upstanding and archaeological remains of Cwm Pit, which are a scheduled monument. However, the vegetation that surrounds the building is dense. It encroaches upon the building, potentially damaging its masonry and lessening the degree to which the monument can be experienced as an element of the wider historic environment.</p>\r\n', '<h3>Grade II listed Base of Chimney at Cwm Pit</h3>\r\n\r\n<p>The building dates from the 1820-1840s and originally supported a very tall square stack situated to the south of the engine house at the Cwm Pit Colliery. The chimney base is constructed in large rockfaced stone squared blocks with a stepped upper part below the demolished chimney stack. Each side of the building has a large arched stoking hole. Three of these are lined with yellow brick and one with masonry. It is theorised in the listing description that the yellow brick may have replaced masonry. The building is set within dense woodland adjacent to a footpath. It has a close association with the surrounding upstanding and archaeological remains of Cwm Pit, which are a scheduled monument. However, the vegetation that surrounds the building is dense. It encroaches upon the building, potentially damaging its masonry and lessening the degree to which the monument can be experienced as an element of the wider historic environment.</p>\r\n', 163),
(469, 710, 'vale-of-neath-railway-cutting-and-tunnel-portal-the-entrance-is-constructed-in-coursed-rough-faced-pennant-sandstone-with-the-arch-framed-by-ranking-buttresses-and-made-up-of-six-courses-of-yellow-engineered-brick-the-cutting-and-tunnel-were-designed', '<h3>Vale of Neath Railway Cutting and Tunnel Portal</h3>\r\n\r\n<p>The entrance is constructed in coursed, rough faced Pennant sandstone with the arch framed by ranking buttresses and made up of six courses of yellow engineered brick. The cutting and tunnel were designed by Sir Isambard Kingdom Brunel and when finished in 1853 was the longest railway tunnel in Wales. The tunnel is blocked by a metal panelled modern gate, with a spiked top. The cutting and tunnel are set within a deep incision surrounded by dense woodland.&#160;</p>\r\n\r\n<p>&#160;</p>\r\n', '<h3>Vale of Neath Railway Cutting and Tunnel Portal</h3>\r\n\r\n<p>The entrance is constructed in coursed, rough faced Pennant sandstone with the arch framed by ranking buttresses and made up of six courses of yellow engineered brick. The cutting and tunnel were designed by Sir Isambard Kingdom Brunel and when finished in 1853 was the longest railway tunnel in Wales. The tunnel is blocked by a metal panelled modern gate, with a spiked top. The cutting and tunnel are set within a deep incision surrounded by dense woodland.&#160;</p>\r\n\r\n<p>&#160;</p>\r\n', 85),
(194, 711, 'cwm-glo-chapel-the-chapel-was-one-of-the-earliest-non-conformist-chapels-in-south-wales-following-the-restoration-of-king-charles-ii-merthyr-tydfil-was-a-centre-for-puritan-dissenters-persecution-of-the-movement-led-the-faithful-to-hold-their-meeting', '<h3>Cwm Glo Chapel</h3>\r\n\r\n<p>The chapel was one of the earliest non-conformist chapels in South Wales. Following the restoration of King Charles II, Merthyr Tydfil was a centre for Puritan Dissenters. Persecution of the movement led the faithful to hold their meetings in a barn at the secluded Cwm Glo Farm. The farm no longer exists but was located to the north-east of the chapel. The Toleration Act of 1689 allowed the practice of their faith in public, and, the following year, a chapel was erected near Cwm Glo on the banks of the Nant Llwyn-yr-eos. The chapel was a central place for Christian nonconformity in north Glamorgan until 1749 when the lease expired and a new chapel was built in the town of Merthyr.&#160;<br />\r\n&#160;</p>\r\n', '<h3>Cwm Glo Chapel</h3>\r\n\r\n<p>The chapel was one of the earliest non-conformist chapels in South Wales. Following the restoration of King Charles II, Merthyr Tydfil was a centre for Puritan Dissenters. Persecution of the movement led the faithful to hold their meetings in a barn at the secluded Cwm Glo Farm. The farm no longer exists but was located to the north-east of the chapel. The Toleration Act of 1689 allowed the practice of their faith in public, and, the following year, a chapel was erected near Cwm Glo on the banks of the Nant Llwyn-yr-eos. The chapel was a central place for Christian nonconformity in north Glamorgan until 1749 when the lease expired and a new chapel was built in the town of Merthyr.&#160;<br />\r\n&#160;</p>\r\n', 122),
(195, 740, 'the-monument-is-hard-to-experience-from-outside-the-cutting-the-best-experience-is-had-from-the-approach-along-the-former-railway-track-to-the-north-east-the-cutting-is-particularly-visible-in-views-from-a-road-bridge-which-cross-the-railway-immediately', '<p>The monument is hard to experience from outside the cutting, the best experience is had from the approach along the former railway track to the north-east. The cutting is particularly visible in views from a road bridge which cross the railway, immediately adjacent to the scheduled area to the north-east. The monument is historically associated with the remains of the railway to the north-east which includes several stone-built bridges and a former junction.<br />\r\n&#160;</p>\r\n', '<p>The monument is hard to experience from outside the cutting, the best experience is had from the approach along the former railway track to the north-east. The cutting is particularly visible in views from a road bridge which cross the railway, immediately adjacent to the scheduled area to the north-east. The monument is historically associated with the remains of the railway to the north-east which includes several stone-built bridges and a former junction.<br />\r\n&#160;</p>\r\n', 73),
(384, 876, 'outdoor-fun', '<h3>Outdoor Fun</h3>\r\n', '<h3>Outdoor Fun</h3>\r\n', 2),
(467, 866, 'and-once-you-re-settled-in-and-ready-to-explore-there-s-lots-to-choose-from-indoor-skiing-and-snowboarding-indoor-biking-and-skateboarding-indoor-waterpark-including-ziplines-mountain-coaster-airpark-equestrian-centre-heritage-trails-and-bike-p', '<p><strong>And once you&#8217;re settled in and ready to explore there&#8217;s lots to choose from!</strong><br />\r\nIndoor skiing and snowboarding<br />\r\nIndoor biking and skateboarding<br />\r\nIndoor waterpark</p>\r\n\r\n<p>Including ziplines, mountain coaster, airpark, equestrian centre, heritage trails and bike paths<br />\r\n&#160;</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h3>This is Rhydycar West!</h3>\r\n', '<p><strong>And once you&#8217;re settled in and ready to explore there&#8217;s lots to choose from!</strong><br />\r\nIndoor skiing and snowboarding<br />\r\nIndoor biking and skateboarding<br />\r\nIndoor waterpark</p>\r\n\r\n<p>Including ziplines, mountain coaster, airpark, equestrian centre, heritage trails and bike paths<br />\r\n&#160;</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h3>This is Rhydycar West!</h3>\r\n', 40),
(412, 873, 'indoor-bike-and-skate-park-the-first-of-its-kind-in-wales-this-exhilarating-facility-will-complement-the-neighbouring-bike-park-wales-and-is-designed-to-help-bikers-and-skaters-improve-their-skills-in-a-year-round-training-facility-including-foam-pit', '<h3>Indoor Bike &#38; Skate Park</h3>\r\n\r\n<p>The first of its kind in Wales, this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', '<h3>Indoor Bike &#38; Skate Park</h3>\r\n\r\n<p>The first of its kind in Wales, this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', 67),
(280, 698, 'once-completed-rhydycar-west-is-set-to-be-the-ultimate-destination-for-sports-enthusiasts-adventurers-couples-looking-for-some-together-time-families-in-search-of-a-fun-time-and-individuals-looking-for-some-out-of-the-ordinary-me-time-offering-one-off-es', '<p>Once completed, Rhydycar West is set to be the ultimate destination for sports enthusiasts, adventurers, couples looking for some together time, families in search of a fun time, and individuals looking for some out-of-the-ordinary me time. Offering one-off escapades, day trips, weekend breaks and weeklong holidays, with a whole host of activities to choose from including historic relics to rollercoasters, there really will be something for everyone at Rhydycar West. Choose a relaxing spa day followed by a romantic meal for two or an exhilarating surf and ski weekend &#8211; it&#8217;s certainly a break with tradition. Rhydycar West is your break, your time, your way.</p>\r\n', '<p>Once completed, Rhydycar West is set to be the ultimate destination for sports enthusiasts, adventurers, couples looking for some together time, families in search of a fun time, and individuals looking for some out-of-the-ordinary me time. Offering one-off escapades, day trips, weekend breaks and weeklong holidays, with a whole host of activities to choose from including historic relics to rollercoasters, there really will be something for everyone at Rhydycar West. Choose a relaxing spa day followed by a romantic meal for two or an exhilarating surf and ski weekend &#8211; it&#8217;s certainly a break with tradition. Rhydycar West is your break, your time, your way.</p>\r\n', 104),
(458, 712, 'cwm-pit-and-head-of-railway-cwm-pit-is-one-of-the-larger-mining-complexes-within-the-site-with-some-of-the-best-preserved-upstanding-remains-mine-working-at-cwm-pit-dates-from-the-late-18th-century-it-was-the-location-of-the-terminus-of-the-cyfarthfa', '<h3>Cwm Pit and Head of Railway</h3>\r\n\r\n<p>Cwm Pit is one of the larger mining complexes within the site, with some of the best preserved upstanding remains. Mine working at Cwm Pit dates from the late 18th century. It was the location of the terminus of the Cyfarthfa Canal which served to connect surface coal working in the locality with the Cyfarthfa Ironworks. At the western end of the scheduled monument area is a well-preserved former water balance pond defined by an earthwork. In 1843, a deep pit (with steam powered mechanics) was sunk at Cwm Pit which eventually reached to 150 yards, one of the deepest in the region. Unlike at present, the mine was set within a relatively open landscape and would have been highly visible. The mine workings were accessed by the Cwm Pit Railway, a narrow-gauge railway that ran from its terminus at Cwm Pit to Cyfarthfa ironworks, replacing the function of the earlier canal. The line was constructed in the mid-19th century and was an important spinal route through the site; a major haulage route for iron and coal that influenced the subsequent industrial development of the locality.</p>\r\n', '<h3>Cwm Pit and Head of Railway</h3>\r\n\r\n<p>Cwm Pit is one of the larger mining complexes within the site, with some of the best preserved upstanding remains. Mine working at Cwm Pit dates from the late 18th century. It was the location of the terminus of the Cyfarthfa Canal which served to connect surface coal working in the locality with the Cyfarthfa Ironworks. At the western end of the scheduled monument area is a well-preserved former water balance pond defined by an earthwork. In 1843, a deep pit (with steam powered mechanics) was sunk at Cwm Pit which eventually reached to 150 yards, one of the deepest in the region. Unlike at present, the mine was set within a relatively open landscape and would have been highly visible. The mine workings were accessed by the Cwm Pit Railway, a narrow-gauge railway that ran from its terminus at Cwm Pit to Cyfarthfa ironworks, replacing the function of the earlier canal. The line was constructed in the mid-19th century and was an important spinal route through the site; a major haulage route for iron and coal that influenced the subsequent industrial development of the locality.</p>\r\n', 191),
(471, 713, 'cwm-du-air-shaft-and-fan-this-site-consists-of-a-mechanical-colliery-ventilation-fan-and-shaft-associated-with-19th-and-20th-century-mine-workings-at-cwm-du-the-fan-mechanism-is-contemporary-with-buildings-associated-with-the-cwm-du-drift-mine-located', '<h3>Cwm Du Air Shaft and Fan</h3>\r\n\r\n<p>This site consists of a mechanical colliery ventilation fan and shaft associated with 19th and 20th century mine workings at Cwm Du. The fan mechanism is contemporary with buildings associated with the Cwm Du drift mine located to the north. The shaft is set on a low spoil mound with a circular shaft at its centre, lined in brick and stone, and currently capped with gravel. Beside the shaft is the fan box, set on metal foundations, it consists of an iron boxed structure with sheet metal inlet tube and, inside, the axel and blades of the fan. The fan is set within a relatively open area characterised by an extent of rough pasture, populated by small trees.</p>\r\n', '<h3>Cwm Du Air Shaft and Fan</h3>\r\n\r\n<p>This site consists of a mechanical colliery ventilation fan and shaft associated with 19th and 20th century mine workings at Cwm Du. The fan mechanism is contemporary with buildings associated with the Cwm Du drift mine located to the north. The shaft is set on a low spoil mound with a circular shaft at its centre, lined in brick and stone, and currently capped with gravel. Beside the shaft is the fan box, set on metal foundations, it consists of an iron boxed structure with sheet metal inlet tube and, inside, the axel and blades of the fan. The fan is set within a relatively open area characterised by an extent of rough pasture, populated by small trees.</p>\r\n', 124),
(438, 714, 'black-pins-early-ironstone-workings-the-works-date-from-the-early-19th-century-up-until-the-1870s-after-which-as-stated-by-cadw-the-site-was-abandoned-for-a-similar-operation-at-winch-fawr-the-works-targeted-surface-outcrops-of-ironstone-using-primi', '<h3>Black Pins Early Ironstone Workings</h3>\r\n\r\n<p>The works date from the early 19th century up until the 1870s, after which (as stated by CADW) the site was abandoned for a similar operation at Winch Fawr. The works targeted surface outcrops of ironstone using primitive open cast mining techniques such as patching and scouring with water. The irregular scheduled monument area encompasses an uneven landscape of steep sided finger tips and former open cast excavation pits. The mine workings were accessed by a tramway from the north-east which is visible as a low earthwork. The locations of other former tramways are identifiable within the monument area.</p>\r\n', '<h3>Black Pins Early Ironstone Workings</h3>\r\n\r\n<p>The works date from the early 19th century up until the 1870s, after which (as stated by CADW) the site was abandoned for a similar operation at Winch Fawr. The works targeted surface outcrops of ironstone using primitive open cast mining techniques such as patching and scouring with water. The irregular scheduled monument area encompasses an uneven landscape of steep sided finger tips and former open cast excavation pits. The mine workings were accessed by a tramway from the north-east which is visible as a low earthwork. The locations of other former tramways are identifiable within the monument area.</p>\r\n', 104),
(439, 715, 'cwm-glo-pit-and-ironstone-tip-the-cwm-glo-pit-was-one-of-the-larger-operations-in-the-west-rhydycar-mining-area-and-the-site-producing-both-coal-and-ironstone-from-a-shaft-and-mining-levels-to-the-south-east-it-is-thought-that-the-shaft-was-operated-f', '<h3>Cwm Glo Pit and Ironstone Tip</h3>\r\n\r\n<p>The Cwm Glo Pit was one of the larger operations in the West Rhydycar mining area, and the site, producing both coal and ironstone from a shaft and mining levels to the south-east. It is thought that the shaft was operated from the 1830s or 40s up until 1905. The site sits on the edge of, and is surrounded on the west and east sides by large spoil tips. The proposed scheduled monument encompasses the head of an incline railway which connected the mine at Cwm Glo to the Cwm Pit Railway, several stone sleepers, and a possible older feature, predating the Cwm Glo shaft - a small pond and leat. It is theorised by CADW that this is an early &#8216;hushing pond&#8217; used as part of late 18th and early 19th century scouring operations in the Cwm Glo valley. The valley is densely wooded but the scheduled area has a fairly-open setting, consisting of grassed spaces, although bracken is prolific in the summer months.</p>\r\n', '<h3>Cwm Glo Pit and Ironstone Tip</h3>\r\n\r\n<p>The Cwm Glo Pit was one of the larger operations in the West Rhydycar mining area, and the site, producing both coal and ironstone from a shaft and mining levels to the south-east. It is thought that the shaft was operated from the 1830s or 40s up until 1905. The site sits on the edge of, and is surrounded on the west and east sides by large spoil tips. The proposed scheduled monument encompasses the head of an incline railway which connected the mine at Cwm Glo to the Cwm Pit Railway, several stone sleepers, and a possible older feature, predating the Cwm Glo shaft - a small pond and leat. It is theorised by CADW that this is an early &#8216;hushing pond&#8217; used as part of late 18th and early 19th century scouring operations in the Cwm Glo valley. The valley is densely wooded but the scheduled area has a fairly-open setting, consisting of grassed spaces, although bracken is prolific in the summer months.</p>\r\n', 169),
(225, 719, 'the-non-wooded-areas-of-the-site-include-areas-of-mire-and-marshy-grassland-habitat-dominated-by-purple-moor-grass-and-with-sphagnum-mosses-in-places-there-are-drier-acid-grasslands-and-heath-on-freer-draining-ground-including-the-landscapes-created-by-f', '<p>The non-wooded areas of the site include areas of mire and marshy grassland habitat dominated by purple moor grass and with Sphagnum mosses in places. There are drier acid grasslands and heath on freer draining ground, including the landscapes created by former mining activity.</p>\r\n', '<p>The non-wooded areas of the site include areas of mire and marshy grassland habitat dominated by purple moor grass and with Sphagnum mosses in places. There are drier acid grasslands and heath on freer draining ground, including the landscapes created by former mining activity.</p>\r\n', 44),
(222, 720, 'the-more-free-draining-areas-of-grassland-on-the-site-support-an-extremely-diverse-assemblage-of-grassland-fungi-including-waxcaps-earth-tongues-and-fairy-clubs-the-damp-grasslands-also-make-an-ideal-home-for-marsh-fritillary-and-8211-a-gorgeous-russe', '<p>The more free-draining areas of grassland on the site support an extremely diverse assemblage of grassland fungi, including waxcaps, earth-tongues and fairy-clubs. The damp grasslands also make an ideal home for marsh fritillary &#8211; a gorgeous russet chequerboard patterned butterfly &#8211; that flies in May and June.</p>\r\n', '<p>The more free-draining areas of grassland on the site support an extremely diverse assemblage of grassland fungi, including waxcaps, earth-tongues and fairy-clubs. The damp grasslands also make an ideal home for marsh fritillary &#8211; a gorgeous russet chequerboard patterned butterfly &#8211; that flies in May and June.</p>\r\n', 45),
(334, 721, 'the-upland-areas-of-woodland-in-the-west-of-the-site-support-iconic-western-species-of-bird-such-as-redstart-and-wood-warbler-the-heathy-slopes-reverberate-in-summer-to-the-nocturnal-purring-of-the-nightjar', '<p>The upland areas of woodland in the west of the site support iconic &#8216;western&#8217; species of bird such as redstart and wood warbler. The heathy slopes reverberate in summer to the nocturnal purring of the nightjar.</p>\r\n', '<p>The upland areas of woodland in the west of the site support iconic &#8216;western&#8217; species of bird such as redstart and wood warbler. The heathy slopes reverberate in summer to the nocturnal purring of the nightjar.</p>\r\n', 36),
(184, 695, 'timeline', '<h3><a href=\"http://rhydycar.thinkorchard.com/the-scheme/timeline\">Timeline</a></h3>\r\n', '<h3><a href=\"http://rhydycar.thinkorchard.com/the-scheme/timeline\">Timeline</a></h3>\r\n', 1),
(279, 696, 'press-and-media', '<h3><a href=\"http://rhydycarwest.com/the-scheme/press-media\">Press &#38; Media</a></h3>\r\n', '<h3><a href=\"http://rhydycarwest.com/the-scheme/press-media\">Press &#38; Media</a></h3>\r\n', 2),
(264, 726, 'indoor-bike-and-skate-park-the-first-of-its-kind-in-wales-this-exhilarating-facility-will-complement-the-neighbouring-bike-park-wales-and-is-designed-to-help-bikers-and-skaters-improve-their-skills-in-a-year-round-training-facility-including-foam', '<h2>Indoor Bike &#38; Skate Park</h2>\r\n\r\n<h3>The first of its kind in Wales,</h3>\r\n\r\n<p>this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', '<h2>Indoor Bike &#38; Skate Park</h2>\r\n\r\n<h3>The first of its kind in Wales,</h3>\r\n\r\n<p>this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', 67),
(246, 731, 'waterpark-and-surf-simulator-any-holiday-hot-spot-and-thriving-community-hub-wouldn-and-8217-t-be-complete-without-a-swimming-pool-and-rhydycar-west-has-really-splashed-out-with-the-largest-indoor-water-park-in-the-uk-planned-complete-with-an-indoor', '<h2>Waterpark &#38; Surf Simulator</h2>\r\n\r\n<p>Any holiday hot spot and thriving community hub wouldn&#8217;t be complete without a swimming pool, and Rhydycar West has really splashed out with the largest indoor water park in the UK planned, complete with an indoor surf simulator. Ride the waves, fly down flumes, or paddle in the pool, the choice is yours.</p>\r\n', '<h2>Waterpark &#38; Surf Simulator</h2>\r\n\r\n<p>Any holiday hot spot and thriving community hub wouldn&#8217;t be complete without a swimming pool, and Rhydycar West has really splashed out with the largest indoor water park in the UK planned, complete with an indoor surf simulator. Ride the waves, fly down flumes, or paddle in the pool, the choice is yours.</p>\r\n', 56),
(254, 730, 'indoor-skidome-the-impressive-and-all-inclusive-indoor-snow-centre-will-become-the-centre-of-excellence-for-snowsport-in-partnership-with-snowsport-wales-and-accessible-to-locals-day-tourists-adventurers-professionals-and-the-curious-this-500-metre', '<h2>Indoor Skidome</h2>\r\n\r\n<h3>The impressive and all-inclusive indoor snow centre</h3>\r\n\r\n<p>will become the Centre of Excellence for Snowsport. In partnership with Snowsport Wales and accessible to locals, day tourists, adventurers, professionals and the curious, this 500-metre indoor ski slope will be one of the longest in Europe and the longest in the UK firmly putting Merthyr on the map.</p>\r\n\r\n<p>The facility will cater for all standards of skiing and snowboarding from complete beginner to Olympic level, with a terrain park, snow tubing, snow play area and ice climbing.&#160;</p>\r\n\r\n<p>&#160;</p>\r\n', '<h2>Indoor Skidome</h2>\r\n\r\n<h3>The impressive and all-inclusive indoor snow centre</h3>\r\n\r\n<p>will become the Centre of Excellence for Snowsport. In partnership with Snowsport Wales and accessible to locals, day tourists, adventurers, professionals and the curious, this 500-metre indoor ski slope will be one of the longest in Europe and the longest in the UK firmly putting Merthyr on the map.</p>\r\n\r\n<p>The facility will cater for all standards of skiing and snowboarding from complete beginner to Olympic level, with a terrain park, snow tubing, snow play area and ice climbing.&#160;</p>\r\n\r\n<p>&#160;</p>\r\n', 87),
(455, 769, 'the-site-has-been-almost-untouched-since-the-mid-20th-century-but-rhydycar-west-has-a-rich-history-dating-back-to-prehistoric-times- ', '<p>The site has been almost untouched since the mid-20th Century, but Rhydycar West has a rich history dating back to prehistoric times. </p>\r\n', '<p>The site has been almost untouched since the mid-20th Century, but Rhydycar West has a rich history dating back to prehistoric times. </p>\r\n', 23),
(283, 737, 'monuments-our-cherished-monuments-which-tell-so-many-tales-about-our-home-are-scattered-around-our-land- it-is-our-mission-to-restore-these-regional-treasures-and-return-them-to-their-former-glory', '<h3><a href=\"http://rhydycarwest.com/en/elements/monuments\">Monuments</a></h3>\r\n\r\n<p>Our cherished monuments, which tell so many tales about our home, are scattered around our land.&#160;It is our mission to restore these regional treasures and return them to their former glory.</p>\r\n', '<h3><a href=\"http://rhydycarwest.com/en/elements/monuments\">Monuments</a></h3>\r\n\r\n<p>Our cherished monuments, which tell so many tales about our home, are scattered around our land.&#160;It is our mission to restore these regional treasures and return them to their former glory.</p>\r\n', 32),
(428, 770, 'our-cherished-monuments-which-tell-so-many-tales-about-our-home-are-scattered-around-our-land- it-is-our-mission-to-restore-these-regional-treasures-and-return-them-to-their-former-glory', '<p>Our cherished monuments, which tell so many tales about our home, are scattered around our land.&#160;It is our mission to restore these regional treasures and return them to their former glory.</p>\r\n', '<p>Our cherished monuments, which tell so many tales about our home, are scattered around our land.&#160;It is our mission to restore these regional treasures and return them to their former glory.</p>\r\n', 31),
(444, 735, 'accommodation-there-is-a style of-accommodation-to-suit-every-taste-at-rhydycar-west-a-spa-hotel-complete-with-conference-facilities-a-sport-hotel-to-wind-down-following-a-days- cycling-a-private-lodge-nestled-in-the-forest-or-glamping-by-cand', '<h3>Accommodation</h3>\r\n\r\n<p>There is a&#160;style&#160;of accommodation to suit every taste at Rhydycar West.</p>\r\n\r\n<p>A spa hotel complete with conference facilities, a sport hotel to wind down following a days&#8217;&#160;cycling, a private lodge nestled in the forest or glamping by candlelight.&#160;&#160;However you like to spend your day, as evening approaches&#160;you&#160;can relax as you wish at Rhydycar West.&#160;</p>\r\n', '<h3>Accommodation</h3>\r\n\r\n<p>There is a&#160;style&#160;of accommodation to suit every taste at Rhydycar West.</p>\r\n\r\n<p>A spa hotel complete with conference facilities, a sport hotel to wind down following a days&#8217;&#160;cycling, a private lodge nestled in the forest or glamping by candlelight.&#160;&#160;However you like to spend your day, as evening approaches&#160;you&#160;can relax as you wish at Rhydycar West.&#160;</p>\r\n', 55),
(464, 874, 'waterpark-rhydycar-west-has-really-splashed-out-with-plans-for-one-of the-largest-indoor-water-parks-in-the-uk-complete-with-an-indoor-surf-simulator-you-can-ride-the-waves-fly-down-flumes-or-paddle-in-the-pool-the-choice-is-yours', '<h3>Waterpark</h3>\r\n\r\n<p>Rhydycar West has really splashed out with plans for one of&#160;the largest indoor water parks in the UK. Complete with an indoor surf simulator you can ride the waves, fly down flumes, or paddle in the pool. The choice is yours.</p>\r\n', '<h3>Waterpark</h3>\r\n\r\n<p>Rhydycar West has really splashed out with plans for one of&#160;the largest indoor water parks in the UK. Complete with an indoor surf simulator you can ride the waves, fly down flumes, or paddle in the pool. The choice is yours.</p>\r\n', 42),
(267, 736, 'trails-walk-hike-trek-run-jog-meander-stroll-or-cycle-your-way-around-hundreds-of-acres-of-beautiful-woodlands-the-added-bonus-of-a-zipline-for-all-ages-will-provide-additional-family-friendly-fun-alongside-team-building-activities', '<h3>Trails</h3>\r\n\r\n<p>Walk, hike, trek, run, jog, meander, stroll or cycle your way around hundreds of acres of beautiful woodlands.</p>\r\n\r\n<p>The added bonus of a zipline for all ages will provide additional family-friendly fun alongside team-building activities.</p>\r\n', '<h3>Trails</h3>\r\n\r\n<p>Walk, hike, trek, run, jog, meander, stroll or cycle your way around hundreds of acres of beautiful woodlands.</p>\r\n\r\n<p>The added bonus of a zipline for all ages will provide additional family-friendly fun alongside team-building activities.</p>\r\n', 36),
(284, 732, 'activities-from-indoor-biking-and-skating-waterpark-and-surf-simulator-to-europe-and-39-s-longest-indoor-ski-dome-at-over-500-meters', '<h3><a href=\"http://rhydycarwest.com/en/elements/activities\">Activities </a></h3>\r\n\r\n<p>From indoor biking &#38; skating, waterpark and surf simulator, to Europe&#39;s longest indoor Ski dome at over 500 meters.</p>\r\n', '<h3><a href=\"http://rhydycarwest.com/en/elements/activities\">Activities </a></h3>\r\n\r\n<p>From indoor biking &#38; skating, waterpark and surf simulator, to Europe&#39;s longest indoor Ski dome at over 500 meters.</p>\r\n', 19),
(470, 739, 'the-remains-consist-of-a-rectangular-stonewalled-yard-containing-the-chapel-with-the-walls-of-the-chapel-with-an-extension-on-the-south-east-side-the-remains-are-set-in-a-hollow-on-the-south-side-of-the-steep-sided-valley-of-the-nant-llwyn-yr-eos-a-remot', '<p>The remains consist of a rectangular stonewalled yard containing the chapel, with the walls of the chapel with an extension on the south-east side. The remains are set in a hollow on the south side of the steep-sided valley of the Nant Llwyn-yr-eos, a remote location 500m from Heolgerrig. The valley, and much of the surrounding landscape, is densely wooded and the remains are fairly inaccessible, approached by a steep overgrown path. The wider landscape contains numerous remains from the 18th and 19th century industry including shafts, spoil tips and former tramways. It also includes the remains of the pre-industrial agricultural landscape including the remains of stone walls, representing former field boundaries, and, the ruined remains of several post-medieval farms and cottage such as Pen-y-coedcae, Llwyn-yr-eos and Cwm Glo Farm.</p>\r\n', '<p>The remains consist of a rectangular stonewalled yard containing the chapel, with the walls of the chapel with an extension on the south-east side. The remains are set in a hollow on the south side of the steep-sided valley of the Nant Llwyn-yr-eos, a remote location 500m from Heolgerrig. The valley, and much of the surrounding landscape, is densely wooded and the remains are fairly inaccessible, approached by a steep overgrown path. The wider landscape contains numerous remains from the 18th and 19th century industry including shafts, spoil tips and former tramways. It also includes the remains of the pre-industrial agricultural landscape including the remains of stone walls, representing former field boundaries, and, the ruined remains of several post-medieval farms and cottage such as Pen-y-coedcae, Llwyn-yr-eos and Cwm Glo Farm.</p>\r\n', 130),
(212, 734, NULL, '<h3>Hotel &#38; Spa</h3>\r\n\r\n<p>There is accommodation to suit all holidays, all budgets and all visitors at Rhydycar West. The luxury hotel and spa with conference facilities, provides a year-round attraction offering facials, massages and&#160;Jacuzzi.Whether a pamper package is what you desire, or a sports massage following a days&#8217; cycling, you can call this hotel home for the day or for your stay. For trekkers on a budget, the family-friendly accommodation offers an economical and comfy solution all within walking distance to the local amenities.</p>\r\n', '<h3>Hotel &#38; Spa</h3>\r\n\r\n<p>There is accommodation to suit all holidays, all budgets and all visitors at Rhydycar West. The luxury hotel and spa with conference facilities, provides a year-round attraction offering facials, massages and&#160;Jacuzzi.Whether a pamper package is what you desire, or a sports massage following a days&#8217; cycling, you can call this hotel home for the day or for your stay. For trekkers on a budget, the family-friendly accommodation offers an economical and comfy solution all within walking distance to the local amenities.</p>\r\n', 83);
INSERT INTO `sym_entries_data_258` (`id`, `entry_id`, `handle`, `value`, `value_formatted`, `word_count`) VALUES
(329, 693, 'benefits-to-our-area-rhydycar-west-provides-an-ideal-setting-to-help-the-region-forge-itself-as-a-destination-for-activity-tourism-and-with-it-bring-in-vital-economic-provision-for-the-community-furthermore-this-exciting-project-will-firmly-position-m', '<h3><a href=\"http://rhydycarwest.com/the-scheme/benefits-to-area\">Benefits to our Area</a></h3>\r\n\r\n<p>Rhydycar West provides an ideal setting to help the region forge itself as a destination for activity tourism and with it, bring in vital economic provision for the community. Furthermore, this exciting project will firmly position Merthyr as a key player in the evolving development of economic opportunities in the south wales valleys.&#160;Hundreds of long-term local jobs will be created as well as linked opportunities for businesses across the region.</p>\r\n', '<h3><a href=\"http://rhydycarwest.com/the-scheme/benefits-to-area\">Benefits to our Area</a></h3>\r\n\r\n<p>Rhydycar West provides an ideal setting to help the region forge itself as a destination for activity tourism and with it, bring in vital economic provision for the community. Furthermore, this exciting project will firmly position Merthyr as a key player in the evolving development of economic opportunities in the south wales valleys.&#160;Hundreds of long-term local jobs will be created as well as linked opportunities for businesses across the region.</p>\r\n', 74),
(449, 850, 'indoor-skate-and-bike-park-the-first-of-its-kind-in-wales-this-exhilarating-facility-will-complement-the-neighbouring-bike-park-wales-and-is-designed-to-help-bikers-and-skaters-improve-their-skills-in-a-year-round-training-facility-including-foam-pit', '<h2>Indoor Skate &#38; Bike Park</h2>\r\n\r\n<p>The first of its kind in Wales, this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', '<h2>Indoor Skate &#38; Bike Park</h2>\r\n\r\n<p>The first of its kind in Wales, this exhilarating facility will complement the neighbouring Bike Park Wales and is designed to help bikers and skaters improve their skills in a year-round training facility including foam pits, dirt jumps, learning area, and children&#8217;s pump track and street scene. This all-weather facility will strengthen the region&#8217;s position as the premier biking destination in the UK.</p>\r\n', 67),
(472, 852, 'indoor-snow-centre-we-are-working-with-snowsport-wales-to-create-a-national-centre-of-excellence-for-snowsport-rhydycar-west-would-one-of-the-longest-such-facilities-in-europe-with-challenging-runs-for-professionals-right-down-to-beginner-slopes-for-f', '<h2>Indoor Snow Centre</h2>\r\n\r\n<p>We are working with Snowsport Wales to create a national Centre of Excellence for Snowsport. Rhydycar West would one of the longest such facilities in Europe, with challenging runs for professionals, right down to beginner slopes for first timers.</p>\r\n\r\n<p>Producing real snow in a controlled atmosphere means there are perfect conditions 365 days of the&#160;year. And with the inclusion of snow play, tubing, ice climbing and other winter activities, there&#160;is fun for absolutely everyone, anytime.</p>\r\n\r\n<p>This snow centre would be based on similar successful snow centres, particularly those in&#160;<a href=\"http://rhydycarwest.com/elements/continental-europe\" style=\"font-size: 20px; color: red;\">continental Europe.</a></p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h3>Olympic connection?</h3>\r\n\r\n<p>Because Team GB currently train off-season indoors in Europe, it is our goal to help them to meet their ambitious targets for the Olympics in 2030, while remaining at home.</p>\r\n\r\n<p>We also have plans in place to work with local schools and clubs to encourage and inspire our youngsters to experience winter sports.&#160;We want the next generation of winter Olympic athletes to hail from Wales.&#160;<a href=\"http://rhydycarwest.com/elements/gb-2030\" style=\"font-size: 20px; color: red;\">GB 2030</a></p>\r\n', '<h2>Indoor Snow Centre</h2>\r\n\r\n<p>We are working with Snowsport Wales to create a national Centre of Excellence for Snowsport. Rhydycar West would one of the longest such facilities in Europe, with challenging runs for professionals, right down to beginner slopes for first timers.</p>\r\n\r\n<p>Producing real snow in a controlled atmosphere means there are perfect conditions 365 days of the&#160;year. And with the inclusion of snow play, tubing, ice climbing and other winter activities, there&#160;is fun for absolutely everyone, anytime.</p>\r\n\r\n<p>This snow centre would be based on similar successful snow centres, particularly those in&#160;<a href=\"http://rhydycarwest.com/elements/continental-europe\" style=\"font-size: 20px; color: red;\">continental Europe.</a></p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h3>Olympic connection?</h3>\r\n\r\n<p>Because Team GB currently train off-season indoors in Europe, it is our goal to help them to meet their ambitious targets for the Olympics in 2030, while remaining at home.</p>\r\n\r\n<p>We also have plans in place to work with local schools and clubs to encourage and inspire our youngsters to experience winter sports.&#160;We want the next generation of winter Olympic athletes to hail from Wales.&#160;<a href=\"http://rhydycarwest.com/elements/gb-2030\" style=\"font-size: 20px; color: red;\">GB 2030</a></p>\r\n', 158),
(462, 849, 'outdoor-fun-great-activities-like-ziplining-mountain-coaster-airpark-or-equestrian-centre-as-well-as-bike-paths-and-nature-trails-to-enjoy-2', '<h2>Outdoor Fun</h2>\r\n\r\n<p>Great activities like ziplining, mountain coaster, airpark or equestrian centre as well as bike paths and nature trails to enjoy.</p>\r\n', '<h2>Outdoor Fun</h2>\r\n\r\n<p>Great activities like ziplining, mountain coaster, airpark or equestrian centre as well as bike paths and nature trails to enjoy.</p>\r\n', 22),
(367, 853, 'landgraaf-snow-centre-a-success-story-major-indoor-ski-centres-are-of-course-nothing-new-across-western-europe-and-one-of-the-most-successful-examples-of-all-time-is-netherlands-based-snowworld-landgraaf-similar-to-rhydycar-west-landgraaf-is-half', '<h2>Landgraaf Snow Centre: A success story</h2>\r\n\r\n<p>Major indoor ski centres are, of course, nothing new across Western Europe, and one of the most successful examples of all time is Netherlands-based SnowWorld Landgraaf.</p>\r\n\r\n<p>Similar to Rhydycar West, Landgraaf is half a kilometre long and was built on a former coal mine that was, up until the 1960s, still operating. &#160;Upon closure, it was debated what to do with the 20billion cubic meter mine stone mountain. The answer? Build the world&#8217;s second largest indoor snow centre &#8211; a concept first conceived in 1996.</p>\r\n\r\n<p>Much like Rydycar West, the natural form of the terrain at Landgraaf provided the perfect setting and supporting slope for the immense project. In 2002 SnowWorld opened two slopes for indoor snowsport in perfect conditions 365 days a year. A year later they expanded and introduced a fun park plus a slope measuring 520 metres making them the largest of its kind in the world. In 2012, the ambitious site created a 25,000m<sup>2</sup> outdoor park further adding to its appeal.</p>\r\n\r\n<p>From professional athletes to families looking for adventure, people from all backgrounds with all needs travel from afar to experience Landgraaf&#8217;s exceptional offering. Last year thousands of visitors made their way to its perfect slopes despite there being little other draw in the area (unlike Rhydycar West!). &#160;Proof of its popularity is that visitors are required to book uplift tickets weeks in advance at certain times throughout the year.</p>\r\n\r\n<p>SnowWorld, like numerous other operators, has for many years run a viable, sustainable and profitable business bringing tourists and snowsport enthusiasts to their region alongside providing a facility of great value and benefit to the local residents.&#160;&#160;&#160;</p>\r\n\r\n<p>And, let&#8217;s not forget, all of this was done with much older technology&#160; Our missionfor Rhydycar West is to achieve all this and more, utilising the modern technology we have on hand today, combined withgreener energy to further drive our sustainability.</p>\r\n', '<h2>Landgraaf Snow Centre: A success story</h2>\r\n\r\n<p>Major indoor ski centres are, of course, nothing new across Western Europe, and one of the most successful examples of all time is Netherlands-based SnowWorld Landgraaf.</p>\r\n\r\n<p>Similar to Rhydycar West, Landgraaf is half a kilometre long and was built on a former coal mine that was, up until the 1960s, still operating. &#160;Upon closure, it was debated what to do with the 20billion cubic meter mine stone mountain. The answer? Build the world&#8217;s second largest indoor snow centre &#8211; a concept first conceived in 1996.</p>\r\n\r\n<p>Much like Rydycar West, the natural form of the terrain at Landgraaf provided the perfect setting and supporting slope for the immense project. In 2002 SnowWorld opened two slopes for indoor snowsport in perfect conditions 365 days a year. A year later they expanded and introduced a fun park plus a slope measuring 520 metres making them the largest of its kind in the world. In 2012, the ambitious site created a 25,000m<sup>2</sup> outdoor park further adding to its appeal.</p>\r\n\r\n<p>From professional athletes to families looking for adventure, people from all backgrounds with all needs travel from afar to experience Landgraaf&#8217;s exceptional offering. Last year thousands of visitors made their way to its perfect slopes despite there being little other draw in the area (unlike Rhydycar West!). &#160;Proof of its popularity is that visitors are required to book uplift tickets weeks in advance at certain times throughout the year.</p>\r\n\r\n<p>SnowWorld, like numerous other operators, has for many years run a viable, sustainable and profitable business bringing tourists and snowsport enthusiasts to their region alongside providing a facility of great value and benefit to the local residents.&#160;&#160;&#160;</p>\r\n\r\n<p>And, let&#8217;s not forget, all of this was done with much older technology&#160; Our missionfor Rhydycar West is to achieve all this and more, utilising the modern technology we have on hand today, combined withgreener energy to further drive our sustainability.</p>\r\n', 312),
(328, 856, 'rhydycar-west-is-rich-in-heritage-and-the-site-is-home-to-scheduled-monuments-and-other-historic-assets-of-importance-which-illustrate-the-history-of-the-area-from-the-17th-to-20th-centuries-unfortunately-some-of-these-are-degrading-and-disappearing-w', '<p>Rhydycar West is rich in heritage, and the site is home to scheduled monuments and other historic assets of importance which illustrate the history of the area from the 17th to 20th centuries.</p>\r\n\r\n<p>Unfortunately some of these are degrading and disappearing which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n', '<p>Rhydycar West is rich in heritage, and the site is home to scheduled monuments and other historic assets of importance which illustrate the history of the area from the 17th to 20th centuries.</p>\r\n\r\n<p>Unfortunately some of these are degrading and disappearing which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n', 70),
(336, 722, 'the-upland-areas-of-woodland-in-the-west-of-the-site-support-iconic-western-species-of-bird-such-as-redstart-and-wood-warbler-the-heathy-slopes-reverberate-in-summer-to-the-nocturnal-purring-of-the-nightjar-surveys-have-shown-that-the-site-supp', '<p>The upland areas of woodland in the west of the site support iconic &#8216;western&#8217; species of bird such as redstart and wood warbler. The heathy slopes reverberate in summer to the nocturnal purring of the nightjar.</p>\r\n\r\n<p>Surveys have shown that the site supports several bat species, including the greater horseshoe bat, and the bizarre looking barbastelle. Stream courses are important for them with some species, such as the lesser horseshoe, roosting in the historic structures on the site. All work will be carried out so as not to disrupt these creatures in their home.</p>\r\n', '<p>The upland areas of woodland in the west of the site support iconic &#8216;western&#8217; species of bird such as redstart and wood warbler. The heathy slopes reverberate in summer to the nocturnal purring of the nightjar.</p>\r\n\r\n<p>Surveys have shown that the site supports several bat species, including the greater horseshoe bat, and the bizarre looking barbastelle. Stream courses are important for them with some species, such as the lesser horseshoe, roosting in the historic structures on the site. All work will be carried out so as not to disrupt these creatures in their home.</p>\r\n', 94),
(341, 862, 'current-plan-we-have-been-engaged-in-dialogue-with-stakeholders-and-interested-community-members-for-the-last-several-years-as-development-ideas-have-been-emerging-we-will-be-continuing-to-discuss-and-refine-our-plans-over-the-coming-months-culminatin', '<h2>Current Plan</h2>\r\n\r\n<p>We have been engaged in dialogue with stakeholders and interested community members for the last several years as development ideas have been emerging. We will be continuing to discuss and refine our plans over the coming months, culminating in the submission of a planning application.</p>\r\n', '<h2>Current Plan</h2>\r\n\r\n<p>We have been engaged in dialogue with stakeholders and interested community members for the last several years as development ideas have been emerging. We will be continuing to discuss and refine our plans over the coming months, culminating in the submission of a planning application.</p>\r\n', 47),
(362, 864, 'the-elements-as-an-iconic-sports-and-leisure-destination-complete-with-a-new-neighbourhood-right-next-door-but-only-developing-30-of-the-site-we-have-years-of-opportunity-ahead-of-us-responding-to-other-ideas-and-suggestions-from-you-we-ve-trie', '<h3>The Elements</h3>\r\n\r\n<p>As an iconic sports &#38; leisure destination, complete with a new neighbourhood right next door, but only developing 30% of the site, we have years of opportunity ahead of us, responding to other ideas and suggestions from&#8230;you! We&#8217;ve tried to address a wide range of interests, and we are always open to suggestions as to other things we might include in the future.</p>\r\n', '<h3>The Elements</h3>\r\n\r\n<p>As an iconic sports &#38; leisure destination, complete with a new neighbourhood right next door, but only developing 30% of the site, we have years of opportunity ahead of us, responding to other ideas and suggestions from&#8230;you! We&#8217;ve tried to address a wide range of interests, and we are always open to suggestions as to other things we might include in the future.</p>\r\n', 63),
(430, 865, 'the-current-accommodation-elements-of-the-plan-include-a-spa-hotel-a-sport-hotel-log-cabins-and-glamping-area-a-new-residential-neighbourhood', '<p><strong>The current accommodation elements of the plan include:</strong><br />\r\nA spa hotel<br />\r\nA sport hotel<br />\r\nLog cabins and glamping area<br />\r\nA new residential neighbourhood</p>\r\n', '<p><strong>The current accommodation elements of the plan include:</strong><br />\r\nA spa hotel<br />\r\nA sport hotel<br />\r\nLog cabins and glamping area<br />\r\nA new residential neighbourhood</p>\r\n', 23),
(446, 733, 'homes-a-new-neighbourhood-live-right-next-door-to-a-first-class-sports-and-leisure-destination-yet-still-close-to-town-rhydycar-west-offers-the-best-of-both-worlds-with-residential-housing-located-in-the-beautiful-welsh-countryside-close-to-all-lo', '<h3>Homes</h3>\r\n\r\n<p>A new neighbourhood - live right next door to a first-class sports &#38; leisure destination, yet still close to town. Rhydycar West offers the best of both worlds with residential housing located in the beautiful Welsh countryside close to all local amenities.</p>\r\n', '<h3>Homes</h3>\r\n\r\n<p>A new neighbourhood - live right next door to a first-class sports &#38; leisure destination, yet still close to town. Rhydycar West offers the best of both worlds with residential housing located in the beautiful Welsh countryside close to all local amenities.</p>\r\n', 41),
(417, 877, 'outdoor-fun-great-activities-like-ziplining-mountain-coaster-airpark-or-equestrian-centre-as-well-as-bike-paths-and-nature-trails-to-enjoy', '<h3>Outdoor Fun</h3>\r\n\r\n<p>Great activities like ziplining, mountain coaster, airpark or equestrian centre as well as bike paths and nature trails to enjoy.</p>\r\n', '<h3>Outdoor Fun</h3>\r\n\r\n<p>Great activities like ziplining, mountain coaster, airpark or equestrian centre as well as bike paths and nature trails to enjoy.</p>\r\n', 22),
(450, 847, 'accommodation-there-is-a style of-accommodation-to-suit-every-taste-at-rhydycar-west-a-spa-hotel-complete-with-conference-facilities-a-sport-hotel-to-wind-down-following-a-days- cycling-a-private-lodge-nestled-in-the-forest-or-glamping-by-cand-2', '<h2>Accommodation</h2>\r\n\r\n<p>There is a&#160;style&#160;of accommodation to suit every taste at Rhydycar West.</p>\r\n\r\n<p>A spa hotel complete with conference facilities, a sport hotel to wind down following a days&#8217;&#160;cycling, a private lodge nestled in the forest or glamping by candlelight.&#160;&#160;However you like to spend your day, as evening approaches&#160;you&#160;can relax as you wish at Rhydycar West.&#160;</p>\r\n', '<h2>Accommodation</h2>\r\n\r\n<p>There is a&#160;style&#160;of accommodation to suit every taste at Rhydycar West.</p>\r\n\r\n<p>A spa hotel complete with conference facilities, a sport hotel to wind down following a days&#8217;&#160;cycling, a private lodge nestled in the forest or glamping by candlelight.&#160;&#160;However you like to spend your day, as evening approaches&#160;you&#160;can relax as you wish at Rhydycar West.&#160;</p>\r\n', 55),
(460, 875, 'indoor-snow-centre-we-are-working-with-snowsport-wales-to-create-a-national-centre-of-excellence-for-snowsport-rhydycar-west-would-one-of-the-longest-such-facilities-in-europe-with-challenging-runs-for-professionals-right-down-to-beginner-slopes-for-f-2', '<h2>Indoor Snow Centre</h2>\r\n\r\n<p>We are working with Snowsport Wales to create a national Centre of Excellence for Snowsport. Rhydycar West would one of the longest such facilities in Europe, with challenging runs for professionals, right down to beginner slopes for first timers.</p>\r\n\r\n<p>Producing real snow in a controlled atmosphere means there are perfect conditions 365 days of the&#160;year. And with the inclusion of snow play, tubing, ice climbing and other winter activities, there&#160;is fun for absolutely everyone, anytime.</p>\r\n\r\n<p>This snow centre would be based on similar successful snow centres, particularly those in&#160;<a href=\"http://rhydycarwest.com/elements/continental-europe\" style=\"font-size: 20px; color: red;\">continental Europe.</a></p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h3>Olympic connection?</h3>\r\n\r\n<p>Because Team GB currently train off-season indoors in Europe, it is our goal to help them to meet their ambitious targets for the Olympics in 2030, while remaining at home.</p>\r\n\r\n<p>We also have plans in place to work with local schools and clubs to encourage and inspire our youngsters to experience winter sports, a chance they may never get otherwise. We want the next generation of winter Olympic athletes to hail from Wales.&#160;<a href=\"http://rhydycarwest.com/elements/gb-2030\" style=\"font-size: 20px; color: red;\">GB 2030</a></p>\r\n', '<h2>Indoor Snow Centre</h2>\r\n\r\n<p>We are working with Snowsport Wales to create a national Centre of Excellence for Snowsport. Rhydycar West would one of the longest such facilities in Europe, with challenging runs for professionals, right down to beginner slopes for first timers.</p>\r\n\r\n<p>Producing real snow in a controlled atmosphere means there are perfect conditions 365 days of the&#160;year. And with the inclusion of snow play, tubing, ice climbing and other winter activities, there&#160;is fun for absolutely everyone, anytime.</p>\r\n\r\n<p>This snow centre would be based on similar successful snow centres, particularly those in&#160;<a href=\"http://rhydycarwest.com/elements/continental-europe\" style=\"font-size: 20px; color: red;\">continental Europe.</a></p>\r\n\r\n<p>&#160;</p>\r\n\r\n<h3>Olympic connection?</h3>\r\n\r\n<p>Because Team GB currently train off-season indoors in Europe, it is our goal to help them to meet their ambitious targets for the Olympics in 2030, while remaining at home.</p>\r\n\r\n<p>We also have plans in place to work with local schools and clubs to encourage and inspire our youngsters to experience winter sports, a chance they may never get otherwise. We want the next generation of winter Olympic athletes to hail from Wales.&#160;<a href=\"http://rhydycarwest.com/elements/gb-2030\" style=\"font-size: 20px; color: red;\">GB 2030</a></p>\r\n', 166),
(465, 851, 'indoor-waterpark-rhydycar-west-has-really-splashed-out-with-plans-for-one-of the-largest-indoor-water-parks-in-the-uk-complete-with-an-indoor-surf-simulator-you-can-ride-the-waves-fly-down-flumes-or-paddle-in-the-pool-the-choice-is-yours', '<h2>Indoor Waterpark</h2>\r\n\r\n<p>Rhydycar West has really splashed out with plans for one of&#160;the largest indoor water parks in the UK. Complete with an indoor surf simulator you can ride the waves, fly down flumes, or paddle in the pool. The choice is yours.</p>\r\n', '<h2>Indoor Waterpark</h2>\r\n\r\n<p>Rhydycar West has really splashed out with plans for one of&#160;the largest indoor water parks in the UK. Complete with an indoor surf simulator you can ride the waves, fly down flumes, or paddle in the pool. The choice is yours.</p>\r\n', 43),
(452, 848, 'homes-a-new-neighbourhood-live-right-next-door-to-a-first-class-sports-and-leisure-destination-yet-still-close-to-town-rhydycar-west-offers-the-best-of-both-worlds-with-residential-housing-located-in-the-beautiful-welsh-countryside-close-to-all-lo-2', '<h2>Homes</h2>\r\n\r\n<p>A new neighbourhood - live right next door to a first-class sports &#38; leisure destination, yet still close to town. Rhydycar West offers the best of both worlds with residential housing located in the beautiful Welsh countryside close to all local amenities.</p>\r\n', '<h2>Homes</h2>\r\n\r\n<p>A new neighbourhood - live right next door to a first-class sports &#38; leisure destination, yet still close to town. Rhydycar West offers the best of both worlds with residential housing located in the beautiful Welsh countryside close to all local amenities.</p>\r\n', 41);
