INSERT INTO `sym_entries_data_271` (`id`, `entry_id`, `res_id`, `url`, `url_oembed_xml`, `title`, `thumbnail_url`, `oembed_xml`, `dateCreated`, `driver`) VALUES
(1, 673, '267554980', 'https://player.vimeo.com/video/267554980', 'https://vimeo.com/api/oembed.xml?url=https://player.vimeo.com/video/267554980', 'VICE Film School — From the Brink: Venom Superman', 'https://i.vimeocdn.com/video/700927224_640.jpg', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<oembed><type>video</type><version>1.0</version><provider_name>Vimeo</provider_name><provider_url>https://vimeo.com/</provider_url><title>VICE Film School — From the Brink: Venom Superman</title><author_name>Joseph Melhuish</author_name><author_url>https://vimeo.com/josephmelhuish</author_url><is_plus>0</is_plus><account_type>basic</account_type><html>&lt;iframe src=\"https://player.vimeo.com/video/267554980?app_id=122963\" width=\"640\" height=\"360\" frameborder=\"0\" title=\"VICE Film School &amp;mdash; From the Brink: Venom Superman\" webkitallowfullscreen mozallowfullscreen allowfullscreen&gt;&lt;/iframe&gt;</html><width>640</width><height>360</height><duration>175</duration><description>VICE invited me to make three short films documenting stories from behind the scenes of some of their most notorious documentaries. In Venom Superman Josh Haddow recalls a shoot he produced in which a man injected himself with venom from the world’s most lethal snakes.\n\nCredits\n\nDirector + animation - Joseph Melhuish\nAdditional animation + design - Harry Butt http://butt-studio.com\nProduction - Polly Williams\nSound design - Matt Cheney \nVO - Josh Haddow\nSupervising Producer - Emma Yuille \nMusic Supervisor - Bonnie Reilly</description><thumbnail_url>https://i.vimeocdn.com/video/700927224_640.jpg</thumbnail_url><thumbnail_width>640</thumbnail_width><thumbnail_height>360</thumbnail_height><thumbnail_url_with_play_button>https://i.vimeocdn.com/filter/overlay?src0=https%3A%2F%2Fi.vimeocdn.com%2Fvideo%2F700927224_640.jpg&amp;src1=http%3A%2F%2Ff.vimeocdn.com%2Fp%2Fimages%2Fcrawler_play.png</thumbnail_url_with_play_button><upload_date>2018-05-02 05:20:26</upload_date><video_id>267554980</video_id><uri>/videos/267554980</uri></oembed>\n', '2018-05-22 14:05:42', 'Vimeo');
