INSERT INTO `sym_entries_data_282` (`id`, `entry_id`, `handle`, `value`, `value_formatted`, `word_count`) VALUES
(125, 479, 'much-of-rhydycar-west-has-a-rich-ecology-and-parts-of-the-site-are-noted-in-particular-for-their-waxcap-fungi-marshy-grasslands-and-species-such-as-marsh-fritillary-butterfly', '<p>Much of Rhydycar West has a rich ecology, and parts of the site are noted in particular for their waxcap fungi, marshy grasslands and species such as marsh fritillary butterfly.</p>\r\n', '<p>Much of Rhydycar West has a rich ecology, and parts of the site are noted in particular for their waxcap fungi, marshy grasslands and species such as marsh fritillary butterfly.</p>\r\n', 30),
(103, 475, 'the-likelihood-is-that-the-area-was-settled-from-at-least-the-bronze-age-with-memorial-monuments spread-across-the-elevated-ground-around-merthyr-tydfil', '<p>The likelihood is that the area was settled from at least the Bronze Age, with memorial monuments&#160;spread across the elevated ground around Merthyr Tydfil.</p>\r\n', '<p>The likelihood is that the area was settled from at least the Bronze Age, with memorial monuments&#160;spread across the elevated ground around Merthyr Tydfil.</p>\r\n', 24),
(162, 485, 'developing-ideas-for-a-new-era-on-the-land', '<p>Developing ideas for a new era on the land.</p>\r\n', '<p>Developing ideas for a new era on the land.</p>\r\n', 9),
(97, 750, 'a-settlement-is-recorded-in-methyr-in-the-middle-ages-but-it-had-most-probably-declined-and-been-abandoned-by-the-17th-century-when-the-area-is-recorded-as-only-containing-shepherds', '<p>A settlement is recorded in Methyr in the Middle Ages, but it had most probably declined and been abandoned by the 17th century, when the area is recorded as only containing shepherds.</p>\r\n', '<p>A settlement is recorded in Methyr in the Middle Ages, but it had most probably declined and been abandoned by the 17th century, when the area is recorded as only containing shepherds.</p>\r\n', 32),
(132, 486, 'once-completed-rhydycar-west-is-set-to-be-the-ultimate-destination-for-sports-enthusiasts-adventurers-couples-families-and-individuals', '<p>Once completed, Rhydycar West is set to be the ultimate destination for sports enthusiasts, adventurers, couples, families, and individuals.</p>\r\n', '<p>Once completed, Rhydycar West is set to be the ultimate destination for sports enthusiasts, adventurers, couples, families, and individuals.</p>\r\n', 19),
(160, 835, 'pump-tracks-jump-lines-and-half-pipes-galore-at-the-uk-and-39-s-biggest-indoor-skate-and-bike-park', '<p>Pump tracks, jump lines and half pipes galore at the Uk&#39;s biggest indoor skate and bike park.</p>\r\n', '<p>Pump tracks, jump lines and half pipes galore at the Uk&#39;s biggest indoor skate and bike park.</p>\r\n', 18),
(146, 836, 'great-activities-like-ziplining-mountain-coaster-airpark-or-equestrian-centre-as-well-as-bike-paths-and-nature-trails-to-enjoy', '<p>Great activities like ziplining, mountain coaster, airpark or equestrian centre as well as bike paths and nature trails to enjoy.</p>\r\n', '<p>Great activities like ziplining, mountain coaster, airpark or equestrian centre as well as bike paths and nature trails to enjoy.</p>\r\n', 20),
(163, 837, 'places-to-stay-hotels-and-spa-luxury-and-family-destinations-log-cabins-nestled-in-nature-glamping-and-yurts-camping-in-comfort', '<p>Places to stay: Hotels and Spa - luxury and family destinations, log cabins - nestled in nature, glamping &#38; yurts - camping in comfort.</p>\r\n', '<p>Places to stay: Hotels and Spa - luxury and family destinations, log cabins - nestled in nature, glamping &#38; yurts - camping in comfort.</p>\r\n', 20),
(140, 838, 'a-huge-indoor-waterpark-and-adventure-centre-including-surf-simulator-and-water-sports-for-everyone-to-enjoy', '<p>A huge indoor waterpark and adventure centre including surf simulator and water sports for everyone to enjoy.</p>\r\n', '<p>A huge indoor waterpark and adventure centre including surf simulator and water sports for everyone to enjoy.</p>\r\n', 17),
(142, 839, 'a-new-place-to-live-homes-placed -in-beautiful-setting-close-to-town-the-retail-park-and-a-stone-and-39-s-throw-from-the-exciting-new-sports-and-leisure-destination', '<p>A new place to live - homes placed&#160; in beautiful setting, close to town, the retail park, and a stone&#39;s throw from the exciting new sports &#38; leisure destination.</p>\r\n', '<p>A new place to live - homes placed&#160; in beautiful setting, close to town, the retail park, and a stone&#39;s throw from the exciting new sports &#38; leisure destination.</p>\r\n', 28),
(164, 840, 'the-slope-will-be-over-500-meters-long-dwarfing-all-other-uk-centres-beginners-and-future-sports-champions-can-learn-alongside professionals-in-a-facility-modelled-after-successful-indoor-centres-in-europe', '<p>The slope will be over 500 meters long, dwarfing all other UK centres. Beginners and future sports champions can learn alongside&#160;professionals in a facility modelled after successful indoor centres in Europe.</p>\r\n', '<p>The slope will be over 500 meters long, dwarfing all other UK centres. Beginners and future sports champions can learn alongside&#160;professionals in a facility modelled after successful indoor centres in Europe.</p>\r\n', 30),
(114, 748, 'the-romans-did-not-leave-their-mark-on-the-site-but-there was-certainly-a-roman-military-presence-in-the-area probably-focused-on-the-fort-at-pen-y-darren-on-the-south-east side-of-merthyr', '<p>The Romans did not leave their mark on the site but there&#160;was certainly a Roman military presence in the area,&#160;probably focused on the fort at Pen-y-Darren (on the south-east&#160;side of Merthyr).</p>\r\n', '<p>The Romans did not leave their mark on the site but there&#160;was certainly a Roman military presence in the area,&#160;probably focused on the fort at Pen-y-Darren (on the south-east&#160;side of Merthyr).</p>\r\n', 31),
(127, 484, 'the-evidence-of-rhydycar-west-s-rich-history-is-found-across-the-site-today-from-bridges-to-industrial-chimneys-and-the-cwm-glo-chapel', '<p>The evidence of Rhydycar West&#8217;s rich history is found across the site today from bridges to industrial chimneys and the Cwm Glo Chapel.</p>\r\n', '<p>The evidence of Rhydycar West&#8217;s rich history is found across the site today from bridges to industrial chimneys and the Cwm Glo Chapel.</p>\r\n', 23),
(165, 752, 'a-feature-of-the-pre-industrial-landscape-in-the-area-is-an-historical-association-with-early-non-conformist-christianity-best-exemplified-by-the-remains-of-cwm-glo-chapel-found-on-the-site', '<p>A feature of the pre-industrial landscape in the area is an historical association with early non-conformist Christianity, best exemplified by the remains of Cwm Glo Chapel found on the site.</p>\r\n', '<p>A feature of the pre-industrial landscape in the area is an historical association with early non-conformist Christianity, best exemplified by the remains of Cwm Glo Chapel found on the site.</p>\r\n', 30),
(166, 478, 'the-18th-and-19th-centuries-represent-a-period-of-intense-industrial-activity-in-and-around-merthyr-and-it-was-the-coal-from-this-site-that-fueled-that-industry', '<p>The 18th and 19th centuries represent a period of intense industrial activity in and around Merthyr, and it was the coal from this site that fueled that industry.</p>\r\n', '<p>The 18th and 19th centuries represent a period of intense industrial activity in and around Merthyr, and it was the coal from this site that fueled that industry.</p>\r\n', 28);
