(3, 490, 'sed-lacinia-magna-massa-convallis-efficitur-arcu-porta-id-curabitur-lacus-nunc-placerat-ac-nibh-in-euismod-consectetur-leo-praesent-tincidunt-ligula-arcu-vestibulum-ullamcorper-sed-metus-ac-tristique-nulla-facilisi-etiam-tincidunt-nisl-ut-urna-portti', '<p>Sed lacinia magna massa, convallis efficitur arcu porta id. Curabitur lacus nunc, placerat ac nibh in, euismod consectetur leo. Praesent tincidunt ligula arcu. Vestibulum ullamcorper sed metus ac tristique. Nulla facilisi. Etiam tincidunt nisl ut urna porttitor ultricies. Pellentesque tincidunt enim at lacinia consectetur. Vestibulum euismod in arcu ut lobortis.</p>\r\n', '<p>Sed lacinia magna massa, convallis efficitur arcu porta id. Curabitur lacus nunc, placerat ac nibh in, euismod consectetur leo. Praesent tincidunt ligula arcu. Vestibulum ullamcorper sed metus ac tristique. Nulla facilisi. Etiam tincidunt nisl ut urna porttitor ultricies. Pellentesque tincidunt enim at lacinia consectetur. Vestibulum euismod in arcu ut lobortis.</p>\r\n', 50),
(18, 746, 'the-site-in-prehistory-evidence-to-show-the-history-of-the-site-and-its-surroundings-is-sparse-and-8211-in-part-because-of-the-lack-of-systematic-archaeological-investigation-and-also-because-of-and-8216-poor-visibility-and-8217-due-to-the-inten', '<h3>The Site in Prehistory</h3>\r\n\r\n<p>Evidence to show the history of the site and its surroundings is sparse &#8211; in part because of the lack of systematic archaeological investigation and also because of &#8216;poor visibility&#8217; due to the intense industrial activity around Merthyr in the 18th &#38; 19th centuries.</p>\r\n\r\n<p>The likelihood is that the area was settled - to some degree - from at least the Bronze Age, with memorial monuments such as round gravestones spread across the elevated ground around Merthyr Tydfil.</p>\r\n\r\n<p>The area most likely comprised a mixture of agricultural fields, woodland in the delves and stream valleys and moorland or heath on the high ground between the principal river valleys.</p>\r\n\r\n<p>This would only have changed slightly moving into the Iron Age, where the nearest recorded evidence for a human presence is more than a kilometre away, where the remains of a hut settlement have previously been identified on the western slopes of Mynydd, Aberdare.</p>\r\n\r\n<p>The site and its surroundings are rich in minerals, with iron ore especially appearing close to the surface in the stream valleys. It is possible that these accessible natural resources could have proved attractive to settlement in the Iron Age, but any evidence will have been concealed or destroyed by subsequent exploitation of the same deposits in more recent times.</p>\r\n', '<h3>The Site in Prehistory</h3>\r\n\r\n<p>Evidence to show the history of the site and its surroundings is sparse &#8211; in part because of the lack of systematic archaeological investigation and also because of &#8216;poor visibility&#8217; due to the intense industrial activity around Merthyr in the 18th &#38; 19th centuries.</p>\r\n\r\n<p>The likelihood is that the area was settled - to some degree - from at least the Bronze Age, with memorial monuments such as round gravestones spread across the elevated ground around Merthyr Tydfil.</p>\r\n\r\n<p>The area most likely comprised a mixture of agricultural fields, woodland in the delves and stream valleys and moorland or heath on the high ground between the principal river valleys.</p>\r\n\r\n<p>This would only have changed slightly moving into the Iron Age, where the nearest recorded evidence for a human presence is more than a kilometre away, where the remains of a hut settlement have previously been identified on the western slopes of Mynydd, Aberdare.</p>\r\n\r\n<p>The site and its surroundings are rich in minerals, with iron ore especially appearing close to the surface in the stream valleys. It is possible that these accessible natural resources could have proved attractive to settlement in the Iron Age, but any evidence will have been concealed or destroyed by subsequent exploitation of the same deposits in more recent times.</p>\r\n', 212),
(5, 747, 'the-roman-occupation-the-romans-did-not-leave-their-mark-on-the-site-but-this-may-in-part-reflect-the-intensity-of-later-activity-between-the-17th-and-20th-centuries-which-was-focused-on-the-exploitation-and-transportation-of-the-area-and-8217-s-signi', '<h3>The Roman Occupation</h3>\r\n\r\n<p>The Romans did not leave their mark on the site, but this may in part reflect the intensity of later activity between the 17th and 20th centuries which was focused on the exploitation and transportation of the area&#8217;s significant mineral wealth.</p>\r\n\r\n<p>There was certainly a Roman military presence in the area, and the mineral resources located close to the surface would no doubt have been attractive in the same way that they were elsewhere in Wales.</p>\r\n\r\n<p>Roman activity was probably focused on the fort at Pen-y-Darren (on the SE side of Merthyr), which was connected to the wider arrangement of similar forts in south and mid Wales by the network of roads engineered and built by the army.</p>\r\n', '<h3>The Roman Occupation</h3>\r\n\r\n<p>The Romans did not leave their mark on the site, but this may in part reflect the intensity of later activity between the 17th and 20th centuries which was focused on the exploitation and transportation of the area&#8217;s significant mineral wealth.</p>\r\n\r\n<p>There was certainly a Roman military presence in the area, and the mineral resources located close to the surface would no doubt have been attractive in the same way that they were elsewhere in Wales.</p>\r\n\r\n<p>Roman activity was probably focused on the fort at Pen-y-Darren (on the SE side of Merthyr), which was connected to the wider arrangement of similar forts in south and mid Wales by the network of roads engineered and built by the army.</p>\r\n', 121),
(6, 749, 'the-middle-ages-a-settlement-is-recorded-in-methyr-in-the-middle-ages-but-little-is-known-about-its-form-and-function-it-had-most-probably-declined-and-been-abandoned-by-the-17th-century-when-the-area-is-recorded-as-only-containing-shepherds-the-l', '<h3>The Middle Ages</h3>\r\n\r\n<p>A settlement is recorded in Methyr in the Middle Ages, but little is known about its form and function. It had most probably declined and been abandoned by the 17th century, when the area is recorded as only containing shepherds.</p>\r\n\r\n<p>The likelihood is that medieval Merthyr grew up around a crossing point on the River Taff, but there is no evidence it was anything more substantial than a village. Its economy was probably based around agricultural and some passing commerce.</p>\r\n\r\n<p>The only recorded evidence for the appearance of the site in the Middle Ages refers to a large meadow alongside the Nant Cwm Glo, which suggests at least some animal grazing on the slopes of the Taff Valley.</p>\r\n\r\n<p>Some of the farmsteads recorded at and around the site on 19th century maps may have medieval origins, but more certain evidence for medieval agricultural can be drawn from the patchwork of irregularly shaped enclosures which still survive.&#160;</p>\r\n', '<h3>The Middle Ages</h3>\r\n\r\n<p>A settlement is recorded in Methyr in the Middle Ages, but little is known about its form and function. It had most probably declined and been abandoned by the 17th century, when the area is recorded as only containing shepherds.</p>\r\n\r\n<p>The likelihood is that medieval Merthyr grew up around a crossing point on the River Taff, but there is no evidence it was anything more substantial than a village. Its economy was probably based around agricultural and some passing commerce.</p>\r\n\r\n<p>The only recorded evidence for the appearance of the site in the Middle Ages refers to a large meadow alongside the Nant Cwm Glo, which suggests at least some animal grazing on the slopes of the Taff Valley.</p>\r\n\r\n<p>Some of the farmsteads recorded at and around the site on 19th century maps may have medieval origins, but more certain evidence for medieval agricultural can be drawn from the patchwork of irregularly shaped enclosures which still survive.&#160;</p>\r\n', 159),
(43, 751, 'the-age-of-dissent-the-landscape-of-densely-wooded-delves-and-secluded-stream-valleys-which-still-makes-movement-challenging-today-would-have-been-attractive-for-non-conformists-looking-to-hold-meetings-out-of-the-way-of-prying-eyes-and-the-reach-of-th', '<h3>The Age of Dissent</h3>\r\n\r\n<p>The landscape of densely wooded delves and secluded stream valleys, which still makes movement challenging today, would have been attractive for non-conformists looking to hold meetings out of the way of prying eyes and the reach of the authorities.</p>\r\n\r\n<p>This association with non-conformity is best exemplified by the remains of Cwm Glo Chapel which is found on the site at Rhydycar West.&#160; It is now designated as a scheduled monument because of the national importance of its standing fabric and archaeological remains.</p>\r\n\r\n<p>However, other historic farmsteads, such as Cwm Glo and Blaen-canaid also have important historical associations with these groups because they provided meeting places in the early days.</p>\r\n\r\n<p>This was a period of rapid change around Methyr &#8211; as well as across the country; with the agricultural landscape being increasingly opened up and exploited for small scale mineral extraction from the 17th century onwards.</p>\r\n\r\n<p>This growing industrialisation transformed the landscape within the site; the farmstead at Pen-y-Coedcae became mine workers&#8217; accommodation, while the farm at Cwm Du eventually disappeared altogether beneath a spoil heap.&#160;</p>\r\n', '<h3>The Age of Dissent</h3>\r\n\r\n<p>The landscape of densely wooded delves and secluded stream valleys, which still makes movement challenging today, would have been attractive for non-conformists looking to hold meetings out of the way of prying eyes and the reach of the authorities.</p>\r\n\r\n<p>This association with non-conformity is best exemplified by the remains of Cwm Glo Chapel which is found on the site at Rhydycar West.&#160; It is now designated as a scheduled monument because of the national importance of its standing fabric and archaeological remains.</p>\r\n\r\n<p>However, other historic farmsteads, such as Cwm Glo and Blaen-canaid also have important historical associations with these groups because they provided meeting places in the early days.</p>\r\n\r\n<p>This was a period of rapid change around Methyr &#8211; as well as across the country; with the agricultural landscape being increasingly opened up and exploited for small scale mineral extraction from the 17th century onwards.</p>\r\n\r\n<p>This growing industrialisation transformed the landscape within the site; the farmstead at Pen-y-Coedcae became mine workers&#8217; accommodation, while the farm at Cwm Du eventually disappeared altogether beneath a spoil heap.&#160;</p>\r\n', 178),
(41, 754, 'we-have-conducted-extensive-specialist-ecological-surveys-in-order-to-understand-in-detail-its-flora-and-fauna-understanding-the-ecology-of-the-site-is-a-critical-first-step-to-designing-a-development-which-is-sensitive-where-built-components-are-sited-c', '<p>We have conducted extensive specialist ecological surveys in order to understand in detail its flora and fauna. Understanding the ecology of the site is a critical first step to designing a development which is sensitive, where built components are sited carefully, and where vast areas of high ecological value are identified to remain untouched.</p>\r\n', '<p>We have conducted extensive specialist ecological surveys in order to understand in detail its flora and fauna. Understanding the ecology of the site is a critical first step to designing a development which is sensitive, where built components are sited carefully, and where vast areas of high ecological value are identified to remain untouched.</p>\r\n', 54),
(30, 755, 'rhydycar-west-is-rich-in-heritage-and-the-site-is-home-to-scheduled-monuments-and-other-historic-assets-of-importance-which-illustrate-the-history-of-the-area-from-the-17th-to-20th-centuries-unfortunately-some-of-these-are-degrading-and-disappearing-w', '<p>Rhydycar West is rich in heritage, and the site is home to scheduled monuments and other historic assets of importance which illustrate the history of the area from the 17th to 20th centuries.</p>\r\n\r\n<p>Unfortunately some of these are degrading and disappearing which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n', '<p>Rhydycar West is rich in heritage, and the site is home to scheduled monuments and other historic assets of importance which illustrate the history of the area from the 17th to 20th centuries.</p>\r\n\r\n<p>Unfortunately some of these are degrading and disappearing which is why a focus of our development is to ensure that key ancient monuments are brought back to life and protected for the enjoyment of generations to come.</p>\r\n', 70),
(15, 756, 'the-plan-is-for-our-land-to-become-the-focus-for-a-combination-of-experiences-that-will-create-an-exciting-tourism-leisure-and-international-sporting-destination-right-here-in-one-of-our-south-wales-valleys-the-developments-will-embrace-and-be-created-ar', '<p>The plan is for our land to become the focus for a combination of experiences that will create an exciting tourism, leisure and international sporting destination, right here in one of our south Wales valleys. The developments will embrace and be created around the natural beauty and heritage of our area &#8211; to revitalise our history and to create new heritage for our future.</p>\r\n', '<p>The plan is for our land to become the focus for a combination of experiences that will create an exciting tourism, leisure and international sporting destination, right here in one of our south Wales valleys. The developments will embrace and be created around the natural beauty and heritage of our area &#8211; to revitalise our history and to create new heritage for our future.</p>\r\n', 63),
(44, 753, 'the-industrial-revolution-the-18th-and-19th-centuries-represent-a-period-of-intense-industrial-activity-in-and-around-merthyr-the-manufacture-of-iron-products-from-the-rich-resources-of-timber-coal-and-iron-ore-transformed-this-small-village-into-the', '<h3>The Industrial Revolution</h3>\r\n\r\n<p>The 18th and 19th centuries represent a period of intense industrial activity in and around Merthyr. The manufacture of iron products from the rich resources of timber, coal and iron ore transformed this small village into the largest town in Wales. Much&#160;of that coal came from our site at Rhydycar West.</p>\r\n\r\n<p>The Cyfarthfa Ironworks (opened in 1766) is perhaps the most famous of the early iron producers of Methyr, but it was not the only one; Dowlais, Plymouth and Penydarren were also significant players in this early industry.</p>\r\n\r\n<p>William Crawshay&#8217;s ironworks drew mineral resources from a wide area, requiring the construction of a canal from the Nant Canaid valley up the west side of the Taff Valley to feed the blast furnaces with coal and iron ore from the Cyfarthfa Estate at and around the site.</p>\r\n\r\n<p>Even today, the site illustrates the development of mining technology which would make Methyr one of the most important towns of the industrial revolution.</p>\r\n\r\n<p>Early mining was based on surface scouring and patching for shallow deposits; but as those were worked out a system of horizontally driven shafts (or &#8216;levels&#8217;) were excavated into the hillsides to exploit more deeply buried mineral ores and coal seams.</p>\r\n\r\n<p>The increasing need to access deeper and deeper coal seams in the 19th century saw a transition to vertically dug shafts, with water power used to lower miners down to the workings and to lift coal to the surface.</p>\r\n\r\n<p>This period also witnessed the development of an extensive network of inclines and tramways to transport mineral resources and connect into the railway system. By 1841, this linked Merthyr with Cardiff and the rest of the world via the increasingly large complex of docks and basins being developed by the Marquis of Bute.</p>\r\n\r\n<p>The area&#8217;s industrial exploitation reached its peak in the late 19th century, when seven deep pits were in operation at the site; Black Pins, Cwm Du, Cwm Glo, Coed Cae, Glyn-Dyrys, Cwm and Lower Colliers Row.</p>\r\n\r\n<p>Cyfarthfa Ironworks closed in 1910 (although it re-opened briefly during World War One), and coal mining at and around the site declined rapidly from the 1920s onwards.</p>\r\n', '<h3>The Industrial Revolution</h3>\r\n\r\n<p>The 18th and 19th centuries represent a period of intense industrial activity in and around Merthyr. The manufacture of iron products from the rich resources of timber, coal and iron ore transformed this small village into the largest town in Wales. Much&#160;of that coal came from our site at Rhydycar West.</p>\r\n\r\n<p>The Cyfarthfa Ironworks (opened in 1766) is perhaps the most famous of the early iron producers of Methyr, but it was not the only one; Dowlais, Plymouth and Penydarren were also significant players in this early industry.</p>\r\n\r\n<p>William Crawshay&#8217;s ironworks drew mineral resources from a wide area, requiring the construction of a canal from the Nant Canaid valley up the west side of the Taff Valley to feed the blast furnaces with coal and iron ore from the Cyfarthfa Estate at and around the site.</p>\r\n\r\n<p>Even today, the site illustrates the development of mining technology which would make Methyr one of the most important towns of the industrial revolution.</p>\r\n\r\n<p>Early mining was based on surface scouring and patching for shallow deposits; but as those were worked out a system of horizontally driven shafts (or &#8216;levels&#8217;) were excavated into the hillsides to exploit more deeply buried mineral ores and coal seams.</p>\r\n\r\n<p>The increasing need to access deeper and deeper coal seams in the 19th century saw a transition to vertically dug shafts, with water power used to lower miners down to the workings and to lift coal to the surface.</p>\r\n\r\n<p>This period also witnessed the development of an extensive network of inclines and tramways to transport mineral resources and connect into the railway system. By 1841, this linked Merthyr with Cardiff and the rest of the world via the increasingly large complex of docks and basins being developed by the Marquis of Bute.</p>\r\n\r\n<p>The area&#8217;s industrial exploitation reached its peak in the late 19th century, when seven deep pits were in operation at the site; Black Pins, Cwm Du, Cwm Glo, Coed Cae, Glyn-Dyrys, Cwm and Lower Colliers Row.</p>\r\n\r\n<p>Cyfarthfa Ironworks closed in 1910 (although it re-opened briefly during World War One), and coal mining at and around the site declined rapidly from the 1920s onwards.</p>\r\n', 356),
(40, 860, 'we-acquired-the-site-in-2013-and-made-a-significant-investment-of-time-and-resources-to-investigate-and-understand-the-nature-diversity-and-significance-of-the-historic-environment-within-the-site- consulting-with-a-range-of-experts-and-key-stakeholders', '<p>We acquired the site in 2013 and made a significant investment of time and resources to investigate and understand the nature, diversity and significance of the historic environment within the site, &#160;consulting with a range of experts and key stakeholders to identify and address issues and opportunities.</p>\r\n\r\n<p>We also recognize the overarching local, regional and national priorities for economic development and community health for South Wales and we are looking forward to working with the various stakeholders to regenerate the site.</p>\r\n', '<p>We acquired the site in 2013 and made a significant investment of time and resources to investigate and understand the nature, diversity and significance of the historic environment within the site, &#160;consulting with a range of experts and key stakeholders to identify and address issues and opportunities.</p>\r\n\r\n<p>We also recognize the overarching local, regional and national priorities for economic development and community health for South Wales and we are looking forward to working with the various stakeholders to regenerate the site.</p>\r\n', 80);
