(4, 480, '265034220', 'https://vimeo.com/265034220', 'https://vimeo.com/api/oembed.xml?url=https://vimeo.com/265034220', 'Debbie Boon - Fine Artist', 'https://i.vimeocdn.com/video/696264708_640.jpg', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<oembed><type>video</type><version>1.0</version><provider_name>Vimeo</provider_name><provider_url>https://vimeo.com/</provider_url><title>Debbie Boon - Fine Artist</title><author_name>Heist Films</author_name><author_url>https://vimeo.com/weareheist</author_url><is_plus>0</is_plus><account_type>pro</account_type><html>&lt;iframe src=\"https://player.vimeo.com/video/265034220?app_id=122963\" width=\"640\" height=\"360\" frameborder=\"0\" title=\"Debbie Boon - Fine Artist\" webkitallowfullscreen mozallowfullscreen allowfullscreen&gt;&lt;/iframe&gt;</html><width>640</width><height>360</height><duration>194</duration><description>Debbie Boon is a contemporary artist whose work is characterized by an energy and vivacity which reflects the joie de vivre she feels when faced with a subject that captures her imagination. \n\nWorking in partnership with Debbie and The Norfolk Wildlife Trust we told the story of what inspires her as an artist and how she captures the spirit of her subjects.</description><thumbnail_url>https://i.vimeocdn.com/video/696264708_640.jpg</thumbnail_url><thumbnail_width>640</thumbnail_width><thumbnail_height>360</thumbnail_height><thumbnail_url_with_play_button>https://i.vimeocdn.com/filter/overlay?src0=https%3A%2F%2Fi.vimeocdn.com%2Fvideo%2F696264708_640.jpg&amp;src1=http%3A%2F%2Ff.vimeocdn.com%2Fp%2Fimages%2Fcrawler_play.png</thumbnail_url_with_play_button><upload_date>2018-04-16 14:07:35</upload_date><video_id>265034220</video_id><uri>/videos/265034220</uri></oembed>\n', '2018-05-04 11:19:17', 'Vimeo');
