INSERT INTO `sym_entries_data_394` (`id`, `entry_id`, `handle`, `value`, `value_formatted`, `word_count`) VALUES
(25, 674, 'a-new-sports-and-leisure-destination-and-neighbourhood-in-the-valleys-between-cardiff-and-the-brecon-beacons-lie-575-acres-of-history-known-as-rhydycar-west-the-area-at-its-height-was-one-of-the-largest-mining-operations-in-wales-since-the-mid-20t', '<h2>A new sports &#38; leisure destination and neighbourhood.</h2>\r\n\r\n<p>In the valleys, between Cardiff and the Brecon Beacons, lie 575 acres of history, known as Rhydycar West. The area at its height was one of the largest mining operations in Wales. Since the mid-20th century, the land has remained untouched and there are emerging plans to restore and protect the long-forgotten land and create a sustainable economic base and future legacy for the South Wales Valleys.</p>\r\n\r\n<p>We came to own the land a number of years ago, and since then we have taken time and care to understand the nature of the site and the direction and ambitions of the local area.&#160;</p>\r\n\r\n<p>Speaking with regional and national stakeholders as well as the local community, we have come up with some ideas for the land.&#160;Please let us know what you think.</p>\r\n\r\n<p><a class=\"homepage-block-cta\" href=\"http://rhydycarwest.com/get-in-touch\">Click here to give us some feedback</a>.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<div class=\"videoWrapper\" style=\"position: relative; padding-bottom: 56.25%; padding-top: 25px;	height: 0;\"><iframe allowfullscreen=\"allowfullscreen\" frameborder=\"0\" height=\"360\" src=\"https://player.vimeo.com/video/293897352\" style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" width=\"640\"></iframe></div>\r\n\r\n<p>&#160;</p>\r\n', '<h2>A new sports &#38; leisure destination and neighbourhood.</h2>\r\n\r\n<p>In the valleys, between Cardiff and the Brecon Beacons, lie 575 acres of history, known as Rhydycar West. The area at its height was one of the largest mining operations in Wales. Since the mid-20th century, the land has remained untouched and there are emerging plans to restore and protect the long-forgotten land and create a sustainable economic base and future legacy for the South Wales Valleys.</p>\r\n\r\n<p>We came to own the land a number of years ago, and since then we have taken time and care to understand the nature of the site and the direction and ambitions of the local area.&#160;</p>\r\n\r\n<p>Speaking with regional and national stakeholders as well as the local community, we have come up with some ideas for the land.&#160;Please let us know what you think.</p>\r\n\r\n<p><a class=\"homepage-block-cta\" href=\"http://rhydycarwest.com/get-in-touch\">Click here to give us some feedback</a>.</p>\r\n\r\n<p>&#160;</p>\r\n\r\n<div class=\"videoWrapper\" style=\"position: relative; padding-bottom: 56.25%; padding-top: 25px;	height: 0;\"><iframe allowfullscreen=\"allowfullscreen\" frameborder=\"0\" height=\"360\" src=\"https://player.vimeo.com/video/293897352\" style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" width=\"640\"></iframe></div>\r\n\r\n<p>&#160;</p>\r\n', 145);
