INSERT INTO `sym_entries_data_438` (`id`, `entry_id`, `value`, `value_formatted`) VALUES
(39, 891, 'Test test ', NULL),
(38, 892, 'This looks really interesting, I wonder who developed the branding it\'s awesome!!!!', NULL),
(16, 898, 'Just a test \"Get in touch\" to see that it is working.\r\n\r\nPlease email back TEST OK', NULL),
(15, 901, 'Hi \r\nPlease can you let me know when the product launch is as I have been sent an invitation and they have two dates on the one Friday 29th between 5-7 and the other Saturday 30th between 10-3 \r\nI have responded on your website which is the day that I have registered for please \r\nKind regards\r\nAmanda ', NULL),
(41, 902, 'Many thanks for your kind invitation to the event on Friday 29th June, 2018 , unfortunately the Leader, Councillor David Poole   has a prior commitment on that date and is unable to attend.  Please pass on his sincere apologies to everyone concerned.\r\n\r\n', NULL),
(14, 911, 'Good morning,\r\nUnfortunately I am unable to attend the any of the meetings you have set up for a discussion on the Rhydycar West project and therefore I am wondering if I could seek information please? I just wish to hear what the current plans are? If a start date is in mind? Has the scheme been confirmed/granted yet or are there issue preventing this? If or when this project is confirmed, when will you be making the plans public? \r\n\r\nI am thrilled with the ideas you have to expand Merthyr Tydfil\'s attractions and restoration on the heritage site. The activities you have in mind have been what Merthyr has cried out for for decades. Not only is the job and employment for the locals a great future opportunity some have longed for, but the area has never had a lot to offer in terms of fun and energetic activities for child and adults of all ages. \r\nBesides our incredible landscape which has seen an increase in interest walking, there has never been many other outdoor activates due to our often wet and cold weather so the fact you plan to make everything indoors I believe will be a great success. Already the Bike Park Wales, has been extremely successful and the local interest in bike riding has boomed. With the lush landscape surrounding Rhydycar West which links with Gawrnant, Ponsticill, Talybont and the incredible Brecon Beacons National Park that has also seen a boom in hikers, it makes it an exceptional area for joining on the sport theme. The Cyfarthfa Castle in Merthyr Tydfil I believe has also been granted a scheme to expand their heritage attraction and landscape which goes brilliantly hand in hand with what the Rhydycar project could produce.  I don\'t think a more more Perfect place in the whole of the UK could also be picked due to not also its central location between Swansea and Cardiff cities but also it\'s overall central location through throughout other UK cities. Especially since anyone wishing to try snowboarding in the UK have to travel to Manchester. - A long run for those living in the far south which in return deceases in their interest. \r\nI truly hope that the whole of the Marvel project is granted and begins soon in Rhydycar West. It will be the best opportunity to happen to the town since the Iron and Coal industry. \r\n\r\nSo please, could you send me any information on what you will be presenting in the meeting in Merthyr Tydfil Red House on the 30th June. I am truly disappointed I will not be able to attend and hear the information you will be discussing. \r\n\r\n\r\nHope I hear from you soon\r\nMany thanks\r\n', NULL),
(18, 931, 'Ex Groundwork M & RCT employee. Late spring cleaning of house has revealed details of the site including original pamphlets re: Coal in the Forest, Farms in the Forest, maps, historical date, results of pond surveys [9 ponds] etc. Are they of any interest?', NULL),
(60, 970, 'It\'s a great idea but make sure it\'s cost effective for the locals to use it don\'t forget most people are unemployed so keep the costs of using the site low this will always bring in customers from the area and outside the area. ', NULL),
(57, 971, 'I assume that there will be no open cast mining in the area before you start work ', NULL),
(55, 972, 'Where are the proposed hotel, chalets and homes being built? \r\nWhat other developments will be built on or near the football pitch/countryside that backs onto the residents at the Redrow site at Heolgerrig called Parc Cwm Pant Bach? \r\nif you are considering repairing/updating the historic chapel which is very near our site. What affect will that have on us e.g. New walk ways, trails etc?', NULL),
(54, 973, 'You want to rip thousand of trees down, take homes of all wildlife, take away all the fields where horses live and demolish everything.l for your stupid ideas when there is loads of land up dowlais they just stripped coal from where you could put it all I hope your idea is a flop and you lose more money than you make.\r\nAbsolutely disgusting demolishing the countryside.\r\nAll them trees and animals. All you care about is money. ', NULL),
(44, 974, 'Why has the people of Ynysfach not had any information on this, this affects them too.\r\nI live right by this and I see all the mountains and trees through my window so this affects the people of ynysfach.\r\nWhy would I choose a house by the countryside only for you to take it away? ', NULL),
(43, 975, 'How can you talk about the heritage, show pictures of things to do with mining and givin a discription if it’s history but then want to build an indoor water park by it? \r\nDoesn’t really make sense.\r\nIf it was like gawrnant and you were trying to bring tourists to see the history of ironworks then I’d be all for it but you’re just ruining our heritage by building a spa and indoor water park on it', NULL),
(48, 976, 'I have to say, am a little disappointed by the launch of RW. The tone is seriously patronising to the local community. It\'s generic with an invasive tone. Am not sure who it speak too. Non-engaging. Yet another failed attempt to cash in on our heritage. given what went on before, this has seriously got off on the wrong foot.', NULL),
(47, 977, 'I have to say, am a little disappointed by the launch of RW. The tone is seriously patronising to the local community. It\'s generic with an invasive sound. Am not sure who it speak too. Non-engaging. Another failed attempt to cash in on our heritage. Given what went on before, this has seriously got off on the wrong foot.', NULL),
(49, 978, 'Can’t make any meeting as there have been no brochure posted through my door or in my area therefore I didn’t know about this until I seen it on Facebook.\r\nHoping you’ll respect the countryside and not ruin it or the history that is there.\r\nHow many trees are going to be cut down? \r\nWhat will happen to the wildlife? \r\nWhat about the fields that have horses? \r\nWhere is this sport leisure, glamping and spa going to be by?\r\nI don’t think it’s a good idea having those things by the ironworks history when there is huge land on the mountains up to dowlais.\r\nWhat about the people who go for walks up there or ride horses up there? What good is it stepping into nature when you have a car park and big buildings right next to it? \r\nI think there are better areas in Merthyr where some of these things could have gone.\r\nWhy do I want a view of this when I bought my house to live by the countryside.\r\nI want to see mountains and trees out my window not building, roads and car parks. \r\nWhat happens when I cross the bridge over the a470 I’ll be walking to your big business plans where I once fed horses on my right and walked in the forestry on my left, now I’ll be walking into an indoor water park?  \r\n', NULL),
(61, 979, 'please keep me notified\r\n100% begind this scheme sooner the better...\r\nJamie', NULL),
(59, 980, 'Hi just wanted to say this looks amazing! Definately something which would put merthyr firmly on the map. I really hope it goes ahead x', NULL),
(46, 981, 'Would be fantastic for the area. There\'s nothing at all to rival it, the job opportunities would be great for the town, as would the tourism brought to the area. \r\nI\'m sure you\'ll get your fair share of people opposing, They\'ll no doubt be the same group that wanted to oppose trago mills. And yet they are all there often enough :)\r\n\r\nPlease push ahead with the plans and bring something new and exciting to the area for many to experience and enjoy', NULL),
(45, 982, 'The plans look fantastic. I really hope this goes ahead, showing Merthyr historic past, but also looking  to th future, creating attractions to drive people into the town, increase jobs and the economy.', NULL),
(50, 983, 'No thanks why would you want to destroy what little of the countryside we have left in our village. With all the pollution etc and more havoc to our roads. We already have a bike park and plenty of hotels also had a ski slope in pentrabach a few years ago and that did not work.\r\nOr why not do something with the opencast by dowlias!!\r\nI have and still walk my dogs in this area everyday and have done for the last 20 years', NULL),
(42, 984, 'I’m guessing the road into this will be opposite Rhydycar on the roundabout on the a470? \r\nEven though that is the gateway for most walkers and horse riders up to the mountains off the bridge going over the a470 so that means they will no longer be able to access this way anymore so I am against it. \r\nYou just want to put this smack bang in the middle of where most people go.\r\nCan’t making out meetings when there wasn’t any information put through the door ', NULL),
(37, 985, 'Hi, I\'m very interested in the SnowCentre as someone who travels to the indoor centre in Milton Keynes. Can you give me more information on this and is it likely to be accepted as a proposal?\r\n\r\nThanks.', NULL),
(51, 986, 'If you get the go ahead when will work commence and when do you think it will all be completed by?', NULL),
(52, 987, 'Oes fersiwn Cymraeg o\'ch gwefan ar gael, os gwelwch yn dda?', NULL),
(134, 988, 'A fantastic opportunity to put Merthyr on the map.  I am thrilled with the plans I have seen so far and look forward to this development coming to our town.  Would like to see more information on the housing proposals and a timeline of when the development is expected to start and finish.', NULL),
(64, 991, 'Why is the company based in Guernsey?', NULL),
(132, 992, 'I think the whole project sounds fantastic and especially the indoor ski slope. \r\nWales was let done by when Cardiff indoor ski slope did not go ahead as planned and we have to travel 100+ miles to get access to any kind of real snow from the South Wales area.\r\n\r\nWe currently travel to Milton Keynes once a month but this would be right on our doorstep and I would come here at least twice a week!\r\n\r\nI\'m sure you would get a lot of customers that would otherwise be travelling to other UK centres and can guarantee you will get many slope users from all over the UK.\r\n\r\nChris', NULL),
(133, 993, 'Hi, I think an indoor ski centre that matches or is better than sites in Europe is an excellent idea for Wales and the UK in particular Merthyr. It would have to be a pretty good slope to compare with places abroad and include a full sized air bag slope for aerial training.\r\nI hope it all happens and is not all hot air.  ', NULL),
(135, 994, 'We\'ve been trying to get in touch with anyone other than the poor people at Grasshoppers (who\'ve been very patient with our frequent calls) regarding an overdue invoice to Rockadove Ltd for some filming work.\r\n\r\nWe\'ve called and emailed to no effect. Please note, unless we hear from someone soon our only next step is to pass this over to a solicitor which i\'m sure will be unhelpful and bad publicity.\r\n\r\nPlease come back to me asap.\r\n\r\nTJ', NULL),
(136, 995, 'Fantastic idea. Merthyr has long been a town on the forefront of change - we embrace it - the first town in the world where those employed in industry outweighed those employed in agriculture. We are a colourful, vibrant town. 20 minutes and you\'re in the beating heart of the capital, 30 and your walking barefoot across Swansea beach. 5 minutes north, your in the most dramatic and outstandingly maintained national park in the UK. Merthyr is an ideal nexus to draw all from the surround country to it for this fantastic project. A true vision of of what Merthyr can be - you have seen Merthyr\'s potential just as those at the forefront of the industrial revolution did - and like those, you my dear friends will not be disappointed. Diolch yn fawr!', NULL),
(137, 996, 'As a parent of 2 keen skiers, please let me know how I can support this proposal', NULL),
(138, 997, 'I really hope this comes to fruition and if it does would you consider something for disabled people - not just the future elite or even the mildly disabled but the profoundly disabled? For people, children especially, with severe impairments it’s almost impossible to easily access activity but snow allows everyone to feel the thrill of speed and wind. We ski with a group called Ice Cool Kids on the dry slope in Pembrey once a month. Any chance of making sure your slope is available and accessible? We’d be more than willing to give you inside info on getting to the ‘purple pound’ and the money that disabled customers want to spend! Good luck', NULL),
(139, 998, 'If you build it they will come! Please go ahead with the ski slope proposal! ', NULL),
(140, 999, 'Being an avid skier and also a military ski instructor, somewhere like this won’t just improve British snowsport talent but give a whole new dimension for military training which is limited to Europe and is a costly time consuming endeavour. Multi activity training outside the military is of great value in retention and also morale, so I believe these plans should be taken forward and built. Great to see somebody pationate about snowsports in the uk and trying to build something to effect the future not just the present.', NULL),
(141, 1000, 'Hello.\r\n\r\nI would like to say how great your regeneration project looks and the opportunities for employment, leisure and homes it will provide \r\nThe indoor snow centre is something that will happen in the UK and this location would be ideal.\r\n\r\nI work in housing regeneration in Manchester and see the value to the community and area of what you want to create.\r\n\r\nBest of luck\r\n\r\nRoss', NULL),
(142, 1001, 'Great idea, can\'t wait for it to happen ', NULL),
(143, 1002, 'Merthyr would benefit greatly from this. It has proven success with Bike Park Wales and these combined will make it adventure tourist capital of Britain. ', NULL),
(144, 1003, 'As Dad of a family of four skiers and boarders were are really interested in skiing in Wales as an alternative to Europe', NULL),
(145, 1004, 'I just wanted to say how excited I am that this project is looking so promising! I\'ve been an avid skier for 16 years and am also learning to snowboard. Living in Penarth, this indoor slope would be by far the easiest one to get to. It would benefit Wales in such a huge way and would also help keep the UK firmly on the map for competitive snow sports! Please please please make this happen :)', NULL),
(146, 1005, 'Maybe a Motorcross practice track would be good as there are lots of children interested in this sport and also families  I myself with my family would pay to go ', NULL),
(147, 1006, 'Very excited about the new proposal for ski slope so close to us. The nearest slope currently is 2.5 hours away. Also think it will be fantastic for Merthyr and will make a huge difference  to the local economy. ', NULL),
(148, 1007, 'Good luck with these plans... can\'t wait to see them take off.\r\n\r\nIf you build an alpine coaster and zipline think about the combination of the two... the zipline coaster. It would be unique in GB and really eco-friendly as it use trees that are already there.\r\nYou\'re welcome\r\n', NULL),
(149, 1008, 'I see that there is not a word of Welsh on your site. It is worth remembering that during the course of the history of Merthyr you outline - right up until the 1930s - it was a majority Welsh-speaking town; indeed, many thousands still speak Welsh in Merthyr. You should respect this linguistic history - and linguistic present! We Welsh speakers are still here in Merthyr. Rhydycar itself is Welsh, of course: Rhyd = ford; y = the; car = vehicle/car (a word borrowed by English from the Celtic languages, as it happens).\r\n\r\nRegards\r\n\r\nTomos', NULL),
(150, 1009, 'Please please let tgis go ahead. The young people of merthyr have been supresed for so long by tge older generation who find faultt and reason to apose any development. As the kids ask the teenagers the people who r going to use this site for years to come. Not the people who worry over traffic or parking or killing the town center who wouldnt use the site ever anyway.', NULL),
(151, 1010, 'Looks amazing', NULL),
(152, 1011, 'Do you have a timescale for plans to develop? I support this project and think it will be fantastic for the near and wide community.', NULL),
(153, 1012, 'Best news ever Cardiff is just all talk we need something to bring on our winter sports. \r\nKeep it going “build it and they will come”. \r\nCheers Gary Lewis. ', NULL),
(154, 1013, 'I love the idea of this and feel the location is great with the nearest indoor snow centre at least 2 hours away.  It will help regenerate the area and add employment to a deprived area.  All positive!  Please keep me in the loop with progress. Thanks ', NULL),
(155, 1014, 'Should be in Sheffield near centre of country on site of old dry ski slope', NULL),
(156, 1015, 'My family and I live locally and would be keen to use the amenities. Please could you forward details of the proposals when available. Thanks', NULL),
(157, 1016, 'This would be fantastic for the area. It would bring in loads of jobs and provide exceptional facilities for local children. Fingers crossed it goes through', NULL),
(158, 1017, 'This looks absolutely amazing and would just fit the town of Merthyr perfectly with its surrounding areas.\r\nPlease can this go ahead\r\nI am rooting for you and hope Merthyr council come up with the sensible answer that this must happen ', NULL),
(159, 1018, 'finally a masterpiece coming to life.. something I have always dreamt of.\r\nI am sure it will fulfill the heart of many snow lovers. \r\nplease be as quick as possible in finishing it so we can all take part. \r\nthe only concern: prices\r\nwill it be accessible to all or just to the lucky few?\r\nhopefully it  opens for everyone', NULL),
(161, 1019, 'I know this area well as I walk and cycle a great deal. I recall many years ago an ambitious plan to develop the north of Merthyr (Ponsticill) at the edge of the Beacons into an glamorous outdoor facility.  Turned down.  We have also seen effort to run a ski slope facilty a bit further down the valley in Pentrebach. Truly awful. \r\nFor some reason MTBC don\'t like change or at least grant projects that are not well thought out.  Trago Mills!!  I suggest your website removes any passing comment about this dreadful store. The nearby climbing centre in Bedlinog shows their support disappears pretty soon after the fanfare. BikePark Wales is another example of MTBC letting go after the launch hype. Ask them how many swimming pools have been closed the last 10 years.  How many tennis courts are available throughout the valley. \r\nI think it\'s a great idea for athletes,  families to enjoy the \'great Great oUtdoors\'and see what Merthyr has to offer. It seems the housing is a condition of your plans and whilst I understand people have to live somewhere a large proportion of your investment will require \'social housing\'.  Merthyr\'s social housing reputation is not good so I am wary of how this best fits into promoting a First Class outdoor faculty. Overall I am exited for the idea however I reserve judgement that MTBC will provide the necessary support both to get it off the ground and in the  longer term . REMOVE REFERENCE TO TRAGO MILLS. ARGHHHH!!!! ', NULL),
(162, 1020, 'Will the site be assesable via good transport links rail or road \r\n', NULL),
(163, 1021, 'Hi\r\nAny chance of doing a news email to keep everyone updated..\r\n\r\nThanks\r\nNick Cooper', NULL),
(164, 1022, 'I think this would be an amazing place with more sporting options on the doorstep of many people who are unable to afford travel to other places. The Merthyr Valley is a beautiful place.', NULL),
(165, 1023, 'I’ve been to snow world landgraff several times and it is awesome compared to British slopes get this built and I’d use it every week. ', NULL),
(166, 1024, 'This sounds like a fantastic idea. My family and I live in Cardiff and several times a year we go drive over 2 hours to the Snowdome in Tamworth. It would be amazing to have this facility just a short drive away.', NULL),
(167, 1025, 'I am in full support of this proposed idea of a snow centre of excellence in Merthyr. As a teacher in the local community I believe the centre will give the local and surrounding schools opportunities to develop skiing and give experiences that some can only imagine. Although I don’t think it will replace our trips to the alps, I believe that providing kids with opportunities to do something like this on their doorstep will only be a positive.', NULL),
(168, 1026, 'I think this is a fantastic idea. With the go carts etc that’s being planned for trago Mills, the bike park wales and the Brecon Beacons this would be a perfect place for school trips etc with so much to do. Also the jobs brought into the area with mines and factory closures over the last 30 years is well needed.  ', NULL),
(169, 1027, 'Superb plans; great to see development outside of Cardiff.\r\nWe often travel to Manchester or Milton Keynes to ski indoors several times a year - this would be amazing for us.\r\n', NULL),
(101, 1028, 'Well, first of all I am very sceptical of your claim that 70% of the coal will be untouched since any work that you propose to do will have to be extracted since it is regard as a \"National Mineral resource\".\r\nPrecisely where will this proposal of yours be located?  You use \"Rhydycar West\" as it\'s location but the site is quite expansive.\r\nI had previously heard mention of your proposal earlier in the year to build this scheme of yours but I had the impression that it runs contrary to the Local Development Plan (LDP) and falls foul of this piece of legislation and it was not going ahead.  Why is your this proposal any different from your previous plan/s?\r\nAny development on this site will cause quite extensive damage to the great qualities that Rhydycar West has in the way of natural history and industrial and archaelogical heritage to name but just a few examples.\r\nHousing on the site will require infrastructure such as roads, drainage and the like so that would not be a good thing for this area.  This will also mean more damage to the site as regards pollution and noise and nuisance to the wildlife/ecology present.  As well as physical damage to the flora and fauna, industrial and archaelogical artefacts present.\r\nI had previously fought against the \"Merthyr Village\" plans and along with fellow concerned people and protestors who vigourously opposed and defeated those daft proposals we will I am sure make our presence felt when it becomes neccessary with regard to your plans.', NULL),
(195, 1029, 'Hope you get the support you need.Would be awesome for the area.', NULL),
(196, 1030, 'Hi I think it a great idea. We need a bigger place to ski, so we can be better skiers as with the other places it doesn\'t take long to go down the slope but takes ages to get to the top.', NULL),
(194, 1031, 'Very interested to see if this comes off!', NULL),
(188, 1032, 'What an amazing concept, which could transform and add so much to the local area\r\n\r\nCongratulations to those who have got the project this far. I’m crossing my fingers and toes to see the dream come to life.\r\n\r\nI’m off to wax my skis in preparation ', NULL),
(189, 1033, 'I hope you pull it off, especially the Equestrian Centre.', NULL),
(190, 1034, 'Excellent idea.  We need more investment in the valleys.   There are more than enough trees.   I hope it goes ahead, we need to attract more investment and jobs.  The valleys are amazing but under-used.  We need to get away from the mining image.  How about cable cars.   ', NULL),
(191, 1035, 'I read about this project in the Western Mail 01/09/18. What a brilliant idea....Wales is in desperate need of such facilities, and our talented sports men and women deserve the BEST! Good luck, and I hope to live to enjoy what Rhydycarwest will have to offer!', NULL),
(192, 1036, 'I know of many Skiers & Boarders in the area who will be delighted to find a snow centre in the area. Many travel a long way to get on snow and some taking trips to the Netherlands SnowWorld at Landgraaf for long weekends or short breaks. This facility could change snow sports in Wales and England.', NULL),
(193, 1037, 'Really hope this project  goes ahead  .Would definitely be skiing twice a week ????', NULL),
(111, 1038, 'Hi all\r\n\r\nKeith here at ITV Wales News.\r\n\r\nVery interested in the ski sports plans for Merthyr\r\n\r\nIs there anyone to interview?\r\n\r\nCould we take in artists impressions?\r\n\r\nMany thanks\r\n\r\nKeith / 084488 10200', NULL),
(181, 1039, 'I fully support the proposed indoor snow slope \r\nI\'m very passionate about skiing and it would be fanastic to have this facility in south wales', NULL),
(182, 1040, 'As a local resident, I think this is amazing. Things like this are what needed to revitalise and energise a town that was dying. ', NULL),
(183, 1041, 'Just read the reports on the proposed snow dome.. what a fabulous facility that promised to be.\r\nA world class sporting venue in Merthyr Tydfil.\r\nI truly hope these plans get the go ahead. ', NULL),
(184, 1042, 'I\'ve been following the progress of this project since I heard about it. I think it would be fantastic to have something like this within the valleys, encouraging more people to be active and enjoy the outdoors. I\'m from blaenau gwent but work in Merthyr Tydfil and it\'s nice to see the valleys getting the opportunity to compete with other countries. I hope this project gets accepted because it can only be good for this area. However I thought the same about the race track planned for gwent, but sadly the government around here doesn\'t seem to think the area needs redevelopment, with projects like these which is a huge disappointment for the people of south wales. \r\n\r\nGood luck, I hope to visit as soon as possible! !', NULL),
(185, 1043, 'Hi,\r\nAs my daughter (Thea Fenwick) is a GB Development Squad skier I would be keen to support this. I can help with digital marketing and project development. Thea can offer input from the athlete perspective. As Thea is currently injured she is available to help (at a distance) if you need it.\r\nThanks\r\nSarah Fenwick', NULL),
(180, 1044, 'This is an outstanding proposal. The draw this would give to the area would be incredible, really putting South Wales on the map. These facilities would be hugely beneficial to the surrounding local communities. I really hope this proposal gets the go ahead.', NULL),
(170, 1045, 'Greetings and congratulations on the project. We were told about the project and your plans for a surf simulator. As the CEO of Pacific Surf Designs (www.pacificsurfdesigns.com), I would very much like to bid on the project if that is possible. We custom-design all of our products and will be able to design you an attraction that will fit within the existing footprint and will draw riders from all over.\r\n\r\nBest,\r\nYong', NULL),
(171, 1046, 'What an amazing potential development. The snow slope must be real snow and not a dry ski slope for it to be a success. \r\n\r\nMyself and family will be regular visitors if this goes ahead. ', NULL),
(172, 1047, 'Please make the new snow dome in Wales go ahead!!!! We need it in the south west. You have so many surfers/action sports people who are based down that way, that it will be an instant hit!!!!! \r\nPLLEEEAAAAAAASSE', NULL),
(173, 1048, 'When this happens I’ll be there evey weekend! so excited for this!!', NULL),
(174, 1049, 'I think the proposed development would be fantastic for Merthyr, and the whole of Wales. The site has very good transport links and would complement the natural adventure resources of the Beacons, the Bike Park of Wales, various local  rock  climbing areas and riding facilities. As a 72 yr old, I can see me using the skiing facilities in my 80s/90s. ', NULL),
(175, 1050, 'What a fantastic venture! Let\'s put this town in the spotlight once again! With the success of recent projects such as the leisure village, bike park Wales, the retail park and trago mills this would be the icing on the cake! What an incredible place we are building for the next generation. It has my complete support. ', NULL),
(176, 1051, 'I\'m the web developer team leader for Merthyr Council.  If I can volunteer my services in any way would always help out for a project like this.  Really hope this will come off.', NULL),
(177, 1052, 'Hello, the whole development sounds very exciting! When will the houses be ready for sale?\r\n\r\nThanks ', NULL),
(178, 1053, 'What are the time scales?\r\n\r\nWhat has been agreed to build?\r\n\r\nWill there be a livery yard?', NULL),
(179, 1054, 'Hi\r\nI am the senior branch manager at Darlows estate agents in Merthyr Tydfil. I am really impressed with this proposed development and would like to offer to help if you need it in relation to any residential housing you have planned on the development. We are part of the Spicerhaart company which has extensive contacts in land and new homes. If you wish to discuss anything then please call me on 01685 723555', NULL),
(186, 1055, 'Yes, yes, one hundred times yes to these proposed plans.  What a magnificent jewel to wear in the crown of merthyr!', NULL),
(187, 1056, 'Get it up and running ASAP. cant wait to get on the snow every weekend (amongst other things). and what a shot in the arm for the valleys community, especially after the \'Circuit of Wales\' fiasco.', NULL),
(197, 1057, 'Dear Sir/Madam,\r\nMyself and my family live in Abercanaid and are extreme excited by your proposed development. We are an extremely active family and are particularly keen skiers. We were just wondering what is the current stage with regards planning and if there is a rough idea on when the facilities could possibly open. Any information would be very welcome. Many thanks in advance. ', NULL),
(199, 1058, 'Simply amazing! I really hope this actually happens.', NULL),
(200, 1061, 'I\'m very happy to this idia and I want to work with you in this project', NULL),
(201, 1062, 'Build it, make the slopes longer and bigger than Landgraaf, get the snow right and people will come from all over Europe not just the uk. We were training recently with teams from all over the world. Build it and they will come!', NULL),
(202, 1063, 'Hi could I have some contact details please, We are Surface2Air Sports one of Europe’s largest Wakeboard, Ski and Kitesurfing Store’s. we weee in talks around 5/6 years ago about another center in Wales very similar to this idea. I’m wondering if we could help in any way.\r\nThanks let me know.\r\nAnfelo', NULL),
(203, 1064, 'I am an A-Level student at Ysgol Gyfun Rhydywaun who is currently studying geography. The title of my personal Investigation is: What opportunities are there for Merthyr Tydfil to grow as an economic hub?\r\nThe Rhydycar West project will feature in my project a lot.  I have a few questions regarding the effects of the Rhydycar West project and would very much appreciate it if you were able to answer them for me, the questions are as follows...\r\n\r\n What will be the economic effects of Rhydyar West on the local area?\r\nWhat will be the environmental effects on the area? \r\nHow will the project effect the local people?\r\nHow will the project effect traffic in the local area and are there any plans to prevent traffic jams caused by Rhydycar West?\r\nHow will it effect Merthyr\'s perception?\r\nWhat measures have been taken to conserve the areas heritage?\r\nWhat will be Rhydycar Wests sphere of influence?\r\n\r\nMany thanks, Adam Harvey\r\n\r\n\r\n', NULL),
(204, 1065, 'Please please make this happen!! Take my money!! ', NULL),
(205, 1066, 'How likely is this project to get off the ground . We are a family of skiers and would love this to happen.  Would you offer a yearly pass when your open ?? ', NULL),
(206, 1067, 'Hi, \r\nReally excited about your plans for Merthyr, is there an update on the planning application please?\r\n\r\nKind regards\r\nGareth', NULL),
(207, 1068, 'Hi,\r\n\r\nMy sons, aged 8 and 11, are keen snowboarders and are extremely excited by the plans for this indoor snow centre. We live in Cardiff and have been travelling to Europe for the last few years so it would be amazing to have somewhere nearby where they could practise. They are also very excited by the plans for a waterpark and rollercoaster! \r\n\r\nMy eldest son Dylan is preparing a speech to do in school for a competition and has chosen to do it on snowboarding, so if you have any extra information on how the plans are developing and a rough estimate of a completion date we’d be very grateful.\r\n\r\nThanks,\r\n\r\nCaitlin ', NULL),
(208, 1069, 'I am very excited by the prospect of having skiing facilities nearby. Could you please give me more information regarding the proposed timescale of the development of the ski slope. Thanks', NULL),
(209, 1070, 'Indoor snow centre info', NULL),
(210, 1071, 'Hi I came to your exhibition in the Red house in the summer and I was wondering if you have any further information on the houses that you are hoping to build on the site?', NULL),
(211, 1072, 'Good morning,\r\n\r\nI have been keenly watching this development proposal for the last few years and just wanted to say that I think this is a wonderful idea that will provide south Wales with a new tourist attraction, unmatched anywhere else in the UK.  It will be great for the local community and the job sector in general in south Wales. More importantly, it will save me having to travel the whole way to London to get some summer snowboarding in.....\r\n\r\nGood luck and grateful if i can be provided with any updates as this scheme progresses.\r\n\r\nregards \r\n\r\nGareth \r\n', NULL),
(212, 1073, 'Really excited at the prospect of a project like this coming to Merthyr. I am originally from Bristol and when we have wanted to visit such centres the closest place is Tamworth which is much further! I am really pleased that you are looking at a number of facilities in the area and think it will really prosper! I also think the addition of food outlets and hotel would be in demand especially with the additional business that Bike Park wales has brought to the area. Good Luck ', NULL),
(213, 1074, 'Hello all,\r\n\r\nHope you are doing well.\r\nJust out of curiosity, how’s the planning going? Any time or dates where we will find out? \r\nThank you \r\nDavid', NULL),
(214, 1075, 'Hi,\r\nJust wondering what your propsed timeline is for this? Sounds amazing! \r\n', NULL),
(215, 1076, 'I emailed you about a month ago regarding any more development on the types of houses you are hoping to build. I have never received a reply. Can you please let me have an update? ', NULL),
(216, 1077, 'I have lived in Merthyr Tydfil all my life, (66 years) and spent many happy days wandering the countryside between Heolgerrig and Abercanaid; I have long believed that this area holds tremendous potential for tourist development, this has my full support, providing the historical monuments and nature trails have free access to local people to walk and enjoy their local countryside!? ', NULL),
(217, 1078, 'We definitely need facilities like these in the UK .\r\nPeople could combine summer activity holiday s with winter sports. What more could you need.perfect holiday destination.', NULL),
(218, 1079, 'Hello any news on if a snow dorm will be built? Be amazing if it would be! ', NULL),
(219, 1080, 'really cant wait for this to be built. I have a 14 yr old son who wants to do Snowboard Cross, and there is no where to do it where we live, but the chance to spend a long weekend here will help him to live his dream and maybe get him into one of the teams.\r\nThe sooner it can be built the better. \r\nIt sounds ideal for the rest of the family who dont ski or board, with so many activities and in a fantastic part of the country.\r\n\r\nWhen can I start planning to go? when is the slope due to be built?\r\n\r\n', NULL),
(220, 1081, 'Hi, \r\n\r\nMy family and I are very, very keen to have this ski slope and would love to know when it might be opened? We live in Cardiff and currently drive to Tamworth to enjoy skiing on real snow in between skiing holidays.\r\n\r\nIf we had this so close, we\'d be able to come on a regular basis so would appreciate a member\'s scheme.\r\n\r\nI cannot stress how enthusiastic we are about this.\r\n\r\nRegards\r\n\r\nJeremy Lukins', NULL),
(221, 1082, 'Amazing plans for the future. When is the ski slope expected to be completed please?', NULL),
(222, 1083, 'I am looking for more information with regards the Rhydycar West Ski resort. :) \r\nThanks ', NULL),
(223, 1084, 'Hi\r\nI am researching the potential for Snowboard Instructing at your proposed Snow Dome on behalf of a client that runs a UK based Snowsports teaching company. The company offers Snowboard teaching and coaching courses and camps based in UK snow domes and at locations in the French alps.\r\n\r\nWe read with interest the press announcements in September 2018 that you were applying for planning permission to build an indoor snowsports centre in Merthyr Tydfil. \r\n\r\nCan you update me on how your project is progressing please and in particular:\r\nHave you passed the planning approval stage yet? If so when do you plan to commence construction and do you have a projected opening date yet?\r\nAre you looking for business partners to develop the snow sports offering on site as you build the facility and eventually open it for business?\r\n\r\nWho could we talk to about this aspect of your project in more detail.\r\n\r\nKind regards\r\n\r\nBrian Cooper\r\n\r\n', NULL),
(224, 1085, 'Hi - just wondering what the current timeline is for the new snowdome?', NULL),
(225, 1086, 'Hello,\r\n\r\nFirstly, I\'d just like to say that I\'m very, very excited to see this project come to fruition! I\'m an avid snowboarder and mountain biker (as well as a surfer), so this facility looks to be one of the best advents to South Wales I\'ve ever seen. \r\n\r\nI regularly make the trip to Tamworth for their snowdome, so to have something like this on my doorstep will be a dream come true.\r\n\r\nNow then -- lipservice over -- I\'d like to extend myself to you in a professional capacity. My name is Daniel Morgan, and I\'m a local copywriter and content creator living in Neath. I work independently as an author and freelance as a content writer, too. I\'ve worked with companies all over the world, producing everything from web copy to blogs to business proposals. I\'ve worked on scripts for promo videos, produced company stories and put together large-scale marketing campaigns. I try if I can to work with local companies as I feel that Wales has so much to offer, and often gets overlooked. \r\n\r\nRecently, I\'ve worked with companies like Cygnet Gin and Penarth Gin to realise their stories, as well as with established digital design companies in Swansea, Cardiff, and internationally, too. \r\n\r\nMy work history is varied and I don\'t intend to list all the people I\'ve worked with -- but what I will say is that each and every one of them has told me that the passion I bring to projects really shows through my copy, and helps to connect their brands with customers. And that\'s because I cherrypick who I work for and with, and only give myself to projects I really believe in. \r\n\r\nAnd this looks like it\'s one of them! I\'d love nothing more than to work in the development of this project however I can, and I would leap at an opportunity to assist with some of the content creation during the marketing of this wonderful new facility. If there\'s anything I can do, be it website content, blogs, general copy, or anything else, I\'d be grateful for the chance to show you what I\'m capable of. This is something I can\'t wait to see come to South Wales, and if there is some way I can help, I\'d be absolutely delighted to do so. \r\n\r\nI very much hope to hear from you, and I look forward to helping make Rhydycar West a reality for all the budding skiers, snowboarders, bikers, surfers, and thrillseekers across South Wales and beyond.\r\n\r\nSincerely,\r\nDaniel Morgan', NULL),
(226, 1087, 'Evening,\r\nAs an avid sports Fan please can you send an update on development in relation to this great plan.\r\nRegards Paul.', NULL),
(227, 1088, 'I am very concerned that this development will be a repeat of what happened when Bike Park Wales was developed. The whole area where we used to walk and cycle since we were kids became off limits over night. As usual with any developments that are given the green light in Merthyr, the people of Merthyr are not permitted to have a say. There is never any compromise! Planning is done under the radar and we just have to accept what ever monstrosity we are dealt. One recent example is Trago Mills. An eye sore that dominates the area that looks more prominent in the landscape than Cyfarthfa Castle. Where can I find detailed plans of your company’s intentions for this area? You give the impression that our heritage and landscape is important to you but I struggle to believe that. I think it’s all about the money. This is an area reclaimed by nature and the wildlife is thriving. The tips, tramroads etc are all a part of our town heritage, or what’s left of it! I fear that this secluded area will be transformed into a bustling network that will destroy the experience so many of us local people love and enjoy. ', NULL),
(228, 1089, 'Please make this happen. Having read your plans for rhydycar west I\'m thrilled at the prospect of haveing such amazing facilities on my door step. I have nothing but positivity about this development and I just hope you make it work.', NULL),
(229, 1090, 'Really think you are missing a trick here by not adding something like birdwatching/wildlife hides etc, photography and birdwatching is having a boom ATM and there are lots of varied birds here including kites, goshawks, sparrowhawks, kestrels, jays woodpeckers, I could go on. Look at Newport wetlands, Llandegfedd or Llangorse, this is an oppurtunity to put something there that would not only benefit photographers/birders but could be intergrated into educational days out etc.', NULL),
(230, 1091, 'Hi there I am interested in finding out how you will manage the tenders for the work to be carried out? ', NULL),
(231, 1092, 'Hi \r\n\r\nI live very near to the site and I was wondering when  you anticipate construction  to begin?  Also have you Appointed a principal contractor? \r\n\r\nAll the best \r\n\r\nAlex', NULL),
(232, 1093, 'Hi - just wondering what the timescales are for the development? Particularly the snow centre?\r\n\r\nThanks\r\n\r\nGavin', NULL),
(233, 1094, 'Please leave Merthyr as it is.  I love travelling home from work and looking across to the area west of Merthyr.  I played up there as a child and I know the area very well.  Please don\'t spoil it.  Merthyr has been pulled apart enough down through the years.  The area is naturally pretty please leave it that way. ', NULL),
(234, 1095, 'I was very happy to first hear about these planes years ago. I am more happy to see them progress and see you are taking the time the curate the area as best fits it. I am looking forward to the investment in Merthyr both financially and the opportunity for families and younge people in Merthyr. ', NULL),
(235, 1096, 'I think this a very bad move for merthyr we have already got enough pollution in out town without adding to it.\r\nThere used to be ski slope in pentrebach which was a flop and has left the mountain scared.\r\nAlso I thought Celtic energy owned the mineral rights on the site so what happens to the coal beneath or is this being kept quite until you get the planning through.\r\nI for one now you cannot build on top of coal. That\'s without saying all the shafts that are still there.\r\nWhat about the wildlife there are crested newts. Birds insects and all sorts that have to suffer for some to have a bit of fun. If you want to go snowboarding move to a country where they have snow\r\n', NULL),
(236, 1097, 'Ydych yn ymwybodol bod y Gymraeg yn bodoli?', NULL),
(237, 1098, 'Exciting times ahead for the region hope all goes to plan the area is calling out for these types of activities ????????', NULL),
(238, 1099, 'This would be a great addition to what we have already in the area and will bring people from all of the country / world to visit !  and bring great employment and a boost to the area ', NULL);
