INSERT INTO `sym_entries_data_481` (`id`, `entry_id`, `value`, `value_formatted`) VALUES
(1, 911, 'Hello!\r\n\r\nThank you so much for your lovely email. I’m assuming you received our informational brochure? I’m attaching a copy of it here just in case. Our emerging plan is outlined in that document and we will be presenting additional information on each element during the events next weekend. I’m sorry you won’t be able to attend! More information will be available after these events. \r\n\r\nOur website is also active - rhydycarwest.com.\r\n\r\nIn terms of the process, following the informal public consultations we will be looking to submit a planning application in the months ahead. We’re very much looking forward to hearing from the community in the coming weeks and will be incorporating the feedback we receive on an ongoing basis into the autumn.\r\n\r\nPlease keep in touch and if you have any ideas or suggestions please feel free to provide them via our website link rhydycarwest.com/suggestions.\r\n\r\nThank you again for your support of this project.\r\n\r\nKind regards,\r\n\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(2, 901, '\r\nHi Amanda,\r\n\r\nThe invitation is for the project launch reception on the evening of June 29th at the Redhouse in Merthyr. The informational brochure is noting the public exhibition days on the following day, also at the Redhouse location.\r\n\r\nHope you will be able to join us on the 29th!\r\n\r\nKind regards\r\n\r\nJordan Carr\r\nRhydycar West\r\n+44 7950 902925', NULL),
(3, 898, 'TEST ok!', NULL),
(4, 931, 'Hi Michael,\r\n\r\nYes that would be of interest - thank you! We are very aware that the site has a long history and there are probably many people in the area who have both memories and potential documents related to the site. We would welcome the opportunity to collect these and work with the historians in the area to preserve the documents.\r\n\r\nWere you planning on attending any of the events this coming weekend? I will be at all of them so if you’d like to bring them along that would be great. If not I could arrange to collect them from you at another time.\r\n\r\nThanks again for the offer.\r\n\r\nKind regards,\r\n\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(5, 985, 'Morning,\r\n\r\nThanks for your interest in the proposal.  We are just in the process of talking with the community about the development ideas. We’ve had a tremendously positive response to the plans so far and we’ll be continuing to discuss and refine the plans, looking to submit a planning application in the coming months.\r\n\r\nOur website will be the best way to keep in touch with us, so please check back often and let us know if you have any other ideas for the SnowCentre or other elements on the site.\r\n\r\nThanks again for your interest in Rhydycar West.\r\n\r\n\r\nJordan Carr', NULL),
(7, 902, 'Hi Karen\r\n\r\nThanks for your email. Please pass on our thanks to Councillor Poole - although he was unable to attend there was good representation from Caerphilly Borough which was much appreciated. If he or other Borough staff or Councillors would like to hear more about our development plans, please contact me. I’d be happy to make a presentation in Caerphilly if that would be helpful.\r\n\r\nThe response to the plans has been overwhelmingly positive and we would be more than willing to answer any questions people may have as we more forward.\r\n\r\nKind regards,\r\n\r\n\r\nJordan Carr\r\nBusiness Development\r\nRhydycar West', NULL),
(8, 984, 'no email - unable to respond', NULL),
(9, 975, 'no email - unable to respond', NULL),
(10, 974, 'no email - unable to respond', NULL),
(11, 982, 'no email - unable to respond', NULL),
(12, 981, 'no email - unable to respond', NULL),
(13, 977, 'no email - unable to respond', NULL),
(14, 976, 'no email - unable to respond', NULL),
(15, 978, 'no email - unable to respond', NULL),
(16, 983, 'no email - unable to respond', NULL),
(17, 986, 'Hi Colin,\r\n\r\nThanks for your interest in the development plans for Rhydycar West.  In terms of commencement and completion dates, with a development of this size and scope, the construction will need to be conducted in phases.\r\n\r\nI would hesitate at this stage to give an exact timeline but certainly as we prepare to submit a planning application in the coming months, work would begin following detailed planning approval with the various elements built in succession over a few years.\r\n\r\nOur website will be the best place to keep up to date on the plans and schedule as things progress.\r\n\r\nThanks again for your interest in the project.\r\n\r\nKind regards,\r\n\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(18, 987, 'Use this tweak. Basically it starts with a \'thanks for your message... we will be launching a welsh version of the site shortly\'\r\n\r\nDiolch am eich neges, mi fyddwn yn lawnsio fersiwn Gymraeg o\'r wefan yn fuan.\r\n\r\n\r\nI\'ll need to collate the English copy from the site and get it translated. Estimate this will need to happen next week.\r\n\r\nTidy\r\n\r\nAndrew', NULL),
(20, 973, 'Hi Beth,\r\n\r\nI appreciate that you’ve taken the time to write to us. Thank you.\r\n\r\nI’m not sure what you’ve seen of the ideas that we’ve been discussing however we’ve been talking with people at our events at the Redhouse for the last two days and tomorrow we will be at:\r\n\r\nAbercanaid Community School from 10:30 - 12:30 \r\nHeolgerrig Social Club from 2:30 to 4:30\r\n\r\nWe are actively asking the community to tell us what development would work on the site - contributing to the preservation of the heritage of the site, the life of the community and the long term economic health of the area for generations to come.\r\n\r\nI hope you will come out and discuss your concerns with us tomorrow. \r\n\r\nAgain, thank you for your email and please keep in touch.\r\n\r\nKind regards,\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(21, 972, 'Hi Leean,\r\n\r\nThank you for your interest in the development proposal for Rhydycar West.  I’m not sure if you were able to attend our events in Merthyr this past weekend but we do have various maps available that detail where the elements and amenities are currently proposed to be situated, as well as information regarding the heritage monuments on the site.\r\n\r\nWe will be putting the exhibition boards and maps that were on display on the weekend on our website and there is already information there related to the scheduled monuments. We are hoping to restore and preserve all of the heritage elements on the site and heritage walking trails are part of the overall plan.\r\n\r\nOur website at rhydycarwest.com will be the easiest way to see how the plans are developing. You can also provide suggestions for the development through the website or my emailing me directly.\r\n\r\nThanks again for your interest in the development.\r\n\r\nKind regards,\r\n\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(23, 971, 'Hi Chris,\r\n\r\nThank you for your interest in the development proposal at Rhydycar West. You are correct there is to be no open cast mining on the site.\r\n\r\nOur plans are described on our website at rhydycarwest.com and the exhibition boards and maps that we presented to the community this past weekend will be put on our website shortly.\r\n\r\nIf you have any other questions or suggestions regarding these emerging plans, please feel free to contact us via our website or by emailing me directly.\r\n\r\nThanks again for your interest.\r\n\r\nKind regards,\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(25, 980, 'Hi Nicola,\r\n\r\nThanks so much for your interest and support of the proposal. Yes we received an overwhelmingly positive response at our events in Merthyr on the weekend and we’re very much looking forward to continuing conversations with the community as the plans move forward.\r\n\r\nPlease keep in touch via our website/twitter and Facebook and let us know if you have any suggestions for us!\r\n\r\nKind regards,\r\n\r\n\r\nJordan Carr', NULL),
(26, 970, 'Hi Stephen,\r\n\r\nThank you for your interest in the development proposal. I hope you were able to come out this past weekend and see the various plans. We will be putting those plans and maps on our website as quickly as possible.\r\n\r\nPlease feel free to send us suggestions and recommendations as we move forward.\r\n\r\nThanks again for your interest and support.\r\n\r\nKind Regards\r\n\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(27, 979, 'Hi Jamie,\r\n\r\nThanks for your interest in the Rhydycar West proposals. The best way to stay in touch with our plans is to follow our Twitter and Facebook and to check back on our website periodically. We will let people know when our next public events are scheduled and you are always welcome to contact us via email either through the website or directly to this email address.\r\n\r\nThanks again, hope you have a good weekend.\r\n\r\nKind Regards,\r\n\r\n\r\nJordan Carr\r\nRhydycar West ', NULL),
(28, 991, 'Hi Robert,\r\n\r\nSorry for the delay in getting back to you - and thank your for your interest in our development plans. In answer to your question, Marvel is not UK based. They have investments in many places around the world and operate internationally.\r\n\r\nPlease keep in touch with us via our website and let me know if you have further questions or suggestions.\r\n\r\nKind regards,\r\n\r\nJordan Carr\r\nRhydycar West', NULL),
(77, 1054, 'Sorry for the delay in getting back to you - things have been busy as I’m sure you can imagine! I’m out of town right now but due back in a couple of weeks and yes will give you a call when I return. As you are aware we are including residential housing as part of the scheme so it would be good to connect.\r\n\r\nKind regards,\r\n\r\n\r\n\r\nJordan Carr I Business Development\r\ne. jordan@rhydycarwest.com I w. www.rhydycarwest.com\r\n \r\nRW-MasterLogo-Landscape-RGB', NULL),
(30, 992, 'Hi Chris,\r\n\r\nSorry for the delay in getting back you - and thank you for your support of the development plan. Please keep in touch with us as we move forward with our plans for the project.\r\n\r\nKind regards,\r\n\r\nJordan Carr I Business Development\r\ne. jordan@rhydycarwest.com I w. www.rhydycarwest.com\r\n \r\nRW-MasterLogo-Landscape-RGB', NULL),
(31, 993, 'Hi Mark,\r\n\r\nSorry for the delay in getting back you - and thank you for your support of the development plan. Please keep in touch with us as we move forward with our plans for the project.\r\n\r\nKind regards,\r\n\r\nJordan Carr I Business Development\r\ne. jordan@rhydycarwest.com I w. www.rhydycarwest.com\r\n \r\nRW-MasterLogo-Landscape-RGB', NULL),
(32, 988, 'Sorry for the delay in getting back you - and thank you for your support of the development plan. Please keep in touch with us as we move forward with our plans for the project.\r\n\r\nKind regards,\r\n\r\nJordan Carr I Business Development\r\ne. jordan@rhydycarwest.com I w. www.rhydycarwest.com\r\n \r\nRW-MasterLogo-Landscape-RGB', NULL),
(33, 994, 'Have forwarded to Leigh', NULL),
(34, 995, 'no return email - unable to respond', NULL),
(35, 996, 'Sorry for the delay in getting back you - and thank you for your support of the development plan. In terms of support for the project, sharing our plans and ideas through your own personal networks is always helpful - and if you have any thoughts of things we could be including on the site we’d be happy to hear about them! Please keep in touch via our website as we move forward.\r\n\r\nKind regards,\r\n\r\nJordan Carr I Business Development\r\ne. jordan@rhydycarwest.com I w. www.rhydycarwest.com\r\n \r\nRW-MasterLogo-Landscape-RGB', NULL),
(36, 997, 'Hi Alison,\r\n\r\nSorry for the delay in getting back you - and thank you for your support of the development plan. We are working closely with \r\nSnowSport Wales on the snow centre plans to ensure the snow centre can accommodate all ages and abilities.  Please keep in touch with us as we move forward with our plans for the project and if you have specific ideas regarding accessibility please feel free to forward them.\r\n\r\nThanks again for your interest in the project.\r\n\r\nKind regards,\r\n\r\nJordan Carr I Business Development\r\ne. jordan@rhydycarwest.com I w. www.rhydycarwest.com\r\n \r\nRW-MasterLogo-Landscape-RGB', NULL),
